"SWPH01" : "<div class=Section1><h1 class=helpfile>Hjælp </h1><p>Skærmbillederne med grundlæggende indstillinger giver dig mulighed for at konfigurere, opgradere og kontrollere status for din NETGEAR Cable/DSL Wireless Router.</p> <p>Klik på et punkt i kolonnen længst til venstre. De aktuelle indstillinger eller oplysninger for det område vises i den midterste kolonne. </P><p>I denne kolonne vises nyttige oplysninger for de valgte indstillingsskærmbilleder. Hvis du bruger Internet Explorer, kan du klikke på et punkt i den midterste kolonne for at hoppe direkte til det tilknyttede afsnit under Hjælp; ellers kan du rulle ned, indtil du finder det. <hr><a name=bsetting></a></P><P><font size=4><B>Hjælp til Grundlæggende indstillinger</B></font></P><p><B>Bemærk:</B> Hvis du er ved at konfigurere routeren for første gang, kan du sandsynligvis bruge standardindstillingerne uden at ændre dem. <a name=question></a></P><p><B>Kræver din internetforbindelse login?</B> </P><p>Vælg denne indstilling baseret på den type konto, du har hos din internetudbyder. Hvis du skal angive logonoplysninger, hver gang du opretter forbindelse til internettet, eller du har en PPPoE-konto hos din internetudbyder, skal du klikke på <B>Ja</B>. Hvis ikke, vælg <B>Nej</B>. </p><p><B>Bemærk: </B>Hvis du har installeret PPP-software som f.eks. WinPoET (fra Earthlink) eller Enternet (fra PacBell), så har du PPPoE. Klik på <B>Ja</B>. Når du har klikket på Ja og konfigureret din router, behøver du ikke at køre PPP-softwaren på din pc for at oprette forbindelse til internettet.</p> <a name=isp></a><h2 class=helpfile>Internetudbyder</h2><p>Vælg tjenesten fra din internetudbyder. <B>Andre </B>(PPPoE) er det mest almindelige. <B>PPTP</B> bruges i Østrig og andre europæiske lande. </p><a name=login></a><h2 class=helpfile>Log på </h2><p>Dette er normalt det navn, som du bruger i din e-mail-adresse. Hvis din primære mailkonto f.eks. er JerAB@ISP.com, skal du skrive JerAB i dette felt. </p><p>Nogle internetudbydere (som f.eks. Mindspring, Earthlink og T-DSL) kræver, at du bruger hele e-mail-adressen, når du logger på. Hvis din internetudbyder kræver hele e-mail-adressen, skal du skrive den i feltet <B>Login</B>. </p><a name=password></a><h2 class=helpfile>Adgangskode</h2><p>Skriv den adgangskode, du bruger til at logge på hos din internetudbyder. </p><a name=serv_name></a><h2 class=helpfile>Godkendelsesserver</h2><p>Angiv adressen (enten IP-adressen eller domænenavnet) på din internetudbyders server.</p><a name=idletime></a><h2 class=helpfile>Timeoutgrænse for inaktivitet</h2><p>En ledig internetforbindelse vil blive afbrudt efter dette tidsinterval.</P><p>Hvis denne værdi er nul (0), vil forbindelsen blive &quot;holdt i live&quot;, og forbindelsen vil blive genetableret med det samme, hvis den mistes.</p><a name=DNSaddress></a><h2 class=helpfile>Adresse på domænenavneserver (DNS) </h2><p>DNS-serveren bruges til at slå hjemmesideadresser op, baseret på deres navne. </p><p>Hvis din internetudbyder har givet dig en eller to DNS-adresser, skal du vælge <B>Brug disse DNS-servere</B> og vælge primær og sekundær adresse. </p><p>Vælg ellers <B>Hent automatisk fra internetudbyder</B>. </p><p><B>Bemærk: </B>Hvis du får fejlen Adresse ikke fundet, når du går ind på en hjemmeside, er dine DSN-servere sandsynligvis ikke konfigureret korrekt. Du bør kontakte din internetudbyder for at få DNS-serveradresserne. </p><h2 class=helpfile><a name=localaddress></a>MAC-adresse for routeren </h2><p>Alle computere og routere på dit netværk har en entydig 48-bit lokal Ethernet-adresse. Dette kaldes også computerens MAC-adresse (Media Access Control). </p><p>Du kan som regel vælge <B>Brug standardadresse.</B></p><p>Hvis din internetudbyder kræver MAC-godkendelse, skal du enten vælge <B>Brug computerens MAC-adresse </B>for at få routeren til at bruge MAC-adressen på den computer, du bruger nu, eller <B>Brug denne MAC-adresse </B>til manuelt at skrive den MAC-adresse, som din internetudbyder forventer.</p> <p>MAC-adressens format er XX:XX:XX:XX:XX:XX. Hvis du vælger <B>Brug denne MAC-adresse</B> og skriver en MAC-adresse, skal du ikke vælge <B>Brug denne computers MAC-adresse</B>, for så overskrives din indtastning.</p><a name=buttons> </a><h2 class=helpfile>Knapperne Anvend, Annuller og Test</h2><p>Klik på <B>Anvend</B>, når du er færdig med at ændre indstillingerne. </p><p>Klik på <B>Annuller</B> for at gå tilbage til de forrige indstillinger. </p><p>Klik på <B>Test</B> for at få adgang til NETGEARs websted. Hvis du har fået oprettet forbindelse, virker dine indstillinger, og du kan klikke på <B>Log ud </B>for at afslutte disse skærmbilleder og...  gå i gang med at surfe på nettet!</p><p>Hvis der ikke er oprettet forbindelse, skal du gøre følgende: </p><ul><li>Gå igennem indstillingerne, og sørg for, at du har markeret de korrekte valg og skrevet alt korrekt. </li><li>Kontakt din internetudbyder for at få bekræftet konfigurationsoplysningerne. </li><li>Læs afsnittet om fejlfinding i enhedens <I>installationsvejledning</I>.</li><li>På enhedens <I>Ressource-cd</I> kan du læse <I>installationsvejledningen</I> eller afsnittet om fejlfinding i <I>referenceguiden</I>.</li><li>Kontakt NETGEAR&apos;s tekniske support.</li></ul> </div>",
"SWPH02" : " <P><font size=4><B>     Hjælp til Installationsguide (Setup Wizard)  </B></font></P>  <p>Installationsguide (Setup Wizard) har registreret, at der allerede findes en aktiv internetforbindelse. Da din internetforbindelse synes at fungere korrekt, er det måske ikke nødvendigt for dig at fortsætte med Installationsguide (Setup Wizard). Hvis du beslutter at fortsætte med Installationsguide (Setup Wizard) kan der forekomme nogle ændringer af din nuværende konfiguration. NETGEAR anbefaler, at du foretager en sikkerhedskopiering af dine aktuelle indstillinger, inden de fortsætter med Installationsguide (Setup Wizard). <p>Sådan fortsætter du:<ol> <li>Klik på <b>Ja (Yes)</b>, hvis du vil fortsætte med Installationsguide (Setup Wizard).<br><li>Klik på <b>Nej (No)</b> for at forlade Installationsguide (Setup Wizard) og gemme din eksisterende internetforbindelse.</ol> <p>Sådan sikkerhedskopieres indstillinger:<ol> <li>Klik på <b>Nej (No)</b> for at forlade Installationsguide (Setup Wizard) og gemme din eksisterende internetforbindelse.<li>Klik på <b>Indstillinger for sikkerhedskopiering (Back Up Settings)</b> i navigationslinjen for at få vist skærmbilledet til sikkerhedskopiering.<br><li>Når indstillingerne er gemt, skal du køre Installationsguide (Setup Wizard) igen.</ol> >",
"SWPH03" : "<P><font size=4><B>Hjælp til Smart Setup Wizard </B></font></P>             <p>Når du har forbundet routeren til dit netværk, skal du konfigurere den. Du kan gøre dette med brug af Smart Setup Wizard. Guiden vil forsøge automatisk at registrere, hvilken type internettjeneste du har fra din internetudbyder. Eller du kan konfigurere routeren manuel. Det anbefales, at du lader Smart Setup Wizard gøre noget af arbejdet for dig, hvis du ikke er vant til at konfigurere internetforbindelser.<p>Til konfigurationen af routeren skal du bruge de oplysninger, som du tidligere udfyldte i <I>installationsvejledningen</i>.<p>Sådan kommer du i gang:<ol> <li>Vælg <b>Ja (Yes)</b>, hvis du vil bruge Smart Setup Wizard<br>.<br> Vælg <b>Nej (No)</b>, hvis du vil konfigurere routeren manuelt.<li>Klik på <b>Næste (Next)</b>.</ol>",
