"AWCH01" : "<P><font size=4><B>Hjælp til Tilføj WPS-klient</B></font></P><p><a name=internet></a><a name=meter></a>WPS står for Wi-Fi Protected Setup. Med denne funktion kan du tilføje en trådløs klient til netværket uden at skulle konfigurere de trådløse indstillinger (f.eks. SSID, sikkerhedstilstand og adgangskode).<p>Du kan tilføje en trådløs klient, der understøtter WPS ved hjælp af trykknapmetoden.<p>Med trykknapmetoden kan du fuldføre WPS-processen ved at trykke på eller klikke på en WPS-trykknap på klienten (enten en fysisk hardwareknap eller en softwareknap på klientens brugergrænseflade). Se din klients WPS-vejledning for at få flere oplysninger.</p>",
