"UBS018" : "<p>Funktionen ReadySHARE Cloud giver ekstern adgang via Internettet til en USB-lagringsenhed, der er sluttet til din routers USB-port.</p><p><b>Sådan konfigureres ReadySHARE Cloud</b></p><p>Trin 1: Du har behov for en ReadySHARE Cloud-konto. Hvis du ikke har en <a class=&quot;&quot;linktype&quot;&quot; target=&quot;&quot;_blank&quot;&quot; href=&quot;&quot;https://readyshare.netgear.com/site/index.jsp?pid=4&src=enhed&quot;&quot;>, skal du klikke her</a> for at få en.</p><p>Trin 2: På denne side skal du angive dit ReadySHARE Cloud-brugernavn og -adgangskode for at registrere din router og den USB-enhed, som er sluttet til den med din konto.</p><p>Trin 3: Log igen på <a class=&quot;&quot;linktype&quot;&quot; target=&quot;&quot;_blank&quot;&quot; href=&quot;&quot;http://readyshare.netgear.com/&quot;&quot;>http://readyshare.netgear.com/</a> med din konto. Du bør kunne se den USB-enhed, som er sluttet til din router.</p><p>Trin 4: Første gang bliver du anmodet om at hente en Windows klient, der anvendes til at oprette en sikker forbindelse fra din pc til routerens USB-enhed. Log på denne klient, og du har adgang til USB-enheden fra et vilkårligt sted.</p><p><b>Bemærk!</b> Uden denne klient kan du gennemse indholdet på din USB-enhed, men du kan ikke åbne filer eller foretage ændringer af dem</p>",
