"UBSH01" : "<P><font size=4><B>ReadySHARE Printer-hjælp</B></font></P><p>ReadySHARE Printer gør det muligt at lade Windows pc&apos;er og Mac computere at dele en USB-printer, som er sluttet til routerens USB-port.</p>",
"UBSH02" : "<P><font size=4><B>ReadySHARE Cloud-hjælp</B></font></P><p>Funktionen ReadySHARE Cloud giver ekstern adgang via Internettet til en USB-lagringsenhed, der er sluttet til din routers USB-port, uanset hvor du befinder dig. Du kan også give familie eller venner adgang til den.</p><p><b>Sådan konfigureres ReadySHARE Cloud</b></p><p>Trin 1: Du har behov for en ReadySHARE Cloud-konto. Hvis du ikke har en, skal du klikke på linket på denne side for at gå til NETGEAR ReadySHARE Cloud-siden for at oprette en konto. <br/>Du bliver anmodet om at angive en gyldig e-mail-adresse, der kan anvendes til at gendanne dit brugernavn eller din adgangskode.<br/>Trin 2: Efter Trin 1, skal du vende tilbage til denne router-webside og angive dit ReadySHARE Cloud-brugernavn og -adgangskode for at registrere din router og den USB-enhed, som den er sluttet til.<br/>Dette registreringstrin skal startes fra din NETGEAR-router, hvilket betyder, at du ikke kan registrere din router via NETGEAR ReadySHARE Cloud-webstedet <a target=&apos;_blank&apos; href=&apos;http://readyshare.netgear.com&apos;>http://readyshare.netgear.com</a>.<br/>Trin 3: Log ind igen på <a target=&apos;_blank&apos; href=&apos;http://readyshare.netgear.com&apos;>http://readyshare.netgear.com</a> med din konto. Du bør kunne se den USB-enhed, som er sluttet til din router. Som standard har du adgang til alt indholdet på USB-enheden. Du kan oprette en ny deling, der er begrænset til en vilkårlig delmængde af indholdet med det sikkerhedsniveau, du angiver.<br/>Trin 4: Første gang du bruger ReadySHARE Cloud, bliver du anmodet om at hente en Windows klient, som anvendes til at oprette en sikker forbindelse fra din pc til routerens USB-enhed. Log på denne klient, hvorefter du har adgang til USB-enheden fra et vilkårligt sted.<br/>I øjeblikket kan du kun hente Windows OS klienten. Mac OS klienten vil være klar på et senere tidspunkt på webstedet.<br/> <b>Bemærk!</b> Uden denne klient kan du kun gennemse indholdet på din USB-enhed ved at klikke på ikonet &apos;+&apos; (tilføj deling) på webstedet. Du kan ikke åbne filer eller foretage ændringer af dem. </p><p><b>Brugernavn og adgangskode</b></p><p>Dette er den ReadySHARE Cloud-konto, du har oprettet på NETGEAR webstedet i Trin 1.<br/> Routeren med USB-lagringsplads vises kun, når du har registreret den. Internet-forbindelsen mellem routeren og ReadySHARE Cloud-serveren forbliver aktiv, indtil du nedlægger registreringen.<br/> Du kan også registrere routeren med en anden konto, efter at du har nedlagt registreringen fra den tidligere konto.<br/></p>",
"UBSH03" : "<P><font size=4><B> Hjælp til USB-lagring (Grundlæggende indstillinger) (USB Storage (Basic Settings))</B></font></P><P><B>BEMÆRK:</B> Denne side viser de aktuelle indstillinger for USB-lagring. Klik på Rediger (Edit) for at redigere en af de viste indstillinger eller oprette en ny netværksmappe </P><P><a name=device></a><B> Netværks-/enhedsnavn (Network/Device Name)  </B></P><P> Er navnet, der bruges til at få adgang til routeren fra den bærbare/pc. Du kan enten klikke på netværket/enhedsnavnet på routerens brugergrænseflade for at få adgang til lagerenheden eller indtaste det i en webbrowser f.eks. //readyshare.</P><P><a name=available_folder></a><B> Tabel over tilgængelige netværksmapper (Available Network Folders Table)</B></P><P> Denne tabel viser alle de netværksmapper, der aktuelt er tilgængelige og konfigurerede på routeren:<UL><LI> Mappenavn (Folder Name): Den fulde sti til netværksmappen </LI><LI> Drevnavn (Volume Name): Drevnavn på lagerenheden (enten USB-drev eller harddisk)</LI><LI> Samlet/ledig plads (Total/Free Space): Viser den aktuelle udnyttelse af lagerenheden </LI><LI> Delingsnavn (Share Name): Du kan klikke på det viste navn i routerens browser for at få direkte adgang til lageret eller du kan indtaste det i en webbrowser f.eks. //readyshare/photos. Hvis der står &apos;Ikke delt (Not Shared)&apos;, så er standarddelingen blevet slettet, og så findes der ingen deling til rodmappen. Klik på linket for at ændre denne indstilling.</LI><LI> Læse-/skriveadgang (Read/Write Access): Viser tilladelser/adgangskontrol til netværksmappen:<ul><li>&apos;Alle - ingen adgangskode (All - no password)&apos; giver alle brugere adgang til netværksmappen </li><li>\&quot;admin\&quot; vil bede brugerne om at angive samme brugernavn og adgangskode, der anvendes til at få adgang til routerens brugergrænseflade </li></ul></LI></UL></P><P><B> Knappen Rediger (Edit)  </B></P><P> Klik for at redigere viste indstillinger eller for at oprette en ny netværksmappe </P><P><B> Knappen Fjern USB-enhed sikkert (Safely Remove USB Device Button)  </B></P><P> Klik for at fjerne enten en eller alle USB-enheder fra routeren sikkert </P><P><B> Knappen Opdater (Refresh)  </B></P><P>Klik for at opdatere siden. Det kan være nyttigt, hvis du lige har tilsluttet en ny USB-enhed</P>",
"UBSH04" : "<P><font size=4><B>Hjælp til ReadySHARE Cloud</B></font></P><p>Funktionen ReadySHARE Cloud giver ekstern adgang via Internettet til en USB-lagerenhed, der er sluttet til din routers USB-port, uanset hvor du befinder dig. Du kan også give familie eller venner adgang til den.</p><p><b>Sådan konfigureres ReadySHARE Cloud</b></p><p>Trin 1: Du skal bruge en ReadySHARE Cloud-konto. Hvis du ikke har en, skal du klikke på linket på denne side for at gå til siden NETGEAR ReadySHARE Cloud for at oprette en konto. <br/>Du vil blive bedt om at indtaste en gyldig e-mailadresse, der skal bruges til at gendanne dit brugernavn eller din adgangskode.<br/></p><p>Trin 2: Efter trin 1 skal du gå tilbage til denne routerwebside og indtaste dit brugernavn og din adgangskode til ReadySHARE Cloud for at registrere din router og USB-enheden, der er sluttet til den.<br/>Dette trin til registrering skal startes fra din NETGEAR-router, hvilket betyder, at du ikke kan registrere din router via NETGEAR ReadySHARE Cloud-webstedet<a target=&apos;_blank&apos; href=&apos;http://ReadySHARE.netgear.com&apos;>http://ReadySHARE.netgear.com</a>.<br/></p><p>Trin 3: Log på <a target=&apos;_blank&apos; href=&apos;http://ReadySHARE.netgear.com&apos;>http://ReadySHARE.netgear.com</a> igen med din konto. Du bør kunne se den USB-enhed, som er sluttet til din router. Som standard har du adgang til alt indholdet på USB-enheden. Du kan oprette en ny deling, der er begrænset til en vilkårlig delmængde af indholdet, med det sikkerhedsniveau, du angiver.<br/></p><p>Trin 4: Første gang du bruger ReadySHARE Cloud, bliver du anmodet om at hente en Windows-klient, der anvendes til at oprette en sikker forbindelse fra din pc til routerens USB-enhed. Log på denne klient, og du har adgang til USB-enheden fra et vilkårligt sted.<br/>I øjeblikket kan du kun downloade Windows OS-klienten. Mac OS-klienten vil være klar på et senere tidspunkt på webstedet.<br/> </p><b>Bemærk:</b> <p>Uden denne klient kan du kun gennemse indholdet på din USB-enhed ved at klikke på ikonet &apos;+&apos; (Tilføj deling) på webstedet. Du kan ikke åbne filer eller foretage ændringer af dem.</p><p><b>Brugernavn og adgangskode</b></p><p>Dette er den ReadySHARE Cloud-konto, du har oprettet på NETGEAR-webstedet i trin 1.<br/> Routeren med USB-lagringsplads vises kun, når du har registreret den. Internetforbindelsen mellem routeren og ReadySHARE Cloud-serveren forbliver aktiv, indtil du fjerner registreringen.<br/> Du kan også registrere routeren med en anden konto, efter at du har nedlagt registreringen fra den tidligere konto.<br/></p>",
