"UAS031" : "<p>ReadyCLOUD-funktionen giver ekstern adgang via internettet til en USB-lagringsenhed, der er sluttet til din routers USB-port.</p><p><b>Sådan konfigurerer du ReadyCLOUD</b><br>Trin 1: Du skal have en ReadyCLOUD-konto. Hvis du ikke har en,<a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/index.html#page=manage&quot;>skal du klikke her for at oprette en konto  </a> og vælge &quot;Opret konto&quot;.<br>Trin 2: Gå tilbage til denne routerside, og indtast dit brugernavn og din adgangskode til ReadyCLOUD for at registrere din router og USB-enheden, der er sluttet til den, til ReadyCLOUD.<br>Trin 3: Log igen på <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/&quot;>http://readycloud-staging.netgear.com/</a> med din ReadyCLOUD-konto. USB-enheden, der er sluttet til din router, vises.<br><b>Bemærk: </b>Du kan bruge et ekstra fjernprogram til at oprette en sikker forbindelse fra din computer eller mobile enhed til routerens USB-enhed.<br>Log på dette fjernprogram, og du kan få adgang til USB-enheden overalt. <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/cloud_download.html&quot;>Klik her</a> for at hente fjernprogrammet.</p>",
