"UAS041" : "<P><font size=4><B>Hjælp til ReadyCLOUD</B></font></P><p>ReadyCLOUD-funktionen giver ekstern adgang via internettet til en USB-lagringsenhed, der er sluttet til din routers USB-port, uanset hvor du befinder dig. Du kan også give familie eller venner adgang til den.</p><p><b>Sådan konfigurerer du ReadyCLOUD</b></p><p><ul><li>Trin 1: Du skal have en ReadyCLOUD-konto. Hvis du ikke har en, skal du klikke på linket på denne side for at gå til NETGEAR ReadyCLOUD-siden og oprette en konto. <br>Du vil blive bedt om at indtaste en gyldig e-mailadresse, der skal bruges til at gendanne dit brugernavn eller din adgangskode.<br><li>Trin 2: Efter trin 1 skal du gå tilbage til denne routerside og indtaste dit brugernavn og din adgangskode til ReadyCLOUD for at registrere din router og USB-enheden, der er sluttet til den.<br>Dette registreringstrin skal startes fra din NETGEAR-router. Du kan ikke registrere din router via NETGEAR ReadyCLOUD-webstedet<a target=&apos;_blank&apos; href=&apos;http://readycloud-staging.netgear.com&apos;>http://readycloud-staging.netgear.com</a><br><li>Trin 3: Log igen på <a target=&apos;_blank&apos; href=&apos;http://readycloud-staging.netgear.com&apos;>http://readycloud-staging.netgear.com</a> med din ReadyCLOUD-konto. USB-enheden, der er sluttet til din router, vises. Som standard har du adgang til alt indholdet på USB-enheden. Du kan oprette en ny deling, der er begrænset til en vilkårlig delmængde af indholdet, med det sikkerhedsniveau, du angiver.<br></ul></p><p><b>Bemærk: </b>Du kan bruge et ekstra fjernprogram til at oprette en sikker forbindelse fra din computer eller mobile enhed til routerens USB-enhed.<br>Log på dette fjernprogram, og du kan få adgang til USB-enheden overalt. <a target=&quot;_blank&quot; href=&quot;http://readycloud-staging.netgear.com/client/cloud_download.html&quot;>Klik her</a> for at hente fjernprogrammet.</p><p><b>Brugernavn og adgangskode</b></p><p>Du har oprettet dette brugernavn og denne adgangskode til ReadyCLOUD-kontoen.<br> Routeren og USB-enheden vises først, når du har registreret dem. Internetforbindelsen mellem routeren og ReadyCLOUD-serveren vil være aktiv, indtil du fjerner registreringen.<br> Du kan også registrere routeren med en anden konto, efter at du har fjernet registreringen fra den tidligere konto.</p>",
