"UAS048" : "<b>Bemærk: </b>Routeren opretholder en konstant forbindelse til ReadyCLOUD, indtil du fjerner registreringen.",
"UAS049" : "<p>ReadyCLOUD giver ekstern adgang via internettet til en USB-lagerenhed, der er sluttet til din routers USB-port. For at kunne bruge ReadyCLOUD skal du have en ReadyCLOUD-konto. Hvis du ikke har en ReadyCLOUD-konto, skal du<a id=&quot;link_rc_info1&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>klikke her</a> og derefter klikke på <b>Log på > Opret konto</b>. </p><p><b>Sådan konfigurerer du ReadyCLOUD</b></p><p><ol><li>Tilslut en USB-lagerenhed til din routers USB-port.</li><li>Indtast dit ReadyCLOUD-brugernavn og -adgangskode i felterne nedenfor, og klik på knappen <b>Registrer</b>. Din router og USB-enheden er registreret med ReadyCLOUD.</li><li> Gå ind på <a id=&quot;link_rc_info2&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>http://readycloud.netgear.com</a>, klik på Log på, indtast dit ReadyCLOUD-brugernavn og -adgangskode, og klik på knappen <b>Log på</b>.</li></ol></p><p>      Du kan også bruge ReadyCLOUD-appen til at oprette en sikker forbindelse fra din computer eller mobilenhed til routerens USB-lagerenhed.<br>      <a id=&quot;link_rc_info3&quot; class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com/client/cloud_download.html&quot;>Klik her</a> for at downloade ReadyCLOUD-appen.</p>",
