"UMS017" : "<P><font size=4><B>Medieserver (Indstillinger) Hjælp</B></font></P> <P> Du kan anvende din router som en ReadyDLNA-medieserver, der leverer medier i DLNA-kompatibel form til DLNA- og UPnP AV-kompatible medieafspillere. Så kan du afspille videoer, film og billeder fra kompatible medieafspillere som f.eks. Xbox360, PlayStation og NETGEARs Digital Entertainer Live.</P><P>Du kan også aktivere iTunes-medieserveren og afspille musik fra din USB-lagerenhed ved hjælp af iTunes og Apple Remote.</P><B><P> Aktiver DLNA-medieserver </P></B><P> Marker dette afkrydsningsfelt for at aktivere routeren som en ReadyDLNA-medieserver. </P><B><P> Aktiver understøttelse af TiVo </P></B><P> Marker dette afkrydsningsfelt for at tillade, at TiVo-enheder afspiller medier fra en USB-lagerenhed, der er tilsluttet til routerens USB-port.</P><B><P> Aktiver iTunes-medieserver (kun musik) </P></B><P> Marker dette afkrydsningsfelt for at anvende iTunes og Apple Remote til at afspille musik fra en USB-lagerenhed, der er tilsluttet routeren. Når du tilslutter din USB-enhed til routerens USB-port, kan du se USB-enhedens musikbibliotek i iTunes på din Mac- eller Windows-pc.  iTunes-medieserveren understøtter flere forskellige filformater, herunder MP3, AAC, FLAC, WAV og WMA.</P><B><P> Indtast adgangskoden, der vises i Remote-appen</P></B><P> Apple Remote er en app til iPhone- og iPad-enheder. Den kan styre, hvordan musik fra USB-enheden afspilles på AirPlay-enheder. Når du forsøger at tilføje et nyt bibliotek til Apple Remote-appen, vises en adgangskode på fire cifre. Indtast adgangskoden i feltet, og klik på knappen &quot;Tillad styring&quot;. Herefter vil Apple Remote-appen vise musikbiblioteket fra USB-enheden, der er tilsluttet routerens USB-port. </P><B><P> Medieserver/enhedsnavn</P></B><P> Dette er navnet på medieserveren, der anvendes til både DLNA-medieserveren og iTunes-medieserveren. Navnet på medieserveren er det samme som enhedsnavnet. Standardnavnet er routerens modelnummer. For at ændre navnet skal du klikke på linket &quot;Klik her for at ændre enhedsnavnet&quot; og indtaste et nyt navn.</P>",
