"UMSH01" : "<P><font size=4><B>Medieserver (Indstillinger) Hjælp</B></font></P> <P>Hvis enheden indstilles som en ReadyDLNA-medieserver, kan der afspilles videoer, film og billeder på DLNA/UPnP AV-kompatible medieafspillere som f.eks. Xbox360, Playstation og NETGEARs Digital Entertainer Live.</p><p>ReadyDLNA forudsætter, at denne enhed leverer medier på DLNA-kompatibel form til DLNA/UPnP AV-kompatible medieafspillere </p> <ul><li><a name=dlna_enable></a><b>Aktiver medieserver</b> får denne enhed til at fungere som en medieserver.</li><li><a name=tivo_enable></a><b>Aktiver TiVo®-support</b> Besøg http://kb.netgear.com/app/answers/detail/a_id/24316 for at få oplysninger om brug af denne funktion med din TiVo-enhed.</li><li><a name=dev_name></a><b>Navn på medieserver</b> er det navn, der vises på medieafspillerne</li></ul> </p><p><b>Indholdsscanning</b><ul><li><b>Opdater database automatisk </b>  Scanner for mediefiler, når der tilføjes nye filer til ReadyShare USB-lagring. Kun delt mappe med &quot;Alle - ingen adgangskode&quot; i læseadgang kan scannes for mediefiler.</li><li>Du kan også klikke på <b>Scan mediefiler igen</b> for at slette den aktuelle database og foretage en helt ny scanning med det samme.</li></ul></p>",
