"CLOH01" : "<P><font size=4><B>Hjælp til Logfiler (Logs)</B></font></P><p>En logfil er en detaljeret registrering af de websteder, som brugerne på dit netværk har været inde på eller har forsøgt at komme ind på. Hvis du har konfigureret indholdsfiltrering i skærmbilledet Bloker websteder (Block Sites), viser skærmbilledet Logfiler (Logs), hvornår nogen på dit netværk har prøvet at få adgang til et blokeret websted. Hvis du har aktiveret e-mail-meddelelser, vil du modtage disse logfiler i en e-mail. Hvis du ikke har konfigureret e-mail-meddelelser, kan du få vist logfilerne her.</p><p><ul><li>Klik på <b>Ryd logfil (Clear log)</b> for at slette alle posterne i logfilen.</ul><p><ul><li>Klik på <b>Opdater (Refresh)</b> for at få vist de seneste adgangsforsøg.</ul><p><ul><li>Klik på <b>Send logfil (Send log)</b> for at sende logfilen til din e-mail-konto. Denne funktion kan være meget nyttig, når du skal teste dine e-mail-indstillinger.</ul>",
