"CBSH01" : " <P><font size=4><B>Hjælp til Bloker websteder (Block Sites)</B></font></P> <p>Hvis du ønsker at begrænse adgangen til bestemte websteder på internettet, skal du konfigurere indholdsfiltrering. Der er to måder at filtrere indhold på: <ul><li>Blokering af adgangen til bestemte domæner (f.eks. www.badstuff.com/XXX) <li>Blokering af websteder, som indeholder bestemte ord (f.eks. af blasfemisk eller seksuelt art). </UL><p>Når brugerne prøver at få adgang til et blokeret websted, får de vist meddelelsen: &apos;Blokeret af NETGEAR (Blocked by NETGEAR)&apos;.</p><hr><a name=blocking></a><p><b>Sådan aktiveres blokering af websteder:</b></p><ul>Vælg <b>Efter tidsplan (Per Schedule)</b> for at aktivere blokering af websteder i henhold til indstillingerne på skærmbilledet Tidsplan (Schedule).</ul><ul>Vælg <b>Altid (Always)</b> for at aktivere blokering af websteder og sørge for, at de blokeres hele tiden, uafhængigt af skærmbilledet Tidsplan (Schedule).</ul><p><b>Bemærk:</b> På siden Tidsplan (Schedule) kan du angive, hvornår blokeringen af nøgleord og domænenavne forekommer.</p><p><b>Sådan deaktiverer du blokering af websteder:</b></p><p><ul>Vælg <b>Aldrig (Never)</b> for at deaktivere blokering af websteder.</ul><hr><a name=toaddword></a><p><b>Sådan blokerer du nøgleord eller internetdomæner:</b></p><ol><li>Vælg, hvornår nøgleord skal blokeres (Aldrig (Never), Efter tidsplan (Per Schedule), eller Altid (Always)).</li><li>I feltet <a name=toaddword></a> <b>Indtast nøgleord eller domænenavn her (Type Keyword Or Domain Name Here)</b> skal du indtaste det ord eller domænenavn, du ønsker at blokere.</li><li>Klik på <b>Tilføj nøgleord (Add Keyword)</b>.<li>Ordet eller domænenavnet vises på listen.</li><li>Fortsæt med at tilføje navne og nøgleord, indtil du er færdig.</li><li>Klik på<b>Anvend (Apply)</b>, når du er færdig.</li></ol><a name=blocklist></a><p><b>Blokeringsliste (Block List)</b>. Listen under overskriften &apos;Bloker websteder, der indeholder disse nøgleord eller domænenavne&apos; (Block Sites Containing these Keywords or Domain Names) indeholder den aktuelle liste over de elementer, der skal blokeres.</p><a name=todelete></a><p><b>Sådan sletter du et nøgleord eller domænenavn:</b></p><ol><li>Vælg ordet eller domænenavnet på listen.</li><li>Klik på <b>Slet nøgleord (Delete Keyword)</b>.</li><li>Fortsæt med at vælge og slette navne og nøgleord, indtil du er færdig.</li><li>Klik på <b>Anvend (Apply)</b>.</li></ol><p><b>Sådan sletter du alle nøgleord og domænenavne:</b></p><ol><li>Klik på <b>Ryd liste (Clear List)</b>.</li><li>Klik på <b>Anvend (Apply)</b>.</li></ol></p><hr><a name=trusted></a><p><b>Sådan giver du én computer direkte adgang til internettet:</b></p><ol><li>Marker afkrydsningsfeltet <b>Tillad, at pålidelig IP-adresse besøger blokerede websteder (Allow Trusted IP Address to Visit Blocked Sites)</b>.</li><li>Indtast IP-adressen for computeren i området Pålidelig IP-adresse (Trusted IP Address). <br>Du bør kun skulle skrive et tal i det sidste felt.</li><li>Klik på <b>Anvend (Apply)</b>.</li></ol><a name=To></a><p><b>Sådan tillader man ubegrænset adgang til internettet:</b></p><ol><li>Vælg <B>Aldrig (Never)</b> på listen <b>Blokering af nøgleord (Keyword Blocking)</b>.</li><li>Klik på <b>Anvend (Apply)</b>.</li></ol>",
