"CBEH01" : "<P><font size=4><B>Hjælp til Blokering af tjenester (Block Services)</B></font></P><P>Blokering af tjenester (Block Services) gør det muligt for dig at blokere internetadgang for specifikke brugere på dit lokale netværk, baseret på deres IP-adresser. Du kan f.eks. hindre brugen af bestemte internettjenester, bl.a. surfing på internettet (http), for alle eller bare nogle enkelte personer på dit netværk. Du kan konfigurere blokering af tjenester til aldrig (never), til efter tidsplan (according to a schedule), eller til altid (always). </P><HR><A name=block></A><P><B>Sådan aktiveres blokering af tjenester:</B></P><UL>  <LI>Vælg <B>Efter tidsplan (Per Schedule)</B> for at aktivere blokering af tjenester og blokere i overensstemmelse med indstillingerne på skærmbilledet Tidsplan (Schedule).   <LI>Vælg <B>Altid (Always)</B> for at aktivere blokering af tjenester og blokere hele tiden uafhængigt af indstillingerne på skærmbilledet Tidsplan (Schedule). </LI></UL><BR><P><B>Sådan deaktiverer du blokering af tjenester:</B><P><P><UL>  <LI>Vælg <B>Aldrig (Never)</B> for at deaktivere blokering af tjenester.</LI></UL><A name=table></A><P><B>Tjenestetabel</B> <P>Denne tabel indeholder alle tjenester, der er blokeret i øjeblikket. Du kan tilføje og slette elementer fra denne tabel efter behov.</P><A name=add></A><P><B>Sådan tilføjer du nye tjenester:</B> <OL>  <LI>Klik på knappen <B>Tilføj (Add)</B>.   <LI>Udfyld skærmbilledet, der vises.   <LI>Klik på knappen <B>Anvend (Apply)</B>, når du er færdig. </LI></OL><A name=edit></A><P><B>Sådan redigerer du tjenester</B> <OL>  <LI>Vælg alternativknappen for den tjeneste, du vil redigere.   <LI>Klik på knappen <B>Rediger (Edit)</B>.   <LI>Ret tjenestens data efter behov.   <LI>Klik på knappen <B>Accepter (Accept)</B>, når du er færdig. </LI></OL><A name=delete></A><P><B>Sådan sletter du en tjeneste</B> <OL>  <LI>Vælg alternativknappen ved siden af rækken i tabellen for den tjeneste, du ønsker at slette.   <LI>Klik på knappen <B>Slet (Delete)</B> for at slette den valgte tjeneste. </LI></OL><HR><P><B>Sådan gemmer eller annullerer du ændringer</B></P><P>Klik på <A name=To></A><B>Anvend (Apply)</B> for at gemme de nye indstillinger for routeren. <BR>Klik på <A name=cancel></A><B>Annuller (Cancel)</B> for at kassere ændringer, der ikke er gemt. </P>",
"CBEH02" : "<P><font size=4><B>Hjælp til Opsætning af blokering af tjenester (Block Services Setup)</B></font></P><p>  Blokering af tjenester gør det muligt for dig at blokere internetadgang for specifikke brugere på dit lokale netværk, baseret på deres IP-adresser. Derudover kan du hindre brugen af bestemte internettjenester fuldstændig.<p><hr> <p><b>For at Tilføje/redigere en tjeneste:</b></p><ol><li>Vælg tjenestetypen fra rullemenuen, eller vælg<b>Brugerdefineret (User Defined)</b>, hvis den ønskede type ikke er på listen.<li>Hvis du vælger <b>Brugerdefineret (User Defined)</b>, skal du vælge den protokol og angive det navn og den række portnumre, der bruges af denne tjeneste. For kendte tjenester udfyldes disse felter automatisk.<li>Angiv indstillingen for IP-adressen for at bestemme, hvilke pc&apos;er der er blokeret. (Der er flere detaljer længere nede).<li>Klik på <b>Tilføj/Accepter (Add/Accept)</b> for at gemme dine ændringer.</ol><a name=ip></a><p><b>Filtrer tjenester for (Filter Services For)</b>. Denne bestemmer hvilke computere, der bliver blokeret.<ul><li>Kun denne IP-adresse (Only This IP Address). Kun én (1) pc bliver blokeret. Indtast IP-adressen på den pc, der skal blokeres.<li>Række af IP-adresser (IP Address Range). En gruppe af pc&apos;er, der bestemmes af IP-adressen, bliver blokeret. Indtast, hvor rækken af IP-adresser starter og slutter, for de pc&apos;er der skal blokeres.<li>Alle IP-adresser (All IP Addresses). Alle pc&apos;er blokeres.</ul><hr> <p><b>Sådan gemmer eller annullerer du ændringer:</b></p><p> Klik på <b>Tilføj/Accepter (Add/Accept)</b>, når du er færdig med at opdatere tabellen i Bloker tjenester (Block Services). <br>Klik på <b>Annuller (Cancel)</b> for at gå tilbage til de tidligere indstillinger.</p>",
