"CSEH01" : "<P><font size=4><B>Hjælp til Tidsplan (Schedule)</B></font></P><p>Hvis du har konfigureret indholdsfiltrering på skærmbilledet Bloker websteder (Block Sites) eller tjenesteblokering på skærmbilledet Blokering af tjenester (Block Services), kan du konfigurere en plan for, hvornår blokering sker, eller hvornår adgang ikke er begrænset. </p><a name=blocksch></a><p>Sådan blokerer du nøgleord, tjenester eller internetdomæner baseret på en tidsplan:<ol><li>Vælg en af de følgende:<b>Hver dag (Every Day)</b>.<br>En eller flere dage (One or more days).</li><li>Hvis du vil begrænse adgangen helt på de valgte dage, skal du vælge <b>Hele dagen (All Day)</b>.<br>Hvis du vil begrænse adgangen på visse tidspunkter på de valgte dage, skal du indtaste et tidspunkt i felterne <b>Start blokering (Start Blocking)</b> og <b>Afslut blokering (End Blocking)</b>.<br><b>Bemærk:</b> Angiv værdierne efter 24-timers-uret. 10:30 a.m. svarer f.eks. til 10 timer og 30 minutter, og 10:30 p,m. til 22 timer og 30 minutter.</li><li>Klik på <a name=Apply></a><b>Anvend (Apply)</b>.</li></ol>",
"CSEH02" : "<P><font size=4><B>Hjælp til Tidsplan</B></font></P><p>Hvis du har konfigureret indholdsfiltrering på skærmbilledet Bloker websteder eller tjenesteblokering på skærmbilledet Blokering af tjenester, kan du konfigurere en tidsplan for, hvornår blokering sker, eller hvornår adgang ikke er begrænset. </p><p name=blocksch id=blocksch></p><p>For at blokere nøgleord, tjenester eller internetdomæner på baggrund af en tidsplan:<ol><li>Vælg en af følgende: <b>Hver dag</b>.<br>En eller flere dage.</li><li>Hvis du vil begrænse adgangen til de valgte dage, skal du vælge<b> Alle dag</b>e.<br>Hvis du ønsker at begrænse adgangen til visse tidspunkter for de valgte dage, skal du indtaste et tidspunkt i felterne<b> Start blokering</b> og<b> Afslut blokering</b>.<br><b>Bemærk:</b> Angiv værdierne som 24-timers klokke. 10:30 a.m. svarer f.eks. til 10 timer og 30 minutter, og 10:30 p,m. svarer f.eks. til 22 timer og 30 minutter.</li><li>Klik på <p name=Apply id=Apply><b>Anvend</b>.</p></li></ol>",
