"CEMH01" : "<P><font size=4><B>Hjælp til E-mail</B></font></P><p>Du kan få sendt en advarsel, når der er nogen på dit LAN (Local Area Network), som forsøger at få adgang til et blokeret websted. Logfilerne viser alle de URL&apos;er, som er blevet besøgt. Hvis du ønsker at få tilsendt advarsler og logfiler via e-mail, skal du udfylde indstillingerne på denne skærm.</p><p>Du kan altid kontrollere logfilerne manuelt ved at få vist skærmen med logfiler. Hvis du ikke ønsker at modtage e-mails, skal du lade felterne stå tomme.</p><a name=receive></a><p><b>Sådan modtager man advarsler og logfiler via e-mail:</b><ol><li>Vælg afkrydsningsfeltet <b>Aktiver e-mail-meddelelser (Turn E-mail Notification On)</b>.</li><li>I feltet <b>Server til udgående post (Outgoing Mail Server)</b> skal du angive SMTP-serveren til udgående post fra din internetudbyder (f.eks. smtp.myISP.com). <br>Hvis du lader dette felt stå tomt, vil der ikke blive sendt advarsler eller logfiler til dig. I øjeblikket understøttes godkendelse vha. SSL eller TLS ikke.<br><b>Tip:</b> Du brugte disse oplysninger, da du konfigurerede dit e-mail-program. Hvis du ikke kan huske dem, kan du se indstillingerne i dit e-mail-program.</li><li>I feltet <b>E-mail-adresse (E-mail Address)</b>, skal du angive den e-mail-adresse, hvortil du eller en anden kan få sendt advarsler og logfiler. <br>Skriv hele e-mail-adressen (f.eks. Jackie@myISP.com). </li><li><a name=alert></a>Hvis du ønsker en advarsel via e-mail, hver gang nogen på dit netværk forsøger at komme ind på en blokeret URL, skal du markere afkrydsningsfeltet <b>Send advarsel med det samme (Send Alert Immediately)</b>.<br></li><li><a name=schedule></a>Hvis du ikke ønsker at få tilsendt logfiler, skal du vælge <b>Ingen (None)</b> fra den første liste i området Send logfiler efter denne tidsplan (Send Logs According to This Schedule).<br> <br>Hvis du ønsker at få tilsendt logfiler, skal du vælge en af de andre indstillinger.<ul><li>Hvis du valgte <b>Ugentligt (Weekly)</b>, skal du vælge hvilken dag i ugen. </li><li> Hvis du valgte <b>Ugentligt (Weekly)</b> eller <b>Dagligt (Daily)</b>, skal du vælge hvilket tidspunkt e-mailen skal sendes på.</li></ul><a name=Apply></a><li>Klik på <b>Anvend (Apply)</b> for at få dine ændringer til at træde i kraft.</li></ol><a name=timezone></a><p><b>Tidszone.</b><p>Vælg den lokale tidszone. Dette er nødvendigt, for at tidsplanen kan fungere korrekt.</p><p>Vælg Tilpas automatisk til sommertid, hvis det er nødvendigt i dit område.</p>",
