"MADH01" : "<P><font size=4><B>Hjælp til Tilsluttede enheder (Attached Devices)</B></font></P><p>Dette skærmbillede viser IP-adresse, enhedsnavn og MAC-adresse (Media Access Control) for hver computer, der er sluttet til routeren.<p>Du kan ikke ændre værdierne i dette skærmbillede. Klik på knappen <i>Opdater (Refresh)</i> for at opdatere dette skærmbillede og få vist de nuværende tilsluttede enheder. >",
"MADH02" : "<P><font size=4><B>Hjælp til Tilsluttede enheder</B></font></P><p>Dette skærmbillede viser IP-adressen, enhedsnavnet og MAC-adressen (Media Access Control) for hver computer, der er sluttet til routeren.<p>Du kan ikke ændre værdierne på dette skærmbillede. Klik på knappen <b id=italic>Opdater</b> for at opdatere dette skærmbillede og få vist de nuværende tilsluttede enheder. <p>For at blokere eller tillade at en eller flere enheder får adgang til dit netværk, skal du klikke på linket Adgangskontrol (Access Control) i øverste højre hjørne af skærmen for at gå til skærmen Adgangskontrol (Access Control) og foretage ændringerne.",
"MADH03" : "<p><font size=4><b>Hjælp til Tilsluttede enhed</b></font></p><p>Dette skærmbillede viser oplysninger om enhederne, der er tilsluttet routeren. </p><p><b>Rediger valg:</b> Vælg en enhed og klik på knappen <b>Rediger</b>. Siden Rediger enhed vises. </p><p><b>Status: </b>Denne kolonne viser status for en enheds adgangskontrol. Hvis adgangskontrol er deaktiveret, er kolonnen skjult.</p><p><b>Prioritet: </b>Denne kolonne er tilgængelig, når Quality of Service er tændt. Fire prioritetsniveauer er tilgængelige: højeste, høj, medium og lav. Spilkonsoller og enheder til streaming tildeles høj prioritet som standard. Andre enheder tildeles medium prioritet som standard. Klik på knappen <b>Rediger</b> for at ændre en enheds prioritetsniveau.</p><p><b>Forbindelsestype: </b>Denne kolonne viser, hvordan en enhed opretter forbindelse til routeren. </p><p><b>Enhedsnavn: </b>Denne kolonne viser en enheds navn, typeikon og IP-adresse. Disse oplysninger registreres automatisk af routeren. Hvis Quality of Service er aktiveret, registrere routeren automatisk enhedstypen. Hvis Quality of Service er deaktiveret, vises standard enhedstypen som andre. Klik på knappen <b>Rediger</b> for manuelt at tildele et enhedsnavn eller en enhedstype. Hvis Quality of Service er aktiveret, vises IP-adressen i denne kolonne. Bevæg musen henover enhedsnavnet for at vise MAC-adressen, typeenheden og SSID-oplysningerne (kun til trådløse enheder). Hvis Quality of Service er aktiveret, skal du klikke på enhedsnavnet for at få vist detaljerede oplysninger om brug af internetbåndbredde. </p><p><b>IP-adresse: </b>Denne kolonne viser enhedens IP-adresse. Denne kolonne findes kun, hvis Quality of Service er deaktiveret. </p><p><b>MAC-adresse: </b>Denne kolonne viser enhedens MAC-adresse. Denne kolonne findes kun, hvis Quality of Service er deaktiveret. </p><p><b>Downloadhastighed til internettet efter enhed: </b>Denne kolonne viser den samtidige anvendelse af downloadhastighed til internettet for enheden. </p><p><b>Uploadhastighed til internettet efter enhed: </b>Denne kolonne viser den samtidige anvendelse af uploadhastighed til internettet for enheden. </p><p>For at blokere eller tillade at en eller flere enheder får adgang til dit netværk, skal du klikke på linket <b>Adgangskontrol</b> i øverste højre hjørne af skærmen for at gå til skærmen Adgangskontrol og foretage ændringerne.</p>",
"MADH04" : "<p><font size=4><b>Hjælp til Rediger enhed</b></font></p><a name=ip_tag></a><p><b>IP-adresse: </b>Viser enhedens IP-adresse. Dette felt kan ikke redigeres. </p><a name=mac_tag></a><p><b>MAC-adresse:</b> Viser enhedens MAC-adresse. Dette felt kan ikke redigeres. </p><a name=name_tag></a><p><b>Enhedsnavn: </b>Du kan indtaste dit foretrukne enhedsnavn. Ryd enhedsnavnet for at lade routeren registrerer automatisk. </p><a name=priority_tag></a><p><b>Enhedsprioritet: </b>Denne kolonne er tilgængelig, når Dynamic QoS er tændt. Fire niveauer for enhedsprioritet er tilgængelige: højeste, høj, medium og lav. Enhedsprioriteten tildeles ud fra automatisk registrerede enhedstyper. QoS starter med at prioritere trafik ud fra programkategori. Når der kører programmer med høj prioritet i samme kategori på forskellige enheder, bruges enhedsprioritet til at prioritere trafikken.<br> Hvis du f. eks. har et Smart TV og en mobil enhed, der begge streamer NETFLIX samtidigt, prioriteres Smart TV højere, da Smart TV anses for en enhedstype med højere prioritet.</p>",
"MADH05" : "<p><font size=4><b>Hjælpeside til båndbreddeforbrug for enhed</b></font></p><p>Denne side viser detaljeret båndbreddeforbrug for applikation. Den viser båndbreddeforbrug for applikation, som routeren er i stand til at registrere. Båndbreddeforbrug for applikation, som routeren ikke kan registrere er inkluderet i den generelle applikation. </p><p><b>Applikation: </b>Applikationstrafiktypen, som routeren har registreret. </p><p><b>Downloadhastighed til internettet efter app: </b>Den aktuelle downloadhastighed til internettet, som bruges af hver applikation. </p><p><b>Uploadhastighed til internettet efter app: </b>Den aktuelle uploadhastighed til internettet, som bruges af hver applikation. </p><p><b>Knappen Opdater:</b> Klik på knappen <b>Opdater</b> for at opdatere listen over applikationer og båndbreddeforbrug.</p><p><b>Knappen Tilbage:</b> Klik på knappen <b>Tilbage</b> for at få vist det forrige skærmbillede. </p>",
"MADH06" : "<p><font size=4><b>Hjælp til Tilsluttede enhed</b></font></p><p>Dette skærmbillede viser oplysninger om enhederne, der er tilsluttet routeren. </p><p><b>Rediger valg:</b> Vælg en enhed og klik på knappen <b>Rediger</b>. Siden Rediger enhed vises. </p><p><b>Status: </b>Denne kolonne viser status for en enheds adgangskontrol. Hvis adgangskontrol er deaktiveret, er kolonnen skjult.</p><p><b>Enhedsprioritet: </b>Denne kolonne er tilgængelig, når Dynamic QoS er tændt. Fire niveauer for enhedsprioritet er tilgængelige: højeste, høj, medium og lav. Enhedsprioriteten tildeles ud fra automatisk registrerede enhedstyper. QoS starter med at prioritere trafik ud fra programkategori. Når der kører programmer med høj prioritet i samme kategori på forskellige enheder, bruges enhedsprioritet til at prioritere trafikken. </p><p>Hvis du f. eks. har et Smart TV og en mobil enhed, der begge streamer NETFLIX samtidigt, prioriteres Smart TV højere, da Smart TV anses for en enhedstype med højere prioritet.</p><p><b>Forbindelsestype: </b>Denne kolonne viser, hvordan en enhed opretter forbindelse til routeren. </p><p><b>Enhedsnavn: </b>Denne kolonne viser en enheds navn, typeikon og IP-adresse. Disse oplysninger registreres automatisk af routeren. Hvis Dynamic QoS er aktiveret, registrerer routeren automatisk enhedstypen. Hvis Dynamic QoS er deaktiveret, vises standard enhedstypen som andre. Klik på knappen <b>Rediger</b> for manuelt at tildele et enhedsnavn eller en enhedstype. Hvis Dynamic QoS er aktiveret, vises IP-adressen i denne kolonne. Bevæg musen henover enhedsnavnet for at vise MAC-adressen, typeenheden og SSID-oplysningerne (kun til trådløse enheder). Hvis Dynamic QoS er aktiveret, skal du klikke på enhedsnavnet for at få vist detaljerede oplysninger om brug af internetbåndbredde. </p><p><b>IP-adresse: </b>Denne kolonne viser enhedens IP-adresse. Denne kolonne findes kun, hvis Dynamic QoS er deaktiveret. </p><p><b>MAC-adresse: </b>Denne kolonne viser enhedens MAC-adresse. Denne kolonne findes kun, hvis Dynamic QoS er deaktiveret. </p><p><b>Downloadhastighed til internettet efter enhed: </b>Denne kolonne viser den samtidige anvendelse af downloadhastighed til internettet for enheden. </p><p><b>Uploadhastighed til internettet efter enhed: </b>Denne kolonne viser den samtidige anvendelse af uploadhastighed til internettet for enheden. </p><p>For at blokere eller tillade at en eller flere enheder får adgang til dit netværk, skal du klikke på linket <b>Adgangskontrol</b> i øverste højre hjørne af skærmen for at gå til skærmen Adgangskontrol og foretage ændringerne.</p>",
