"MBSH01" : "<p><font size=4><b>Hjælp til Indstillinger for sikkerhedskopiering (Backup Settings)</b></font></p><p>I dette skærmbillede kan du tage sikkerhedskopi af, gendanne og slette routerens aktuelle indstillinger. </p><p>Når først du har fået routeren til at fungere korrekt, bør du tage sikkerhedskopi af alle oplysningerne, så du har dem, hvis noget går galt. Når du tager sikkerhedskopi af indstillingerne, gemmes de som en fil på din computer. Du kan gendanne routerens indstillinger fra denne fil. </p><a name=save></a><p>Sådan opretter du en sikkerhedskopifil af de aktuelle indstillinger:<ol><li>Klik på <b>Sikkerhedskopier</b> (Back Up).</li><li>Hvis du ikke har konfigureret din browser til at gemme hentede filer automatisk, skal du finde det sted, hvor du vil gemme filen, omdøbe den, hvis du ønsker det, og klikke på <b>Gem (Save)</b>. <br>Hvis din browser er konfigureret til at gemme hentede filer automatisk, gemmes filen i browserens download-mappe på harddisken og kaldes ",
"MBSH02" : ". </li></ol><hr><p><b>VIGTIGT!</b>Når du er begyndt at genskabe indstillingerne eller slette routeren, må du <I>ikke</I> prøve at gå online, slukke for routeren, lukke computeren eller foretage dig andet med routeren, før den er færdig med at genstarte! Dette skulle ikke tage mere end et minuts tid. Når testindikatoren holder op med at blinke, skal du vente endnu et par sekunder, før du foretager dig noget med routeren. </p><hr><a name=restore></a><p>Sådan gendanner du indstillinger fra en sikkerhedskopifil:<ol><li>Klik på <b>Gennemse (Browse)</b>.</li><li>Find og vælg den tidligere gemte sikkerhedskopifil (som standard ",
"MBSH03" : ").</li><li>Klik på <b>Gendan (Restore)</b>. <br>Der åbnes et vindue, som fortæller dig, at routeren er blevet gendannet med de tidligere indstillinger. Routeren genstartes. Det tager ca. 1 minut.<br><b>VIGTIGT!</b>Prøv ikke at gå online, slukke for routeren, lukke computeren eller foretage dig andet med routeren, før den er færdig med at genstarte! Når testindikatoren holder op med at blinke, skal du vente endnu et par sekunder, før du foretager dig noget med routeren. </li><li>Luk meddelelsesvinduet.</li></ol><a name=revert></a><p>Sådan slettes de aktuelle indstillinger og nulstilles routeren til de oprindelige fabriksindstillinger:<ul><li>Klik på <b>Slet (Erase)</b>.<br><b>VIGTIGT!</b>Prøv ikke at gå online, slukke for routeren, lukke computeren eller foretage dig andet med routeren, før den er færdig med at genstarte! Når testindikatoren holder op med at blinke, skal du vente endnu et par sekunder, før du foretager dig noget med routeren. </ul><p>Når du har slettet routerens aktuelle indstillinger, vil routerens adgangskode være <b>password</b>, LAN IP-adressen vil være <b>192.168.1.1</b> og routeren vil fungere som en DHCP-server på LAN&apos;et og som en DHCP-klient til internettet. </p></a>",
