"MSPH01" : "<P><font size=4><B>Hjælp til Angiv adgangskode (Set Password)</B></font></P><p>  Du bruger skærmbilledet Angiv adgangskode (Set Password) til at ændre den adgangskode, som du bruger til at få adgang til skærmbilledet Indstillinger (Settings) —<I>ikke</I> adgangskoden til din konto hos din internetudbyder. <p>  Sådan ændrer du adgangskode: <ol> <li>Skriv den gamle adgangskode.   <BR>Standardadgangskoden for routeren er <b>password</b>.  <li>Skriv en ny adgangskode, og skriv den igen i feltet <b>Gentag ny adgangskode (Repeat New Password)</b> for at bekræfte den.   <br>  <b>Bemærk:</B> Sørg for at skrive den ned på et sikkert sted.  <li>Klik på <b>Anvend (Apply)</b> for at ændre adgangskoden eller klik på <b>Annuller (Cancel)</b> for at beholde den nuværende adgangskode. </ol><p> <b>Bemærk:</b> Hvis du tidligere har foretaget sikkerhedskopiering af routerindstillingerne, bør du foretage en ny sikkerhedskopiering, så indstillingsfilen indeholder den nye adgangskode. </p>",
"MSPH02" : "<P><font size=4><B>Hjælp til Angiv adgangskode</B></font></P><p> Du bruger skærmbilledet Angiv adgangskode til at ændre den adgangskode, som du bruger til at få adgang til skærmbillederne Indstillinger - <I>ikke</I> adgangskoden til din konto hos internetudbyderen. <p> Sådan ændrer du adgangskode: <ol> <li>Skriv den gamle adgangskode.   <BR>Standardadgangskoden for routeren er <b>password</b>.  <li>Skriv en ny adgangskode, og skriv den igen i feltet <b>Gentag ny adgangskode (Repeat New Password)</b> for at bekræfte den.   <br>  <b>Bemærk:</B> Sørg for at skrive den ned på et sikkert sted.  <li>Klik på <b>Anvend (Apply)</b> for at ændre adgangskoden eller klik på <b>Annuller</b> (Cancel) for at beholde den nuværende adgangskode. </ol><p> <b>Bemærk:</b> Hvis du tidligere har foretaget sikkerhedskopiering af routerindstillingerne, bør du foretage en ny sikkerhedskopiering, så indstillingsfilen indeholder den nye adgangskode. </p><p><b>Aktiver gendannelse af adgangskode</b><br>NETGEAR anbefaler, at du aktiverer gendannelse af adgangskode, hvis du ændrer adgangskoden til routerens administrator-brugernavn. Så er det nemt at gendanne adgangskoden, hvis du glemmer den. <p><b>Sådan aktiveres gendannelse af adgangskode:</b><ol><li>Marker afkrydsningsfeltet <b>Aktiver gendannelse af adgangskode</b>.<li>Vælg to sikkerhedsspørgsmål, og svar på dem.<li>Klik på <b>Anvend</b> for at gemme ændringerne.</ol></p><p>Når du bruger din browser til at få adgang til routeren, vises logon-vinduet. Hvis gendannelse af adgangskoden er aktiveres, når du klikker på <b>Annuller</b>, starter gendannelsesprocessen. Du kan så angive de gemte svar på sikkerhedsspørgsmålene for at gendanne adgangskoden. Denne gendannelse understøttes af browserne Internet Explorer, Firefox og Chrome, men ikke af Safari browseren.</p>",
