"MRUH01" : "<title>Hjælp</title><link rel=stylesheet href=help.css></head><h1>Kontroller Hjælp til sprog</h1><p>Sproget for brugergrænsefladen afviger fra browsersproget. Hvis du vil ændre sproget for brugergrænsefladen til browsersproget, skal du klikke på knappen <B>Ja</B>. Ellers skal du klikke på knappen <B>Nej</B>.</p>",
"MRUH02" : " <P><font size=4><B>Hjælp til Opgradering af firmware (Firmware Upgrade Assistant)</B></font></P>        <p>Routeren kan automatisk registrere, om en ny version af firmwaren er tilgængelig på internettet.<p>Klik på <b>Ja (Yes)</b>, hvis du ønsker at starte søgningen nu.<br>Klik på <b>Nej (No)</b>, hvis du ikke ønsker at søge efter en ny version nu.<p>Hvis du foretrækker at søge efter en ny version senere, kan du gøre dette via skærmbilledet Opgradering af router (Router Upgrade).<p>Hvis du ikke ønsker at se denne meddelelse igen, næste gang du logger ind, skal du markere afkrydsningsfeltet <b>Vis ikke denne meddelelse igen (Do not display this message again)</b> og klikke på <b>Nej (No)</b>.>",
"MRUH03" : "   <P><font size=4><B>         Hjælp til Opdatering af sproget for brugergrænsefladen (GUI Language Update)   </B></font></P>     <p>Du har valgt sprog for brugergrænseflade fra listen <b>Vælg sprog (Select Language)</b>. Du kan benytte funktionen Opdatering af sproget for brugergrænsefladen (GUI Language Update) til at kontrollere for opdateringer til sprog for brugergrænsefladen. Denne funktion kontrollerer kun for opdateringer til sprog, ikke resten af firmwaren.<p>Klik på knappen <b>Kontroller (Check)</b> for at gå til NETGEAR-webstedet og få den nyeste version af det valgte sprog til brugergrænsefladen. <p>Hvis der findes en ny version, skal du klikke på <b>Ja (Yes)</b> for at opdatere til den nye version eller klikke på <b>Nej (No)</b> for at annullere opdateringen. >",
"MRUH04" : " <p><font size=4><b>Hjælp til Opgradering af router (Router Upgrade)</b></font></p> <p>Du kan installere nye versioner af routerens software via skærmbilledet Opgradering af router (Router Upgrade).<a name=check></a> <p>Klik på knappen <b>Kontroller (Check)</b> for at gå til NETGEAR-webstedet, hvor du kan få <b>nye versioner</b> af routersoftwaren. Når du har downloadet filen, skal du pakke filen ud, inden du opgraderer routeren.    <p>Marker afkrydsningsfeltet, hvis du vil kontrollere for en ny version, når du logger ind. <p><b>VIGTIGT!</b> Når du har klikket på <b>Overfør (Upload)</b>, må du <i>ikke</i> afbryde processen med at sende softwaren til routeren og genstarte routeren. Hvis du tror, at processen kan blive afbrudt på en eller anden måde, skal du klikke på <b>Annuller (Cancel)</b> for at beholde den nuværende routersoftware.</p><a name=locate></a><p><b>Find og vælg opgraderingsfilen på din harddisk.</b><ol><li>Gå til www.NETGEAR.com og hent den opdaterede software.<li>Hvis det ikke sker automatisk, skal du pakke filen ud.<br>Du kan med fordel læse <i>Produktbemærkningerne (Release Notes),</i> inden du fortsætter.<li>Klik på <b>Gennemse (Browse)</b>.<li>Find og vælg den fil, som du netop hentede og pakkede ud.<li>Klik på <b>Overfør (Upload)</b> for at sende softwaren til routeren.<br>Dette overfører den nye software til routeren og får routeren til at genstarte.<br><b>Bemærk:</b> Prøv ikke at gå online, slukke for routeren, lukke computeren eller foretage dig andet med routeren, før den er færdig med at genstarte! Når Klar-lampen (Ready) holder op med at blinke, skal du vente endnu nogle få sekunder, inden du gør noget.<li>Klik på <b>Status for router (Router Status)</b>, og kontroller firmware-versionen for at få bekræftet, at din router nu har den nye software installeret. </ol><p><B>VIGTIGT!</b> I nogle tilfælde, f.eks. ved en større opgradering, kan det være nødvendigt at konfigurere routeren igen, efter at du har opgraderet den. Læs i <i>Produktbemærkningerne (Release Notes), der følger med softwaren,</i> for at finde ud af, om du er nødt til at konfigurere routeren igen. <p>Hvis du ikke kan opgradere med denne metode, kan du få oplysninger om andre opgraderingsmetoder i <i>Referencevejledningen (Reference Manual) </i>på produktets supportwebsted.</p> >",
