"AAW046" : "Aktiver Smart Connect - Lad routeren intelligent bestemme det bedste WiFi-bånd (2,4 GHz eller 5 GHz) til dine WiFi-forbindelser. Smart Connect kræver 2,4 GHz- og 5 GHz-netværk for at bruge det samme WiFi-netværksnavn (SSID), de samme sikkerhedsfunktioner og den samme adgangskode.",
