"AAW050" : "<p><font size=4><B>Hjælp til Trådløs Bridge</B></font></p><HR><p>Du kan bruge din router i bridgetilstand til at tilslutte flere enheder trådløst på den hurtigere 802.11ac hastighed.<br>Aktiver Bridgetilstand: du kan aktivere eller deaktivere bridge-tilstand.<br>Klik på knappen Trådløse indstillinger til konfiguration af Bridge-tilstand for at angive indstillingerne for den anden router, som denne router vil oprette forbindelse til.<br>1. Du kan vælge den trådløse netværksfrekvens (2,4 GHz eller 5 GHz). For 802.11ac-tilstand, skal du vælge 5 GHz.<br>2. I feltet Navn (SSID), skal du indtaste navnet på det trådløse netværk (SSID).<br>3. I afsnittet Sikkerhedsindstilling, skal du vælge en alternativknap.<br>4. Hvis du bliver bedt om det, skal du indtaste adgangskoden (WiFi-adgangskoden, som du bruger til at oprette trådløs forbindelse til de andre routere).<br>5. Klik på knappen Anvend.<br>Du skal også vælge indstillinger for IP-adresse på denne bridge, enten \&quot;Kom dynamisk fra eksisterende router\&quot; eller \&quot;Brug fast IP-adresse (anbefales ikke)\&quot;.<br>Klik på knappen Anvend på siden Trådløs Bridge og herefter træder dine ændringer i kraft.</p>",
