"AAWH11" : "<HR><A name=wps></A><P><B>WPS-indstillinger</B></P><p>Routerens PIN</p><p>Dette er det PIN-nummer, som du bruger på en registrator (f.eks. fra Network Explorer på en Vista Windows pc), til at konfigurere routerens trådløse indstillinger via WPS. Du kan også finde PIN-nummeret på routerens produktetiket.</p><P>Deaktiver routerens PIN<P>Det er kun, når routerens PIN er aktiveret, at du kan konfigurere routerens trådløse indstillinger eller tilføje en trådløs klient via WPS med routerens PIN-nummer. Denne routers PIN kan deaktiveres midlertidigt, når routeren registrerer mistænkelige forsøg på at bryde ind i routerens trådløse indstillinger ved at bruge routerens PIN via WPS. Du kan aktivere denne funktion manuelt ved at rydde afkrydsningsfeltet og klikke på knappen<b></b> <b>Anvend</b>. </P><P><b>Behold eksisterende trådløse indstillinger</b> <P>Dette viser, om routeren er i WPS-konfigureret tilstand.<br>Hvis denne valgmulighed ikke er valgt, vil tilføjelsen af en ny trådløs klient ændre routerens trådløse indstillinger til et automatisk genereret tilfældigt SSID og sikkerhedsnøgle. Ydermere, hvis denne indstilling er valgt, kan visse eksterne registratorer (f.eks. Network Explorer under Vista Windows) måske ikke se routeren.<br>Konfiguration af grundlæggende trådløse indstillinger fra routerens administrationsgrænseflade gør, at denne indstilling vælges automatisk.</P>",
"AAWH12" : "<p><A name=beamforming></A>Implicit Beamforming kan forbedre 11ac WiFi-ydelse uden brug af drev til de fleste mobilenheder, som f.eks. smartphones og tablets.</p>",
