"ANMH01" : "<p><font size=4><b> Hjælp til Network Monitor Display Settings (Visningsindstilling for netværksovervågning)   </b></font></p><p>Network Monitor Display (Visning for netværksovervågning) gør det muligt for dig at tilpasse indikatoren på den blå kuppel. Hvis du vil tænde for eller slukke for indikatoren kan du enten trykke ned på den blå kuppel eller bruge indstillingerne herunder. Du kan få oplysninger om indikatorens blinkemønstre i hjælpafsnittet til højre. Indikatorindstillingerne gælder kun, når indikatoren er tændt.</p><a name=display></a><p><b>Trådløs data-status (standard)</b></p><p>Indikatorer blinker når der sendes trådløse data. Den venstre indikator angiver indgående data, og den højre indikator angiver udgående data.</p><p><b>Gæstenetværk-status</b></p><p>Indikatorerne tændes, når Gæstenetværk er aktiveret og blinker, når en computer forbundet til det.</p><p><b>Live Parental Controls-status</b></p><p>Indikatorerne tændes, når Live Parental Controls er aktiveret og blinker, når et forsøg på at opnå adgang blokeres.</p><p><b>Bredbåndsforbrugsmåler-status</b></p><p>Indikatorerne blinker, når forbruget når advarselsniveauet og forbliver tændt, når forbruget når den forudindstillede grænse.</p><p><b>Sådan gemmes eller annulleres ændringer</b><ul><li>Klik på<b> Apply</b> (Anvend) for at gemme de nye indstillinger på routeren.</li><li>Klik på <b>Cancel (Annuller)</b> for at kassere ændringer, der ikke er gemt.</li></p>",
