"AWRH01" : "<P><font size=4><B>Hjælp til Indstillinger for trådløse gentagende funktioner (Wireless Repeating Function Settings)</B></font></P> <a name=en_repeat></a> <p><b>Aktiver Trådløse Repeating (Enable Wireless Repeating)</b></p> <p>Aktiver dette, hvis du vil bruge enten Bridge-tilstand eller Repeater-tilstand, og vælg derefter den ønskede tilstand for dit miljø. </p><ul><p><li><a name=repeat></a><strong>Trådløse Repeater. </strong>  <p>I denne tilstand vil -routeren<I>kun</I> kommunikere med en anden trådløs station i Base Station-tilstand. Du skal angive MAC-adressen (den fysiske adresse) på den anden trådløse station i Base Station-tilstand i det viste felt. WEP kan (og bør) anvendes til at beskytte denne kommunikation.   <p><li><a name=base></a><strong>* Trådløse basestation  </strong><p>Vælg kun dette, hvis denne er master for en gruppe trådløse stationer i Repeater-tilstand. De andre trådløse stationer i Repeater-tilstand skal være indstillet til Trådløse Repeater-tilstand vha. denne routers MAC-adresse. De sender herefter al trafik til denne master, i stedet for at kommunikere direkte med hinanden. WEP kan (og bør) anvendes til at beskytte denne trafik.   <p>Hvis valgt, skal du angive MAC-adresserne på de andre Access Points i de viste felter. >",
