"AWN046" : "<H1><span>Bemærk!</span></H1><P><span>Du skal muligvis foretage øvrige handlinger for at oprette forbindelse til internettet:</span></P><P><span> Klik på &quot;Giv mig internetforbindelse&quot;, og indtast legitimationsoplysninger eller aftale i browservinduet.  </span></P>",
"AWN047" : "<P>Bemærk!</P><span>Routeren skal ændre netværksindstillinger.</span><span>Forbindelsen afbrydes midlertidigt i 2 minutter.</span>",
"AWN048" : "<p name=vpn_passthrough id=vpn_passthrough><b>VPN-videregivelse</b></p><p>Denne indstilling lader brugeren aktivere/deaktivere VPN-videregivelsesfunktionen. Routeren understøtter som standard tre typer VPN-videregivelsestjenester: IPSec, PPTP og L2TP.</p>",
