"ALSH01" : "<p><font size=4><b>Hjælp til LAN Setup</b></font></p>  <p>DHCP- og TCP-/IP-standardværdierne fungerer for de fleste brugere.</p><hr><a name=device_name></a><p><b>Enhedsnavn</b></p><p>Dette er routerens forkortede navn. Du kan se dette navn på routeren i Network Explorer på Windows Vista-systemer og Network Explorer op alle Windows-systemer.</p><hr><a name=tcp></a><p><b>Konfiguration af LAN TCP/IP</b></p><p>Disse er avancerede indstillinger, som du kan konfigurere, hvis du er netværksadministrator, og dit netværk indeholder flere routere. Hvis du ændrer disse indstillinger, er du nødt til at genstarte dine computere, inden indstillingerne træder i kraft.</p><ul><li><B>IP-adresse</B>. Indtast din routers IP-adresse i punktumformat<li><b>IP-undernetmaske</B>. Undernetmasken angiver netværksnummerdelen af en IP-adresse. Din router beregner automatisk undernetmasken baseret på den IP-adresse, som du tildeler. Medmindre du implementerer subnetting, skal du bruge 255.255.255.0 som undernetmasken (beregnet af routeren).</ul><ul><li><b>RIP-retning:</B> RIP (Routing Information Protocol, RFC1058 og RFC1389) tillader en router at udveksle routing-oplysninger med andre routere. Valget af RIP-retning styrer, hvordan routeren sender og modtager RIP-pakker. Begge er standard.<ul><li>Når den er konfigureret til <b>Begge</b> eller <b>Kun ud</b>, vil routeren udsende sin routingtabel periodisk. <li>Når den er konfigureret til <b>Begge</b> eller <b>Kun ind</b>, vil den anvende RIP-oplysningerne, som den modtager. </ul><li><b>RIP<li><b>RIP-version:</B> Dette styrer formatet og udsendelsesmetoden for de RIP-pakker, som routeren udsender. (Den genkender begge formater, når den modtager.) Som standard er dette sat til Deaktiveret.<ul><li>RIP-1 understøttes universelt. RIP-1 er sandsynligvis tilstrækkelig for de flesste netværk, medmindre du har en usædvanlig netværksopsætning. <li>RIP-2 indeholder flere oplysninger. Både RIP-2B og RIP-2M udsender routingdataene i RIP-2-format. <UL> <li>RIP-2B anvender subnetudsendelse.  <li>RIP-2M anvender multicast (Se noten nedenfor.) </ul> </ul></ul><p><b>Bemærk:  </b>Multicast-udsendelse kan reducere belastningen på ikke-router maskiner, fordi de ikke lytter efter RIP-multicast-udsendelsesadressen og ikke vil modtage RIP-pakkerne. Men hvis en router bruger multicast-udsendelse, skal alle routere på dit netværk bruge multicast-udsendelse. </p><hr><a name=dhcp></a><p><b>Benyt routeren som DHCP-server</b></p><p>Routeren konfigureres som standard som en DHCP-server (Dynamic Host Configuration Protocol), hvilket giver TCP-/IP-konfigurationen for alle de computere, der er tilsluttet routeren.  <p> Medmindre du får besked af din internetudbyder på at ændre disse indstillinger, skal du lade markeringen stå i afkrydsningsfeltet <b>Benyt routeren som DHCP-server</b>.  <p> Hvis din internetudbyder beder dig afmarkere dette afkrydsningsfelt, skal du have en anden DHCP-server på dit netværk, eller også skal du konfigurere computeren manuelt.   <ul><li><B>Første IP-adresse</B>. Dette felt angiver den første af de sammenhængende adresser i IP-adressegruppen. 192.168.1.2 er standardstartadressen. <li><b>Sidste IP-adresse</b>. Denne boks angiver den sidste af de sammenhængende adresser i IP-adressegruppen. 192.168.1.254 er standardslutadressen.</ul><hr><a name=reserved></a><p><b>Adressereservation</b></p><p>Når du angiver en reserveret IP-adresse på en pc på LAN&apos;et, vil denne pc altid modtage den samme IP-adresse, hver gang den tilslutter til DHCP-serveren. Reserverede IP-adresser skal tildeles servere, der har brug for permanente IP-indstillinger.<p><b>Sådan reserveres en IP-adresse:</b> <ol><li> Klik på knappen <b>Tilføj</b>. <li> Vælg alternativknappen for den computer, som du vil tilføje, fra tabellen Adressereservation.<li> Hvis computeren ikke findes i tabellen Adressereservation, skal du angive IP-adressen, MAC-adressen og enhedsnavnet på den computer, som du vil tilføje.<li> Klik på knappen <B>Tilføj</b>, når du er færdig.</ol><br><p><b>Sådan redigeres en reserveret IP-adresse:</b> </p><ol><li> Vælg alternativknappen ved siden af den reserverede adresse, som du vil redigere.<li> Klik på knappen <b>Rediger</b>.<li> Rediger IP-adressen, MAC-adressen eller enhedsnavnet.<li> Klik på knappen <B>Accepter</b>, når du er færdig.</ol><p><b>Sådan slettes en reserveret IP-adresse:</b> </p><ol><li> Vælg alternativknappen ved siden af den reserverede adresse, som du vil slette.<li> Klik på knappen <b>Slet</b>. </ol><hr><a name=To></a><p><b>Sådan gemmer eller annullerer du ændringer:</b></p><p>Klik på <b>Anvend</b> for at gemme de nye indstillinger på routeren. <br>Klik på <b>Annuller</b> for at kassere ændringer, der ikke er gemt. </p>",
