"AQSH01" : "<P><font size=\&quot;4\&quot;><B>Hjælp til QoS-indstillinger</B></font></P><p>QoS er en avanceret funktion, der kan bruges til at give prioritet til nogle internetprogrammer og onlinespil og til at minimere påvirkningen, når båndbredden er under pres. <hr><p><a name=&quot;wifi&quot;></a><b>Indstillinger for Wi-Fi Multimedia (WMM)</b><P>WMM (Wireless Multimedia) er et undersæt af standarden 802.11e. WMM muliggør, at trådløs trafik har en række prioriteter, afhængigt af typen af data. Tidsafhængige oplysninger, som video eller audio, har en højere prioritet end normal trafik. For at WMM skal fungere korrekt, skal trådløse klienter også understøtte WMM.<hr><p><a name=&quot;qos_on&quot;></a><b>Aktiver upstream-QoS</b><p> Hvis denne funktion er aktiveret, prioriterer QoS-funktionen udgående internettrafik. For programmer, onlinespil, Ethernet LAN-port eller angivet MAC-adresse, der allerede findes i rullelisten, kan du ændre prioritetsniveauet ved at klikke på knappen <b>Rediger</b>. Klik på knappen <b>Slet</b> for at slette prioritetsreglen. Du kan også definere prioritetspolitikken for hvert onlinespil, program, LAN-port eller computerens MAC-adresse ved at klikke på knappen <b>Tilføj prioritetsregel</b>.</P><p>Du skal have konfigureret <b>Maks. båndbredde for upload</b>, før du kan få denne QoS-funktion til at fungere. Hvis du ikke kender den maksimale uploadhastighed for din internetforbindelse, kan du følge dette URL for at gå til webstedet speedtest.net. På Speedtest-webstedet kan du kontrollere den maksimale uploadhastighed for din internetforbindelse. Sørg for at køre testen på en computer med en kablet tilslutning til routeren, eller at computerens trådløse forbindelse til routeren er hurtigere end din internetforbindelse. <hr><p><b>For programmer eller onlinespil</b><p>Sådan konfigurerer du prioriteten for et program eller onlinespil: <ul>1. Vælg <b>Programmer</b> eller <b>Onlinespil</b> fra listerne </b>Prioritetskategori</b>. <br>2. Marker det internetprogram eller spil, du vil bruge, fra en af de relevante lister. <br>3. Vælg prioritetsniveau: <b>Højest</b>, <b>Høj</b>, <b>Normal</b> eller <b>Lav</b>. <br>4. Du kan også skrive navnet i feltet <b>QoS-politik for </b>for denne regel. <br>5. Klik på <b>Anvend.</b></ul><p><b>For en Ethernet LAN-port</b><p>Sådan konfigurerer du prioriteten for computere, der er tilsluttet til en LAN-port: <ul>1.  Vælg det antal LAN-porte, som du vil angive prioritetsniveau for. <br>2. Vælg prioritetsniveau: <b>Højest</b>, <b>Høj</b> <b>Normal</b> eller <b>Lav</b>. <br>3. Du kan også skrive navnet i feltet <b>QoS-politik for </b>for denne regel. <br>4. Klik på <b>Anvend</b>.</ul><p><b>For en MAC-adresse</b><p>Sådan konfigurer du prioriteten for en angivet computer via dens MAC-adresse: <ul>1. Vælg MAC-adressen fra listen <b>Prioritetskategori</b>. <br>2. Klik på knappen <b>Opdater </b>for at opdatere listen over de computere, der allerede er forbundet med routere. <br>3. Vælg angivelsens alternativknap i tabellen. <br>4. Rediger oplysningerne i felterne <b>MAC-adresse</b> og <b>Enhedsnavn</b>. <br>5. Vælg prioritetsniveau: <b>Højest</b>, <b>Høj</b>, <b>Normal</b> eller <b>Lav</b>. <br>6. Du kan også skrive navnet i feltet <b>QoS-politik for </b>for denne regel. <br>7. Klik på knappen <b>Rediger</b>. <br>8. Klik på <b>Anvend</b>. </ul><p>Sådan tilføjer du prioritet for en angivet computer via dens MAC-adresse: <ul>1. Vælg <b>MAC-adresse </b>fra listen <b>Prioritetskategori</b>. <br>2. Skriv MAC-adressen for den computer, som du vil definere prioritet for. <br>3. Du kan også skrive et navn i feltet <b>Enhedsnavn</b>. <br>4. Vælg prioritetsniveau: Højest, Høj, Normal eller Lav. <br>5. Du kan også skrive navnet i feltet <b>QoS-politik for </b>for denne regel. <br>6. Klik på knappen <b>Tilføj</b>. <br>7. Klik på <b>Anvend</b>. </ul><p><b>Sådan sletter du en tjenesteangivelse:</b><ul>1. Vælg angivelsens alternativknap i tabellen. <br>2. Klik på knappen <b>Slet</b>. <br>3. Klik på knappen <b>Anvend</b>. >",
"AQSH02" : "<P><a name=\&quot;su\&quot;></a><b>Enable Trusted IP address</b><p>Under visse omstændigheder med megen trafik, kan det være bekvemt at give fordel til en særlig vært med halvdelen af hele WAN-båndbredden. Dette kan gøres ved at markere valget <b>Enable Trusted IP address</b>, og udfylde denne værts IP-adresse.<hr>",
