"ADDH01" : "<P><font size=4><B>Hjælp til Dynamisk DNS (Dynamic DNS)</B></font></P><p>  En Dynamisk DNS (DDNS)-tjeneste leverer en central offentlig database, hvor oplysninger (som f.eks. e-mail-adresser, værtsnavne og IP-adresser) kan lagres og hentes. DDNS-serveren lagrer også oplysninger, der er beskyttet med adgangskode, og accepterer forespørgsler baseret på e-mail-adresser. </p><p>  Hvis du ønsker at bruge en DDNS-tjeneste, skal du tilmelde dig en. Udbyderen af DDNS-klienttjenesten giver dig en adgangskode eller nøgle.</p><a name=setup></a><p>Sådan konfigurerer du DDNS:<ol><li>Hvis du har tilmeldt dig hos en udbyder af en DDNS-tjeneste, skal du markere afkrydsningsfeltet <b>Brug en dynamisk DNS-tjeneste (Use A Dynamic DNS Service)</b>.  </li><li><a name=provider></a>Vælg navnet på udbyderen af DDNS-tjenesten.&nbsp; </li><li>Indtast det værtsnavn, som udbyderen af DDNS-tjenesten forsynede dig med. <br>Udbyderen af DDNS-tjenesten kalder evt. dette for domænenavnet. </li><li>Indtast brugernavnet (User Name) for din DDNS-konto. </li><li>Indtast adgangskode (Password) (eller nøgle) for din DDNS-konto. </li> <li>Klik på <b>Anvend (Apply)</b> for at få den anvendte DDNS-tjeneste.  </li></ol><p><b>Bemærk:</b> Routeren understøtter kun grundlæggende DDNS, og login og adgangskode er muligvis ikke sikker. Hvis du har en privat WAN IP-adresse, skal du ikke bruge en DDNS-tjeneste, da det kan give problemer. </p>",
"ADDH02" : "<P><font size=4><B>Hjælp til Dynamisk DNS (Dynamic DNS)</B></font></P><p>  En Dynamisk DNS (DDNS)-tjeneste leverer en central offentlig database, hvor oplysninger (som f.eks. e-mailadresser, værtsnavne og IP-adresser) kan lagres og hentes. DDNS-serveren lagrer også oplysninger, der er beskyttet med adgangskode, og accepterer forespørgsler baseret på e-mailadresser. </p><p>  Hvis du ønsker at bruge en DDNS-tjeneste, skal du tilmelde dig en. Udbyderen af DDNS-klienttjenesten giver dig en adgangskode eller nøgle.</p><a name=setup></a><p>Sådan konfigurerer du DDNS:<ol><li>Vælg afkrydsningsfeltet <b>Brug en DDNS-tjeneste</b> (Use A Dynamic DNS Service) til at aktivere DDNS-funktionen.  </li><li>Hvis du ikke har tilmeldt dig hos en udbyder af DDNS-tjenester, skal du vælge <b>NETGEAR</b> på listen <b>Tjenesteudbydere</b> (Service Provider). Ellers skal du vælge navnet på din udbyder af DDNS-tjenester på listen. </li><li>Indtast det værtsnavn, du har tilmeldt dig med, hos din udbyder af DDNS-tjenester. <br>Udbyderen af DDNS-tjenesten kalder evt. dette for domænenavnet. </li><li>Indtast brugernavnet (User Name) for din DDNS-konto. </li><li>Indtast adgangskode (Password) (eller nøgle) for din DDNS-konto. </li> <li>Klik på <b>Anvend (Apply)</b> for at få den anvendte DDNS-tjeneste.  </li></ol><p><b>Bemærk:</b> Routeren understøtter kun grundlæggende DDNS, og login og adgangskode er muligvis ikke sikker. Hvis du har en privat WAN IP-adresse, skal du ikke bruge en DDNS-tjeneste, da det kan give problemer. </p>",
"ADDH03" : "<P><font size=4><B>Hjælp til Dynamisk DNS (Dynamic DNS)</B></font></P><p>  En Dynamisk DNS (DDNS)-tjeneste leverer en central offentlig database, hvor oplysninger (som f.eks. e-mailadresser, værtsnavne og IP-adresser) kan lagres og hentes. DDNS-serveren lagrer også oplysninger, der er beskyttet med adgangskode, og accepterer forespørgsler baseret på e-mail-adresser. </p><p>  Hvis du ønsker at bruge en DDNS-tjeneste, skal du tilmelde dig en. Udbyderen af DDNS-klienttjenesten giver dig en adgangskode eller nøgle.</p><a name=setup></a><p>Sådan konfigurerer du DDNS:<ol><li>Vælg afkrydsningsfeltet <b>Brug en DDNS-tjeneste</b> (Use A Dynamic DNS Service) til at aktivere DDNS-funktionen.  </li><li>Hvis du ikke har tilmeldt dig hos en udbyder af DDNS-tjenester, skal du vælge <b>NETGEAR</b> på listen <b>Tjenesteudbydere</b> (Service Provider). Ellers skal du vælge navnet på din udbyder af DDNS-tjenester på listen.</li><li>Hvis det er første gang, du bruger NETGEAR DDNS-tjenesten, skal du vælge <b>Nej</b> til spørgsmålet <b>Har du en NETGEAR DDNS-konto?</b> (Do you have a NETGEAR DDNS account?). Ellers kan du vælge <b>Ja</b> og derefter indtaste dine kontooplysninger.</li><li>Indtast det værtsnavn, du vil bruge til denne enhed. Det kaldes også nogen gange for et domænenavn. </li><li>Indtast den e-mailadresse, du vil bruge til din DDNS-konto. </li><li>Indtast adgangskoden (eller nøglen) til din DDNS-konto. </li> <li>Klik på <b>Tilmeld</b> (Register) for at tilmelde dig til NETGEAR DDNS-tjenesten.  </li></ol><p><b>Bemærk:</b> Routeren understøtter kun grundlæggende DDNS, og login og adgangskode er muligvis ikke sikker. Hvis du har en privat WAN IP-adresse, skal du ikke bruge en DDNS-tjeneste, da det kan give problemer. </p>",
"ADDH04" : "<P><font size=4><B>Hjælp til Dynamisk DNS (Dynamic DNS)</B></font></P><p>  En Dynamisk DNS (DDNS)-tjeneste leverer en central offentlig database, hvor oplysninger (som f.eks. e-mail-adresser, værtsnavne og IP-adresser) kan lagres og hentes. DDNS-serveren lagrer også oplysninger, der er beskyttet med adgangskode, og accepterer forespørgsler baseret på e-mail-adresser. </p><p>  Hvis du ønsker at bruge en DDNS-tjeneste, skal du tilmelde dig en. Udbyderen af DDNS-klienttjenesten giver dig en adgangskode eller nøgle.</p><a name=setup></a><p>Sådan konfigurerer du DDNS:<ol><li> Vælg afkrydsningsfeltet <b>Brug en DDNS-tjeneste</b> (Use A Dynamic DNS Service) til at aktivere DDNS-funktionen.  </li><li>Hvis du ikke har tilmeldt dig hos en udbyder af DDNS-tjenester, skal du vælge <b>NETGEAR</b> på listen <b>Tjenesteudbydere</b> (Service Provider). Ellers skal du vælge navnet på din udbyder af DDNS-tjenester på listen. </li><li>Hvis det er første gang, du bruger NETGEAR DDNS-tjenesten, kan du vælge <b>Nej</b> til spørgsmålet <b>Har du en NETGEAR DDNS-konto?</b> (Do you have a NETGEAR DDNS account?). Ellers kan du vælge <b>Ja</b> og derefter indtaste dine kontooplysninger.</li><li>Indtast det værtsnavn, du har tilmeldt til din NETGEAR DDNS-tjeneste. Det kaldes også nogen gange for et domænenavn. </li><li>Indtast den e-mailadresse, der bruges til din DDNS-konto.</li><li>Indtast adgangskode (Password) (eller nøgle) for din DDNS-konto. </li> <li>Klik på <b>Anvend (Apply)</b> for at få den anvendte DDNS-tjeneste.  </li></ol><p><b>Bemærk:</b> Routeren understøtter kun grundlæggende DDNS, og login og adgangskode er muligvis ikke sikker. Hvis du har en privat WAN IP-adresse, skal du ikke bruge en DDNS-tjeneste, da det kan give problemer. </p>",
