"ASRH01" : "<P><font size=4><B>Hjælp til statiske routes (Static Routes)</B></font></P><p>  Statiske routes giver routeren oplysninger, som den ikke kan få automatisk på andre måder. Dette kan ske, når RIP er deaktiveret på LAN&apos;et. (Se skærmbilledet LAN IP-konfiguration (LAN IP Setup)). Alle definerede statiske routes vises i tabellen. Du kan tilføje eller slette en route i området under tabellen Statiske routes (Static Routes).</p><hr><a name=str_table></a><p><b>Sådan konfigureres en statisk route:</b> </p><ol><li>Klik på knappen <b>Tilføj (Add)</b>. </li><li>Skriv et routenavn på denne statiske route i feltet <b>Navn på route (Route Name)</b> under tabellen.<br>(Dette er kun til identifikationsformål.) </li><li>Vælg <b>Privat (Private)</b>, hvis du kun vil begrænse adgangen til LAN&apos;et. </li><li>Vælg <b>Aktiv (Active)</b> for at aktivere routen. </li><li>Skriv destinations-IP-adressen på den endelige destination. </li><li>Skriv IP-subnetmasken for denne destination. <br>Hvis dette er en enkelt vært, skal du skrive <b>255.255.255.255</b>. </li><li>    Skriv Gateway-IP-adressen, som skal være en router på det samme segment. </li><li>Skriv et tal mellem 2 og 15 som <b>Metrisk værdi</b> (Metric value).   <br>Dette repræsenterer antallet af andre routere på dit netværk. Normalt fungerer det bedst, hvis værdien indstilles til 2 eller 3, men hvis dette er en direkte forbindelse, skal den indstilles til 2. </li><li>    Klik på <b>Anvend (Apply)</b> for at få den statiske route vist i tabellen. </li></ol><p><b>Sådan redigeres en statisk route:</b> <ol><li>Klik på alternativknappen ved siden af den route, som du vil redigere. </li><li> Opdater oplysningerne.<li>Klik på <b>Anvend (Apply)</b>, når du er færdig.</ol><p><b>Sådan slettes en statisk route:</b> <ol><li>Klik på alternativknappen ved siden af den route, som du vil slette. </li><li>Klik på <b>Slet (Delete)</b>.</li><li>Klik på <b>Anvend (Apply)</b> for at få den statiske route slettet fra tabellen. </li></ol>",
