"ARMH01" : "<P><font size=4><B>Hjælp til Fjernadministration (Remote Management)</B></font></P><p>  Ved at bruge menuen Remote Management kan du tillade en bruger på internettet at konfigurere, opgradere og kontrollere status på din router.</p><p> <b>VIGTIGT: </b><i>Sørg for at ændre routerens standardadgangskode til en meget sikker adgangskode.</i></p><hr><a name=turnon></a><p><b>Slå fjernadminstration til (Turn Remote Management On)</b></p><p><ul> 1.Marker afkrydningsfeltet <b>Slå fjernadministration til (Turn Remote Management On)</b>.<br> 2.Klik på knappen <b>Anvend (Apply)</b> for at gemme ændringen.</ul> </ul> </p> <hr> <a name=address></a><p><b>Adresse til fjernadministration (Remote Management Address)</b></p><p>Dette er den aktuelle adresse, som du vil bruge, når du tilslutter til din router fra internettet. For at tilslutte til routeren skal du indtaste routerens WAN IP-adresse i din webbrowsers adressefelt (i IE) eller Location box (i Netscape) efterfulgt af et kolon (:) og det brugertilpassede portnummer. Hvis din eksterne adresse f.eks. er 10.0.0.123, og du bruger portnummer 8080, skal du i din webbrowser angive:</p> <p><screen>http://10.0.0.123:8080</screen></p><hr><a name=access></a><p><b>Tillad ekstern adgang (Allow Remote Access)</b><p>  Af sikkerhedsårsager bør du begrænse adgang til så få eksterne IP-adresser som praktisk muligt. <p><ul>Vælg <b>Kun denne computer (Only This Computer)</b> for kun at tillade adgang for én IP-adresse.</ul><p><ul>Vælg <b>IP-adresseinterval (IP Address Range)</b> for at tillade adgang fra en række IP-adresser på internettet. Angiv en start- og en slut-IP-adresse for at definere det tilladte område.</ul><p><ul>Vælg <b>Alle (Everyone)</b> for at give alle på internettet adgang.</ul><hr><a name=port></a><p><b>Portnummer (Port Number)</b></p><p>Adgang med webbrowser bruger normalt port 80, der er standard til HTTP. For at opnå større sikkerhed, kan du ændre webinterfacet til fjernadministration til en brugerdefineret port ved at angive det nummer i feltet, der vises. Vælg et nummer mellem 1024 og 65534, men brug ikke et nummer, som bruges af en almindelig tjenesteport.</p><hr> <p><b>Sådan gemmer eller annullerer du ændringer:</b></p><a name=To></a><p>Klik på <b>Anvend (Apply)</b>, for at dine ændringer træder i kraft.<br>Klik på <b>Annuller (Cancel)</b> for at gå tilbage til de tidligere indstillinger.</p>",
