"AAUH01" : "<P><font size=4><B> Hjælp til USB-indstillinger (USB Settings)</B></font></P><P> For at øge sikkerheden kan routeren konfigureres til kun at dele godkendte USB-enheder. Denne funktion aktiveres ved at vælge Nej (No) og klikke på Anvend (Apply).</P><P> De godkendte enheder defineres ved at klikke på Godkendte enheder (Approved Devices) </P>",
"AAUH02" : "<P><font size=4><B> Hjælp til Godkendte USB-enheder (USB Drive Approved Devices)</B></font></P><P> For at øge sikkerheden kan routeren konfigureres til kun at dele godkendte USB-enheder. Denne funktion aktiveres ved at markere afkrydsningsfeltet Tillad kun godkendte enheder (Allow only approved devices) og klikke på Anvend (Apply).</P><P> Sådan tilføjer du en enhed til Godkendte USB-enheder (Approved USB Devices):<OL><LI> Enheden skal være tilsluttet routeren.</LI><LI> Når den er tilsluttet, vises enheden på Tilgængelige USB-enheder (Available USB Devices) </LI><LI> Vælg enheden, og klik på Tilføj (Add) </LI></OL></P><P> Sådan fjerner du en enhed fra Godkendte USB-enheder (Approved USB Devices):<OL><LI> Vælg enheden på Godkendte USB-enheder (Approved USB Devices) </LI><LI> Klik på Slet (Delete) </LI></OL></P>",
