"AUPH01" : "  <p><font size=4><b>       Hjælp til UPnP  </b></font></p><p>Universal Plug and Play (UPnP) hjælper enheder som f.eks. internetapparater og  computere, med at få adgang til netværket og tilslutte til andre enheder efter behov. UPnP-enheder kan automatisk registrere tjenester fra andre registrerede UPnP-enheder på netværket. </p><a name=turnon></a> <p><b>Slå UPnP til (Turn UPnP On)</b></p><p>UPnP kan aktiveres til automatisk enhedskonfiguration, eller det kan deaktiveres. Standardindstillingen for UPnP er aktiveret. Når funktionen er deaktiveret, vil routeren ikke tillade nogen enhed at styre routerens ressourcer automatisk, som f.eks. portvideresendelse (mapping). </p><a name=adv></a>  <p><b>Annonceringsperiode (Advertisement Period)</b></p><p>Annonceringsperioden er, hvor ofte routeren vil annoncere (udsende) sine UPnP-oplysninger. Denne værdi kan være fra 1 til 1440 minutter. Standardperioden er 30 minutter. Kortere varighed sikrer, at kontrolpunkter har aktuel enhedsstatus på bekostning af yderligere netværkstrafik. Længere varighed kan have en negativ effekt på enhedsstatusens friskhed, men kan i væsentlig grad reducere netværkstrafikken.</p><a name=live></a>  <p><b>Annonceringens levetid (Advertisement Time to Live)</b></p><p>Annonceringens levetid måles i hop (trin) for hver UPnP-pakke, der er sendt. Et hop er antallet af trin, der tillades at forplante sig for hver UPnP-annonce, inden den forsvinder. Antallet af hop kan ligge mellem 1 og 255. Standardværdien for annoncens levetid er 4 hop, hvilket bør være tilstrækkeligt for de fleste hjemmenetværk. Hvis du bemærker, at nogle enheder ikke opdateres eller nås korrekt, kan det være nødvendigt at forøge denne værdi en smule.</p><a name=table></a><p><b>UPnP-porttilknytningstabel (UPnP Portmap Table)</b></p><p>UPnP-porttilknytningstabel (UPnP Portmap Table) viser IP-adressen på hver UPnP-enhed, der aktuelt opnår adgang til routeren, og hvilke porte (interne og eksterne) hver enhed har åbnet. UPnP-porttilknytningstabel (UPnP Portmap Table) viser også, hvilken type port, der er åbnet, og om den port stadig er aktiv for hver IP-adresse.<p><b>Sådan gemmer, annullerer eller opdaterer du tabellen:</b></p><p>Klik på <b>Anvend (Apply)</b> for at gemme de nye indstillinger af routeren. <br>Klik på <b>Annuller (Cancel)</b> for at kassere ændringer, der ikke er gemt. <br>Klik på <b>Opdater (Refresh)</b> for at opdatere porttilknytningstabellen og vise de aktive porte, der aktuelt er åbnet af UPnP-enheder.  >",
