"ATMH01" : "<P><font size=4><B> Hjælp til Trafikmåler (Traffic Meter)  </B></font></P><A name=internet></A><H2 class=helpfile> <b>Internettrafikmåler (Internet Traffic Meter)  </b></H2><A name=meter></A><P><B> Aktiver trafikmåler (Enable Traffic Meter)  </B> <BR> Vælg dette, hvis du ønsker at registrere mængden af internettrafik, der går gennem routerens internetport.<P><B> Kontroller trafikmængde med (Traffic volume control by)  </B> <BR> Vælg dette, hvis du ønsker at registrere og begrænse mængden af internettrafik, der går gennem routerens internetport.<UL><LI> Ingen grænse (No Limit) - Hvis dette er valgt, vil den angivne begrænsning ikke blive anvendt, når grænsen for trafik nås.<LI> Kun download (Download only) - Hvis dette er valgt, vil den angivne begrænsning kun blive anvendt på den indgående trafik <LI> Begge veje (Both Directions) - Hvis dette er valgt, vil den angivne begrænsning blive anvendt på både indgående og udgående trafik.</UL><P><B> Tidskontrol af forbindelsen (Connection time control)</B> <BR> Vælg dette, hvis du ønsker at registrere og begrænse tidsbruget på internetforbindelsen.<P><B> Månedlig grænse (Monthly Limit)  </B><BR> Angiv begrænsningen på den månedlige mængde eller forbindelsestid.<P><B> Rund datamængden for hver forbindelse op med (Round up data volume for each connection by)</B> <BR> Nogle internetleverandører opkræver et bestemt beløb af ekstra datamængde, når brugeren opretter en ny forbindelse. Hvis det er tilfældet, skal du angive den ekstra datamængde her.<A name=counter></A><H2 class=helpfile> <b>Trafiktæller (Traffic counter)</b></H2><P><B> Nulstil trafiktælleren (Restart traffic counter)</B><BR> Dette bestemmer, hvornår trafiktælleren nulstilles. Vælg det ønskede klokkeslæt og dagen i måneden.<P><B> Nulstil tælleren nu (Restart Counter Now)</B> <BR> Klik på denne knap for at nulstille trafiktælleren med det samme.<A name=reached></A><H2 class=helpfile> <b> Trafikkontrol (Traffic Control)  </b></H2><P><B> Advarselsmeddelelse vises som pop-op (Pop up a warning message)</B><BR> Indtast en anden værdi end nul for at få routeren til at vise en pop-op-advarsel, når den månedlige begrænsning for datamængde/forbindelsestid nås, efter det angivne beløb er brugt op. Pop-op-meddelelsen kan kun vises, når vinduet Trafikstatus er åbent.<P><B> Når den månedlige grænse nås (When the monthly limit is reached)</B><BR><P> Vælg de(n) ønskede handling(er):<UL> <LI> Skift internetindikatoren, så den blinker grønt/gult (Turn the Internet LED green/amber flashing) - internetindikatoren blinker skiftevist grønt og gult. <LI> Afbryd og deaktiver internetforbindelsen (Disconnect and disable the Internet connection) - al adgang til internettet blokeres. </UL><A name=statistics></A><H2 class=helpfile><b> Statistik for internettrafik (Internet Traffic Statistics)</b></H2><P> Dette viser statistik om internettrafik gennem internetporten. <BR> Hvis du ikke har aktiveret Trafikmåler (Traffic Meter), er denne statistik ikke tilgængelig. <P><B> Trafikstatus (Traffic Status)</B> <BR><BR> Klik på denne knap for at få opdateret status for forbrug af internettrafik i realtid.<P></P>",
