"GDH01" : "<p><font size=4><B>NETGEAR Downloader</B></font></p><p><b>NETGEAR Downloader</b> understøtter downloadprotokollerne HTTP, FTP, BT og eDonkey. Med NETGEAR Downloader, kan du bruge en <b>NETGEAR Router</b> til at downloade internetfiler og gemme dem på en USB-lageenhed uden at have en computer tændt.</p><hr><a name=green_path></a><b>Gem som sti:  </b>Vælg en placering hvor du vil gemme de filer, du har downloadet.</p>",
"GDH02" : "<p><b>FTP/HTTP-download</b> lader brugeren downloade download fra internettet via protokollen FTP/HTTP.</p><hr><p><a name=http_url></a><b>Downloadlink til FTP/HTTP:  </b>Dette er en internetadresse og indikerer URL&apos;et for den fil, du vil downloade fra internettet. Formatet er ftp:// eller http://.<br><a name=http_name></a><b>Brugernavn (valgfrit):  </b>Dette felt er valgfrit. Indtast serverens brugernavn her, hvis serveren kræver det. Brugernavnet må maksimalt fylde 32 tegn.<br><a name=http_password></a><b>Adgangskode (valgfrit):  </b>Dette felt er valgfrit. Indtast serverens adgangskode her, hvis serveren kræver det. Adgangskoden må maksimalt fylde 32 tegn.<br><b>Tilføj:  </b>Klik på knappen \&quot;Tilføj\&quot; for at tilføje en ny downloadopgave.<br><b>Nulstil:  </b>Klik på knappen \&quot;Nulstil\&quot; for at nulstille alt brugerindhold.</p><hr><p><a name=http_table></a><b>Tabel over downloadoplysninger</b></p><p><b>Sæt på pause:  </b>Klik på knappen \&quot;Sæt på pause\&quot; for at sætte en downloadopgave på pause.<br><b>Genoptag:  </b>Klik på knappen \&quot;Genoptag\&quot; for at genoptage en opgave, der er sat på pause.<br><b>Slet:  </b>Klik på knappen \&quot;Slet\&quot; for at slette en valgt opgave.</p><hr><p><a name=http_table></a><b>Downloadede filer</b></p><p><b>Fjern historik:  </b>Klik på knappen \&quot;Fjern historik\&quot; for at fjerne alle fuldførte downloadede opgaver.</p>",
"GDH03" : "<p><b>BT-download</b> lader brugeren downloade filer fra internettet via en BT-protokol.</p><hr><p><a name=bt_loc></a><b>Placering af torrent:  </b>Angiv placeringen af en torrent, og klik på knappen \&quot;Gennemse\&quot; for at vælge torrent-filen på en pc eller en USB-lagringsenhed.<br>",
"GDH04" : "<p><b>Download af eDonkey</b> lader brugeren downloade filer fra internettet via en eD2K-protokol.</p><hr><p><a name=emule_url></a><b>Downloadlink til eDonkey:  </b>Dette er en internetadresse og indikerer URL&apos;et for den fil, du vil downloade fra internettet. Formatet er ed2k://.<br>",
"GDH05" : "<p>Du kan installere en ny version af programmet NETGEAR Downloader igennem denne side.</p><p><a name=check></a>Klik på knappen \&quot;<b>Kontroller</b>\&quot;, hvorefter routeren automatisk kontrollerer, om der er en <b>ny version</b> af programmet NETGEAR Downloader tilgængelig på webstedet <b>NETGEAR</b>. Hvis der registreres en ny version, kan du besøge webstedet <b>NETGEAR</b> for at hente den.</p>",
"GDH06" : "<P><font size=4><B>Hjælp til indstillinger for NETGEAR Downloader</B></font></p><HR><a name=gd_down_speed></a><P><B> Maks. antal samtidige downloadopgaver  </B><p>Angiv det maksimale antal samtidige downloadopgaver. Standardindstillingen er baseret på den trådløse routers CPU-databehandlingskraft og DRAM-størrelse.</p><P><B>Maks. downloadhastighed pr. tjeneste(0 betyder ingen begrænsning)</B></P><p>Denne indstilling begrænser din maksimale downloadhastighed (enheden er KB/s) for hver tjeneste, HTTP/FTP, BT eller eDonkey. Standardindstillingen er 0 (0 betyder, at der ikke er nogen grænse for downloadhastigheden).</p><a name=gd_up_speed></a><p><B>Maks. uploadhastighed pr. tjeneste(0 betyder ingen begrænsning)  </B></p><p>Denne indstilling begrænser din maksimale uploadhastighed (enheden er KB/s) for hver tjeneste, HTTP/FTP, BT eller eDonkey. Standardindstillingen er 0 (0 betyder, at der ikke er nogen grænse for uploadhastigheden).</P><a name=gd_task_num></a><P><B> Aktiver Automatisk Opdateringsstatus  </B><p>Aktiver denne funktion for automatisk at opdatere status for download af opgaver. Hvis den ikke er aktiveret, opdateres status kun ved at klikke på knappen &quot;Opdater&quot;. Automatisk opdateringsstatus kræver mere CPU-strømstyring, så hvis det aktiverer, kan andre routerfunktioner blive langsommere.</p><P><B> Send en e-mail-meddelelse  </B><p>Aktiver denne funktion for at sende e-mail-meddelelser når download af opgaver er udført. Brug knappen &quot;Konfigurer e-mail&quot; til at konfigurere dine e-mail-kontooplysninger. </p>",
