"TVMH_001" : "<B>FastTrack</B> Første gang du aktiverer FastTrack, skal du angive den båndbredde, du vil reservere, og konfigurere trykknappen for FastTrack. Udfyld alle felter på dette skærmbillede, og klik på <B>Anvend</B>, således at dine ændringer træder i kraft. <B>Status for FastTrack:</B> Dette felt viser, om FastTrack i øjeblikket er aktiveret eller deaktiveret. <B>Aktiver FastTrack:</B> Som standard er FastTrack deaktiveret, og trykknappen på front- eller bagpanelet fungerer som en WPS-knap (Wi-Fi Protected Setup). (Hvis din trådløse router ikke har en fysisk WPS-knappen, skal du gå til fanen FastTrack på enheden for at konfigurere den.) Du kan aktivere FastTrack, ved at vælge dette afkrydsningsfelt. <B>Båndbredde forbeholdt betroet IP-adresse</B> Angiv, hvor stor en procentdel af båndbredden på den trådløse router, der skal reserveres, når du opretter forbindelse fra en betroet IP-adresse. Dette forhindrer andre i at opbruge din båndbredde. Når du opretter forbindelse til routeren fra den betroede IP-adresse, har du garanteret båndbredde til streamede videoprogrammer. Der er fire muligheder: 50 %, 60 %, 70 % og 80 %. <B>Trykknap:</B> Du kan indstille trykknappen på frontpanelet til at fungere på to forskellige måder: WPS (standard) eller FastTrack. Vælg alternativknappen for den ønskede valgmulighed.",
