"ASMH01" : "<P><font size=4><B>Hjælp til SmartZone</B></font></P><p>SmartZone er en navnebeskyttet Netgear-funktion, som dynamisk forbedrer oplevelsen med dine trådløse enheders forbindelse i miljøer med en eller flere trådløse Netgear-routere og -udvidere. Den leverer tjenester for dynamisk at finde bedre adgangspunkter, når dine trådløse enheder opretter forbindelse til SmartZone-netværk.</p><p>Når SmartZone er aktiveret, kan det registrere enheder i nærheden, og samle dem i et Smart Zone-netværk, hvis de bruger samme indstillinger for trådløs SSID, sikkerhedstype og adgangskode.</p><br><P><font size=4><B>Aktiver SmartZone</B></font></p><p>Når SmartZone er aktiveret, vil enheden registrere og samarbejde med en eller flere andre SmartZone-enheder.</p><br><P><font size=4><B>Roaming-følsomhed</B></font></p><p>Denne indstilling definerer, hvor aggressivt SmartZone dynamisk finder et bedre adgangspunkt til dine trådløse enheder.</p><br><p><font size=4>",
"ASMH02" : "<P><font size=4><B>Hjælp til SmartZone</B></font></P><p>SmartZone er en navnebeskyttet Netgear-funktion, som dynamisk forbedrer oplevelsen med dine trådløse enheders forbindelse i miljøer med en eller flere trådløse Netgear-routere og -udvidere. Den leverer tjenester for dynamisk at finde bedre adgangspunkter, når dine trådløse enheder opretter forbindelse til SmartZone-netværk.</p><p>Når SmartZone er aktiveret, kan det registrere enheder i nærheden, og samle dem i et Smart Zone-netværk, hvis de bruger samme indstillinger for trådløs SSID, sikkerhedstype og adgangskode.</p><br><p><font size=4><B>Kort over trådløs topologi</B></font></P><p>Kortet viser alle trådløse enheder i SmartZone-netværket herunder router, udvider og dine enheder. Du kan klikke på enhver node, som vises på kortet for at få vist detaljerede oplysninger.</p><p>Hvis du opretter adgang til denne webside fra en trådløse enhed, er den enhed, du bruger, fremhævet med gult på kortet.</p><br><p><font size=4><B>Ændr</B></font></P><p>Ændr værtsnavnet for SmartZone-enheden.</p><br><p><font size=4><B>Switch</B></font></P><p>Skift udviderens uplink-adgangspunkt.</p><br><p><font size=4><B>Opret forbindelse</B></font></P><p>Tving den trådløse station til at oprette forbindelse til et andet adgangspunkt</p><br>",
