"LEDS009" : "<p><font size=4><B>Hjælp til Indikator for Indstillinger til kontrol</B></font></p><HR><p>Siden Indikator for indstillinger til kontrol lader dig deaktivere eller aktivere blink til internetindikator, LAN-indikator, trådløs indikator og indikatorer til lagringsgrænseflade, når datatrafik er registreret. Desuden kan du vælge at slukke Sluk alle indikatorer undtagen strømindikatoren.</p>",
