"RAEM12" : "<a tabindex=-1 href=&quot;javascript:loadhelp(&apos;_rae_router&apos;,&apos;mode&apos;)&quot;><b>Router-tilstand:</b></a>Denne tilstand giver dig mulighed for at drage fordel af NETGEAR-routerfunktioner. NETGEAR-routeren er konfigureret som en normal WiFi-router bag din eksisterende router eller gateway. Denne tilstand kræver, at alle enheder er tilsluttet til den nye NETGEAR-router og ikke til din eksisterende gateway.",
"RAEM13" : "<a tabindex=-1 href=&quot;javascript:loadhelp(&apos;_rae_extender&apos;,&apos;ext_mode&apos;)&quot;><b>Udvider-tilstand:</b></a> NETGEAR-routeren vil udvide rækkevidden. Denne tilstand giver dig mulighed for at udvide rækkevidden af dit eksisterende WiFi-netværk",
"RAEM14" : "Vælg et eksisterende netværk, som du vil udvide. Du kan udvide 2,4G-båndbredden, 5G-båndbredden eller dem begge.",
"RAEM15" : "Klientenheden kan oprette forbindelse til SSID&apos;et nedenfor.",
"RAEM16" : "Ethernet-porte til WiFi bruger nedenstående båndbredde",
"RAEM17" : "<A tabindex=-1 href=&quot;javascript:loadhelp(&apos;_rae_ap&apos;,&apos;ip_tag&apos;)&quot;><b>AP-tilstand:</b></a>NETGEAR-routeren vil fungere som et trådløst adgangspunkt. Denne tilstand er velegnet til nem konfiguration, hvis enhederne allerede er tilsluttet til din eksisterende router eller gateway, eller hvis du bare vil bruge denne nye NETGEAR-router til at udvide din WiFi-dækning. Visse routerfunktioner er ikke tilgængelige i AP-tilstand.",
"RAEM18" : "<p>Hvis du vil udvide din WiFi-dækning, kan du også konfigurere routeren til udvider-tilstand for rækkevidde. WiFi-udvideren øger rækkevidden af det trådløse netværk til at dække områder uden for dit nuværende WiFi-netværk. For at konfigurere denne tilstand skal du oprette forbindelse fra din NETGEAR-router til den eksisterende routers/gateways SSID. NETGEAR anbefaler, at du kun opretter forbindelse til udviderens trådløse netværk, når en pc eller trådløs enhed befinder sig i et &quot;dødt&quot; område, hvor netværksforbindelsen til din eksisterende router er dårlig eller ikke-eksisterende. Dette er fordi, datatrafik, der bliver ført gennem udviderens trådløse netværk, er langsommere end trafik, der kommer direkte fra det oprindelige trådløse routernetværk.</p><p>I denne tilstand tildeles den nye routers IP-adresse som standard dynamisk af din gateway og vil næppe være 192.168.1.1. Du kan imidlertid stadig bruge URL http://www.routerlogin.net til at få adgang til routerens administrationsbrugerflade fra en enhed, der er tilsluttet til routeren. Visse routerfunktioner er ikke tilgængelige i denne tilstand, og du skal bruge router-tilstand, hvis du vil bruge disse funktioner</p>",
"RAEM19" : "Brug din trådløse profiladministratorsoftware (Windows, NETGEAR Adapter Wizard, osv.) til at genoprette forbindelse til udviderens netværk ved hjælp af de oplysninger, der vises nedenfor.",
"RAEM20" : "For at sikre levering af optimal trådløs ydeevne til dine enheder, anbefaler NETGEAR, at du opbevarer et unikt SSID til udviderens netværk, og at du kun opretter forbindelse til udviderens netværk, når det eksisterende netværk ikke levere nok dækning",
"RAEM21" : "kopier adgangskode",
