"RAEH1" : "<p><font size=4><b>Hjælp til router-tilstand</b></font></p><a name=mode></a><p><b>Router-tilstand: </b>Denne tilstand giver dig mulighed for at drage fordel af NETGEAR-routerfunktioner. NETGEAR-routeren er konfigureret som en normal WiFi-router bag din eksisterende router eller gateway. Denne tilstand kræver, at alle enheder har forbindelse til den nye NETGEAR-router og ikke til din eksisterende gateway.</p><p><b>Routerfunktioner</b></p><p>Følgende routerfunktioner er ikke tilgængelige, hvis du vælger AP- eller udvider-tilstand:</p><ul><li>Gæstenetværk</li><li>Forældrekontrol</li><li>QoS</li><li>Adgangskontrol</li><li>Trafikmåler</li><li>Bloker sider</li><li>Bloker sider</li><li>Bloker tjenester</li><li>Statisk rute</li></ul><a name=inet></a><p><b>Internetindstillinger: </b>Link til siden AVANCERET -> Konfiguration -> Konfiguration af internet. Brug denne side til at ændre routerens nuværende internetindstillinger.</p><a name=wifi></a><p><b>Trådløse indstillinger: </b>Link til siden AVANCERET -> Konfiguration -> Konfiguration af trådløs forbindelse. Brug denne side til at ændre routerens nuværende trådløse indstillinger.</p>",
"RAEH2" : "<p><font size=4><b>Hjælp til AP-tilstand</b></font></p><a name=ip_tag></a><p><b>AP-tilstand</b>: Gør enheden i stand til at fungere som et selvstændigt, trådløst adgangspunkt på dit eksisterende netværk. Denne tilstand er velegnet til nem konfiguration, hvis enhederne allerede er tilsluttet til din eksisterende router eller gateway, eller hvis du bare vil bruge denne nye NETGEAR-router til at udvide din WiFi-dækning. Visse routerfunktioner er ikke tilgængelige i adgangspunkttilstand.</p><p><b>Routerfunktioner</b></p><p>Følgende routerfunktioner er ikke tilgængelige, hvis du vælger AP- eller udvider-tilstand:</p><ul><li>Gæstenetværk</li><li>Forældrekontrol</li><li>QoS</li><li>Adgangskontrol</li><li>Trafikmåler</li><li>Bloker sider</li><li>Bloker sider</li><li>Bloker tjenester</li><li>Statisk rute</li></ul><a name=mac_tag></a><p><b>Hent dynamisk fra eksisterende router</b></p><p>Enheden finder automatisk en IP-adresse fra DHCP-serveren</p><a name=name_tag></a><p><b>Brug af fast IP-adresse</b></p><p>Brug denne indstilling, hvis du manuelt vil konfigurere IP-adressen, undernetmasken, gatewayens IP-adresse og DNS-serverens IP-adresse.</p><a name=priority_tag></a><p><b>Trådløse indstillinger: </b>Link til siden AVANCERET -> Konfiguration -> Konfiguration af trådløs forbindelse. Brug denne side til at ændre adgangspunktets nuværende trådløse indstillinger.</p>",
"RAEH3" : "<p><font size=4><b>Hjælp til udvider-tilstand</b></font></p><a name=ext_mode></a><p><b>Udvider-tilstand</b>: WiFi-rækkeviddeudvideren øger rækkevidden af det trådløse netværk til at dække områder uden for dit nuværende WiFi-netværk. NETGEAR anbefaler, at du kun opretter forbindelse til udviderens trådløse netværk, når en pc eller trådløs enhed befinder sig i et &quot;dødt&quot; område, hvor netværksforbindelsen til din eksisterende router er dårlig eller ikke-eksisterende. Dette er fordi, datatrafik, der bliver ført gennem udviderens trådløse netværk, er langsommere end trafik, der kommer direkte fra det oprindelige trådløse routernetværk. </p><p>Hvis du ikke kan oprette forbindelse fra din trådløse enhed til udvideren, skal du flytte udvideren til et andet sted midt mellem enheden og routeren. Hvis du efter at have prøvet flere placeringer ikke kan oprette forbindelse til udvideren, skal du flytte udvideren nærmere til enheden.</p><a name=dyn></a><p><b>Hent dynamisk fra eksisterende router</b></p><p>Enheden finder automatisk en IP-adresse fra DHCP-serveren</p><a name=fix></a><p><b>Brug af fast IP-adresse</b></p><p>Brug denne indstilling, hvis du manuelt vil konfigurere IP-adressen, undernetmasken, gatewayens IP-adresse og DNS-serverens IP-adresse.</p><a name=uplink></a><p><b>Uplink</b></p><p>2,4G/5G: Brug fanebladene til at skifte mellem 2,4G-uplink-indstillinger og 5G-uplink-indstillinger. Vælg en båndbredde, og vælg derefter din eksisterende routers/gateways SSID. Et pop op-vindue viser SSID og sikkerhedsindstillingen. Angiv adgangskoden for at oprette forbindelse. Du kan bruge rullepanelet til at flytte listen op og ned. Hvis du ikke kan se den eksisterende routers/gateways SSID på listen, skal du klikke på &quot;Andet&quot;, indtaste SSID, vælge sikkerhedsindstillingen på rullelisten og indtaste adgangskoden. Den tilknyttede båndbredde vil vise et flueben på fanen.</p><a name=wireless></a><p><b>Trådløse indstillinger: </b>Link til siden AVANCERET -> Konfiguration -> Konfiguration af trådløs forbindelse. Brug denne side til at ændre adgangspunktets nuværende trådløse indstillinger.</p><a name=ethport></a><p><b>Ethernet-porte til WiFi bruger nedenstående båndbredde</b></p><p>Vælg, hvilke WiFi-båndbredder du vil forbinde Ethernet-portene med. Sørg for, at du opretter forbindelse med den WiFi-båndbredde, du har konfigureret uplink-forbindelsen til.</p><p><b>Uplink-forbindelse mislykkedes</b></p><p>Hvis din forbindelse til basisadgangspunktet mislykkedes, angivet på den grafiske brugergrænseflade, skal du kontrollere følgende punkter:</p><p>  Kontroller, om du har indtastet den korrekte adgangskode til uplink-SSID.</p><p>  Prøv at flytte udvideren tættere på basisadgangspunktet eller til en position med en bedre sigtelinje.</p><p>  Hvis du har ACL (Access Control List) aktiveret i dit basisadgangspunkt, skal du sørge for, at du har føjet nedenstående MAC-adresse til routerens ACL (Access Control List).</p><ul><li>Udviderens MAC-adresse er: XXXXX</li><li>Din trådløse klientadapters MAC-adresse er: XXXXX</li></ul>",
