"DNH1" : "<p><font size=4><b>Hjælp til enhedsnavn</b></font></p><p><b>Enhedsnavn: </b>Enhedsnavnet identificerer denne router. Det anvendes i klientenheder, der har forbindelse til routeren, så de kan registrere enheden. </p><p>Det skal starte med et bogstav og må kun indeholde bogstaver, tal, symbolerne ‘-‘ og ‘_’, [a-ZA-Z] + [a-ZA-Z0-9 \-\_]. Maks. længde er 16 tegn</p>",
