"PLC016" : "<P><font size=4><B>Hjælp til DST-indstillinger</B></font></P><p><font size=3><B>DST-routerens navn</B></font></p><p>Dette er et mnemoteknisk eller meningsfyldt navn, som brugerne anvender til at identificere denne DST-enhed. Dette navn kan bestå af op til 12 tegn. Enhedens standardnavn er enhedens modelnavn. Du kan redigere dette tekstfelt og derefter anvende enhedsnavnet ved at klikke på knappen &quot;Anvend&quot;.</p><p><font size=3><B>Indstillinger for DST-routerens krypteringsnøgle</B></font></p><p>Brugeren kan vælge den ønskede DST-krypteringsnøgle på to forskellige måder.<br><br><b>Brug aktuel krypteringsnøgle:</b> Når brugeren vælger denne indstilling, vises den aktuelle krypteringsnøgle automatisk i feltet. Dette felt kan ikke redigeres. Hvis kunden ikke har ændret nøglen endnu, vises den forudindstillede standardkrypteringsnøgle her. Standardkrypteringsnøglen er HomePlugAV. Hver gang brugeren logger ind på siden DST-indstillinger eller opdaterer denne side, vælges denne indstilling.<br><br><b>Opret en ny krypteringsnøgle:</b> Brugeren kan angive sin egen netværkskrypteringsnøgle i feltet. Denne krypteringsnøgle må maksimalt bestå af 64 tegn.</p><p><font size=3><B>Konfigurer indstillinger for DST-fjernenhed:</B></font></p><p>Her er en tabel, som brugeren kan anvende til at få oplysninger om hver enkelt DST-enhed, der er blevet registreret. <br><B>Enhedsnavn:</B> Denne tabel viser de DST-enheder, der er registreret på DST-netværket. Brugeren kan give det pågældende enhedsnavn en beskrivelse, f.eks. kontor eller køkken. Dette navn kan bestå af op til 12 tegn<br><B>Modelnavn:</B> Dette navn angiver DST-adapterens modelnummer.<br><B>MAC-adresse:</B> DST-enhedens MAC-adresse. Den er også angivet på produktetiketten, som muligvis ikke er synlig, når enheden er tilsluttet.<br><B>Statusindikator:</B> Viser statusindikatoren for DST-fjernenheden. Brugeren kan konfigurere statusindikatoren for DST-fjernenheden ved at vælge enten &quot;TIL&quot; eller &quot;FRA&quot;.<br><B>Krypteringsnøgle:</B> Når indstillingen <I>Brug standardkrypteringsnøgle</I> er valgt, er denne indstilling ikke tilgængelig og ikke markeret. Når indstillingen &quot;Opret ny krypteringsnøgle&quot; er valgt, er denne indstilling TILGÆNGELIG, og brugeren kan markere eller fjerne markeringen af denne indstilling. Hvis indstillingen er markeret, bruger DST-fjernenheden den samme krypteringsnøgle som den lokale DST-enhed.<br></p><p><font size=3><B>Indikator-status</B></font></p><p>Brugeren kan slå DST-statusindikatoren til eller fra. Standardværdien er TIL.</p>",
"PLC017" : "<P><font size=4><B>Hjælp til DST-status</B></font></P><p><font size=3><B>DST-firmwareversion</B></font></p><p>Viser den lokale DST-enheds firmwareversion.</p><p><font size=3><B>DST-forbindelsesstatus</B></font></p><p>Viser forbindelsesstatus for den lokale DST-enhed.</p><p><font size=3><B>Status for ekstern DST-adapter</B></font></p><p>Viser den lokale DST-enheds firmwareversion. <br><B>Enhedsnavn:</B> Viser navnet på den eksterne DST-adapter, som er registreret på DST-netværket.<br><B>Modelnavn:</B> Dette navn angiver DST-adapterens modelnummer.<br><B>Overførselshastighed (mbps):</B> Den hastighed, hvormed enheden sender data.<br><B>Modtagelseshastighed (mbps):</B> Den hastighed, hvormed enheden modtager data.<br><B>MAC-adresse:</B> Den eksterne DST-adapters MAC-adresse. Den er også angivet på produktetiketten, som muligvis ikke er synlig, når enheden er tilsluttet.<br><B>IP-adresse:</B> Den eksterne DST-adapters IP-adresse. <br><B>Firmwareversion:</B> Den eksterne DST-adapters firmwareversion.<br><B>Statusindikator:</B> Statusindikatoren for den eksterne DST-adapter.<br></p>",
