"PLC051" : "<p><font size=&quot;4&quot;><b>Hjælp til DST-indstillinger</b></font></p><p><font size=&quot;3&quot;><b>DST-routerens navn</b></font></p><p>Dette er et mnemoteknisk eller meningsfyldt navn, som brugerne anvender til at identificere denne DST-enhed. Dette navn kan bestå af op til 12 tegn. Enhedens standardnavn er enhedens modelnavn. Du kan redigere dette tekstfelt og derefter anvende enhedsnavnet, når du har klikke på knappen &quot;Anvend&quot;.</p><p><font size=&quot;3&quot;><b>Indstillinger for DST-routerens krypteringsnøgle</b></font></p><p>Brugeren kan vælge den ønskede DST-krypteringsnøgle på tre forskellige måder.<br><br><b>Ingen ændring til krypteringsnøglen:</b> dette er standardindstillingen, når brugeren ser denne nøgleindstilling. Der er ikke behov for at vise oplysninger for denne funktion. Hvis brugeren stadig vælger denne indstilling, når brugeren klikker på knappen &quot;Anvend&quot;, behøver vi ikke at ændre nøglen eller anvende den samme nøgle igen. Hvilket betyder, at DST -netværket ikke vil blive afbrudt.<br><br><b>Brug standardkrypteringsnøglen:</b> Når brugeren vælger denne indstilling, vises krypteringsnøglens standardindstilling automatisk i feltet. Krypteringsnøglens standardnetværket er <b>HomePlugAV</b>. Når brugeren klikker på knappen &quot;Anvend&quot;, anvendes denne krypteringsnøgles standardnetværk på denne enhed.<br><br><b>Opret ny krypteringsnøgle:</b> Brugeren kan angive sin egen netværkskrypteringsnøgle i feltet. Denne krypteringsnøgle må maksimalt bestå af 64 tegn.</p><p><font size=&quot;3&quot;><b>Konfigurer indstillinger for ekstern DST-enhed:</b></font></p><p>Her er en tabel, som brugeren kan anvende til at få oplysninger om hver enkelt DST-enhed, der er blevet registreret. <br><b>Enhedsnavn:</b> Denne tabel viser de DST-enheder, der er registreret på DST-netværket. Brugeren kan give det pågældende enhedsnavn en beskrivelse, f.eks. kontor eller køkken. Dette navn kan være på op til 12 tegn<br><b>Modelnavn:</b> Dette navn angiver DST-adapterens modelnummer.<br><b>MAC-adresse:</b> DST-enhedens MAC-adresse. Det er også angivet på produktetiketten, der måske ikke ses, når enheden er tilsluttet.<br><b>Nøgletype:</b> Viser nøgletype for ekstern DST -enhed. Der er kun to typer, den ene er &quot;Offentlig&quot; og den anden er &quot;Privat&quot;. <br><b>Krypteringsnøgle:</b> Når indstillingen<i> Brug standardkrypteringsnøgle</i> er valgt, er denne indstilling ikke tilgængelig og ikke markeret. Når indstillingen &quot;Opret ny krypteringsnøgle&quot; er valgt, er denne indstilling TILGÆNGELIG, og brugeren kan markere eller fjerne markeringen af denne indstilling. Hvis indstillingen er markeret, bruger DST-enheden den samme krypteringsnøgle som lokal DST-enhed.<br><b>LED-status:</b> Viser statusindikatoren for DST-fjernenheden. Brugeren kan konfigurere statusindikatoren for ekstern DST-enhed ved at vælge enten &quot;TIL&quot; eller &quot;FRA&quot;.<br></p>",
