"PLC069" : "<P><font size=4><B>Hjælp til DST-indstillinger</B></font></P><p><font size=3><B>DST-routerens navn</B></font></p><p>Dette er et mnemoteknisk eller meningsfyldt navn, som brugerne anvender til at identificere denne DST-enhed. Dette navn kan bestå af op til 12 tegn. Enhedens standardnavn er enhedens modelnavn. Du kan redigere dette tekstfelt og derefter anvende enhedsnavnet, når du har klikke på knappen &quot;Anvend&quot;.</p><p><font size=3><B>Indstillinger for DST-routerens krypteringsnøgle</B></font></p><p>Brugeren kan vælge den ønskede DST-krypteringsnøgle på tre forskellige måder.<br><br><b>Ingen ændring til krypteringsnøglen:</b> Dette er standardindstillingen, når brugeren ser denne side for nøgleindstillingen. Der er ikke behov for at vise oplysninger for denne funktion. Hvis brugeren stadig vælger denne indstilling, når brugeren klikker på knappen &quot;Anvend&quot;, behøver vi ikke ændre nøglen eller anvende den samme nøgle igen. Hvilket betyder, at DST-netværket ikke vil blive afbrudt.<br><br><b>Brug standard krypteringsnøgle:</b> Når brugeren vælger denne indstilling, vises standard krypteringsnøglen automatisk i feltet. Krypteringsnøglens standardnetværket er <i>HomePlugAV</i>. Når brugeren klikker på knappen &quot;Anvend&quot;, anvendes denne standard netværkskrypteringsnøgle på enheden.<br><br><b>Opret ny krypteringsnøgle:</b> Brugeren kan angive sin egen netværkskrypteringsnøgle i feltet. Denne krypteringsnøgle må maksimalt bestå af 64 tegn.</p><p><font size=3><B>Konfigurer indstillinger for ekstern DST-enhed:</B></font></p><p>Her er en tabel, som brugeren kan anvende til at få oplysninger om hver enkelt DST-enhed, der er blevet registreret. <br><B>Enhedsnavn:</B> Denne tabel viser de DST-enheder, der er registreret på DST-netværket. Brugeren kan give det pågældende enhedsnavn en beskrivelse, f.eks. kontor eller køkken. Dette navn kan bestå af op til 12 tegn<br><B>Modelnavn:</B> Dette navn angiver DST-adapterens modelnummer.<br><B>MAC-adresse:</B> DST-enhedens MAC-adresse. Den er også angivet på produktetiketten, som muligvis ikke er synlig, når enheden er tilsluttet.<br><B>Nøgletype: </B>Nøgletypen til DST-fjernenhed. Der er kun to typer, den ene er &quot;Offentlig&quot; og den anden er &quot;Privat&quot;. Hvis den aktuelle nøgle er <i>HomePlugAV</i>, viser nøgletypen &quot;Offentlig&quot;, hvis ikke viser den &quot;Privat&quot;.<br><B>Krypteringsnøgle:</B> Når indstillingen <I>Brug standardkrypteringsnøgle</I> er valgt, er denne indstilling ikke tilgængelig og ikke markeret. Når indstillingen &quot;Opret ny krypteringsnøgle&quot; er valgt, er indstillingen TILGÆNGELIG, og brugeren kan markere eller fjerne markeringen af indstillingen. Hvis indstillingen er markeret, bruger DST-fjernenheden den samme krypteringsnøgle som den lokale DST-enhed.<br><B>Statusindikator:</B> Viser statusindikatoren for DST-fjernenheden. Brugeren kan konfigurere statusindikatoren for ekstern DST-enhed ved at vælge enten &quot;TIL&quot; eller &quot;FRA&quot;.<br></p>",
