"EAggr_help001" : "<P><font size=4><B>Ethernet-portaggregering</B></font></P><p>Ethernet-portaggregering lader routeren kombinere Ethernet-port 1 og 2 til dataoverførsel til en understøttende enhed, f.eks. en NAS. Bemærk, at Ethernet-portaggregering også kaldes linkaggregering, teamport og portfordelingssystem.</p><p name=agg_setup id=agg_setup></p><p><b>Konfiguration af omgivelser</b><p><ol><li>Slut en enhed, der understøtter Ethernet-portaggregering, som f.eks. en NAS eller netværksswitch, til Ethernet-port 1 og 2 på routeren med Ethernet-kabler.</li><li>Konfigurer Ethernet-portaggregering på enheden, der er tilsluttet Ethernet-port 1 og 2 på routeren.</li> Du kan få flere oplysninger om, hvordan du konfigurerer Ethernet-portaggregering på din enhed, i dokumentationen, som fulgte med din enhed.<br></ol><p name=agg_config id=agg_config></p><p><b>Konfiguration af router</b><p><ul><li>Deaktiver. Deaktiverer funktionen Ethernet-portaggregering på routeren. Ethernet-port 1 og 2 kan bruges som uafhængige Ethernet-porte.<li>Dynamisk (IEEE 802.3ad). Routeren kommunikerer med enheden, der er tilsluttet Ethernet-port 1 og 2 på routeren, og kontrollerer, om funktionaliteten Ethernet-portaggregering understøttes på enheden. <br>Hvis funktionaliteten Ethernet-portaggregering understøttes, fordeler routeren automatisk Ethernet-port 1 og 2. Hvis ikke, fungerer Ethernet-port 1 og 2 som uafhængige Ethernet-porte. </ul><p name=agg_status id=agg_status></p><p><b>Status for Ethernet-portaggregering</b><p><ul><li>Inaktiv. En Ethernet-portaggregeringsenhed er ikke sluttet til Ethernet-port 1 og 2 på routeren.<li>Aktiv. En Ethernet-portaggregeringsenhed er sluttet til Ethernet-port 1 og 2 på routeren. </ul>",
"EAggr_help002" : "<P><font size=4><B>Ethernet-portaggregering</B></font></P><p>Ethernet-portaggregering lader routeren kombinere Ethernet-port 1 og 2 til dataoverførsel til en understøttende enhed, f.eks. en NAS. Bemærk, at Ethernet-portaggregering også kaldes linkaggregering, teamport og portfordelingssystem.</p><p name=agg_setup id=agg_setup></p><p><b>Konfiguration af omgivelser</b><p><ol><li>Forbind en enhed, der understøtter IEEE-802.3ad LACP, som f.eks. en NAS eller netværksswitch, til Ethernet-port 1 og 2 på routeren med Ethernet-kabler.</li><li>Konfigurer Ethernet-portaggregering på enheden, der er tilsluttet Ethernet-port 1 og 2 på routeren</li> <li>Hvis du forbinder port 1 og 2 til en Ethernet-switch, skal du sørge for, at den understøtter 802.3ad LACP, og konfigureret switch korrekt før tilslutning til routeren med to Ethernet-kabler.</li><li>Du må ikke tilslutte den ikke-administreret switch til port 1 og port 2, da det vil lukke dit netværk ned på grund af udsendelsesløkker.</li><br>For yderligere oplysninger om, hvordan du konfigurerer Ethernet-portaggregering på din enhed, skal du se dokumentationen, der fulgte med enheden.<br><br>Tip: For at få den hurtigste ydeevne med portaggregering, skal du til kablede forbindelser bruge Ethernet-port 3 til den første computer, og Ethernet-port 4, 5 eller 6 til den anden, hvilket giver mulighed for hastigheder på op til 2 Gbps med portaggregering. Den maksimale hastighed mellem port 4, 5 og 6 er begrænset til 1 Gbps.<br></ol><p name=agg_config id=agg_config></p><p><b>Konfiguration af router</b><p><ol><li>Deaktiver: Router deaktiverer funktionen Ethernet-portaggregering. LAN-port 1 og 2 fungerer.<li>Aktiver (LACP- IEEE 802.3ad): Routeren vil kommunikere med enheder, som er tilsluttet på LAN-port 1 og 2, og kontrollere om den har funktionalitet til linkaggregering. <br>Hvis ja, fordeler routeren automatisk LAN-port 1 og 2. Hvis ikke, fungerer LAN-port 1 og 2 som normale LAN-porte.</ol><p name=agg_status id=agg_status></p><p><b>Status for Ethernet-portaggregering</b><p><ol><li>Inaktiv: Ingen linkaggregeringsenhed tilsluttet på LAN-port 1 og 2.<li>Aktiv: Der er en linkaggregeringsenhed tilsluttet på LAN-port 1 og 2.</ol>",
