"plex_026" : "<p><font size=4><b>Hjælp til Plex-medieserver</b></font></p><a name=ip_tag></a><p>Plex-medieserver administrerer musik, videoer og fotos, der er gemt på et lokalt tilsluttet USB-lagerdrev, og streamer disse mediefiler til dine enheder, såsom computere, mobiltelefoner og tablets.</p><p>Disse enheder kan sluttes til routeren med fjernadgang eller lokalt. For at oprette en lokal forbindelse til din router skal du bruge en kabelforbundet Ethernet-forbindelse eller en Wi-Fi-forbindelse.</p><p>Plex-medieserver er aktiveret som standard. Du kan dog deaktivere den, hvis du ikke vil bruge den.</p><p>Hvis Plex registrerer, at der ikke er sluttet et USB-lagerdrev til routeren, er Plex ikke tilgængelig, før der tilsluttes et drev.</p><p>Hvis der er tilsluttet flere USB-lagerdrev, kan du tilknytte et USB-drev, som Plex-medieserveren kan bruge til at gemme og opbevare mediefiler og disses tilhørende metadatafiler på.</p><p>Routeren kontrollerer jævnligt, om der er nye opdateringer til den binære Plex-version, når nye funktioner eller fejlrettelser bliver tilgængelige. Hvis der findes en ny version, skal du logge på routeren og manuelt opdatere PLEX-medieserveren til den nye version.</p><p>Hvis du aktiverer automatisk opdatering, foretager routeren automatisk en opdatering kl. 03:00, når en ny binær version er tilgængelig. Det betyder, at du vil opleve færre forstyrrelser, mens du streamer medier på andre tidspunkter.</p><p>Bemærk, at PLEX-medieserveren genstarter efter den nye versionsopdatering, eller hvis USB-lagerdrevet er blevet udskiftet.</p><p>Din router understøtter et NAS-baseret, lokalt netværksdrev, der benytter Samba-protokollen til PLEX-mediebiblioteker. Følg routerens GUI for at tilføje en netværksforbindelse. Forbindelsen vises på siden PLEX-medieserver. Anmod din lokale producent af netværksdrev om anvisninger til deling af en mappe på andre netværksenheder.</p><p>Du skal bruge en USB 3.0-lagerenhed til PLEX-metadata og -konfigurationsfiler. USB-lagerenheden skal have mindst 5 GB ledig plads.</p>",
