"ACB_113" : "Router-/AP-tilstand",
"ACBH_001" : "<p><font size=4><B>Hjælp til Cloud Backup</B></font></p><p><B>Nye brugere kan tilmelde sig her gratis i 6 måneder:</B> Hvis du ikke har Amazon Drive Cloud-konti, kan du få 6 måneders gratis konti ved at klikke på linket og følge trinnene på vores GUI-side til Amazon Drive Cloud.</p><p><B>Eksisterende brugere kan logge ind her:</B> Hvis du allerede har Amazon Drive Cloud-konti, skal du klikke på dette link for at logge ind på din konto.</p>",
"ACBH_002" : "<p><font size=4><B>Hjælp til Cloud Backup</B></font></p><p><B>Log ind eller tilmeld dig her:</B> Hvis du allerede har Amazon Drive Cloud-konti, skal du klikke på dette link for at logge ind på din konto, eller tilmelde dig her.</p>",
"ACBH_003" : "<p><font size=4><B>Hjælp til Cloud Backup</B></font></p><p><B>Knappen Anvend:</B> Klik på knappen Anvend for at gemme eventuelle ændringer på denne side.</p><p><B>Knappen Annuller:</B> Klik på knappen Annuller for at vende tilbage til de tidligere indstillinger.</p><p><B>Knappen Skift konto:</B> Klik på knappen Skift konto for at logge ud af din nuværende konto og vende tilbage til login-siden.</p><p><b>Din Amazon Drive Cloud-konto er:</B> Denne sektion viser dit kontonavn.</p><p><B>Konfigurer e-mailmeddelelser:</B> Klik på dette link for at administrere dine e-mailmeddelelser.</p> <p><B>USB-status: Tilsluttet | USB-status: Frakoblet:</B> USB-status viser USB-enhedens aktuelle forbindelsesstatus.</p><p><B>Vælg mappe, der skal sikkerhedskopieres:</B> Vælg en mappe på USB-enheden, som du vil sikkerhedskopiere til skyen.</p><p><B>Skift mappe, der skal sikkerhedskopieres:</B> Når du har valgt en mappe, kan du klikke på linket Skift mappe for at skifte mappen.</p><p><B>Knappen Sikkerhedskopier nu:</B> Klik på knappen Sikkerhedskopier nu for at sikkerhedskopiere med det samme.</p><p><B>Vælg tidsplan for sikkerhedskopiering:</B></p><ul><li><B>Synkronisering i realtid:</B> Standardtidsplanen for sikkerhedskopiering er synkronisering i realtid, hvilket betyder, at når data på USB-enheden ændres, sikkerhedskopieres de til skyen i realtid.</li><li><B>Sikkerhedskopier efter tidsplan:</B> Sikkerhedskopier efter tidsplan betyder, at du kan vælge den dag og det tidspunkt, du vil sikkerhedskopiere dine data til skyen.</li></ul><p><b>Udført! Sikkerhedskopiering fuldført:</B> Denne meddelelse angiver, at det seneste sikkerhedskopieringsjob er fuldført.</p><p><B>Sikkerhedskopiering. Fejloplysninger >>:</B> Denne meddelelse angiver, at det seneste sikkerhedskopieringsjob mislykkedes. Klik på Fejloplysninger for at få flere oplysninger.</p>",
