"usb_dev_setting_h=" : "<h1 class=\&quot;helpfile\&quot;>Hjælp til indstillinger for USB-drev</h1> <p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>DGN2200 tillader fildeling, hvis en USB-harddisk eller flash-hukommelse er tilsluttet til USB-porten.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Se referencevejledningen for at få detaljerede konfigurationsoplysninger.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Du kan få adgang til USB-drevet via FTP vha. et FTP-værktøj eller ved at indtaste ftp://readyshare i en webbrowser som f.eks. Microsoft Internet Explorer eller Firefox. Den indtastede IP-adresse er routerens Web-IP-adresse, der kan findes i menuen Router Status (Status for router) som IP-adressen for internetporten. </span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Du kan få adgang til USB-drevet via Microsoft-netværksforbindelserne ved at klikke på Windows Start -&gt; Kør og indtaste \\readyshare . Den indtastede IP-adresse er routerens lokale IP-adresse, f.eks. 192.168.0.1. Alternativt kan du indtaste \\hostname i Windows Explorer. Det indtastede værtsnavn er det værtsnavn, der er angivet i afsnittet Network Access (Netværksadgang), f.eks. DGN2200.</span></p><hr><a name=\&quot;network access\&quot;> </a><h2>Network Access (Netværksadgang)</h2><p class=\&quot;MsoNormal\&quot;><B>Værtsnavn og Arbejdsgruppe </B></p><p class=\&quot;MsoNormal\&quot;> <span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Kombinationen Værtsnavn og arbejdsgruppe er det navn, der bruges til at identificere routeren i dit netværk. Du kan nemt få adgang til det tilsluttede USB-drev ved at indtaste \\hostname i Windows Explorer.</span></p><p class=\&quot;MsoNormal\&quot;> <B>FTP-port</B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> FTP-porten er TCP-portnummeret for den indbyggede FTP-server. Standardværdien er 21. </span></p><hr><a name=\&quot;ftp access\&quot;></a><p class=\&quot;MsoNormal\&quot;> <B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> FTP-adgang</span></B></p><p class=\&quot;MsoNormal\&quot;> <span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> FTP-konti kan oprettes ved at klikke på knappen Add (Tilføj). Disse FTP-konti gør det muligt for brugerne på LAN eller internettet at få adgang til filerne på det tilsluttede USB-drev.</span></p><p><B>Brug af knapperne Add (Tilføj), Edit (Rediger), Delete (Slet)</B> eller <B>Eject Disk (Fjern disk)</B><BR><BR>Klik på <B>Add </B>(Tilføj) for at tilføje en ny oplysning. Klik på <B>Edit</B> (Rediger) for at redigere de valgte oplysninger. Klik på <B>Delete </B>(Slet) for at slette de valgte oplysninger. Klik på <B>Eject Disk</B> (Fjern disk) for at fjerne USB-enheden.<BR></p><hr><a name=\&quot;attached device\&quot;></a><p class=\&quot;MsoNormal\&quot;> <B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> Tilknyttet enhed</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot;  style=\&quot;font-family:Arial\&quot;> Denne tabel viser partitionsoplysningerne for det tilsluttede USB-drev, herunder delingsnavn og filsystemtype. </span></p>",
