"usb_wiz_h=" : "<h1 class=\&quot;helpfile\&quot;>Smart Setup Wizard - Hjælp til USB-drev</h1> <p>DGN2200 tillader fildeling, hvis en USB-harddisk eller flash-hukommelse er tilsluttet til USB-porten. Se referencevejledningen for at få detaljerede konfigurationsoplysninger.</P><p>Så snart en USB-harddisk eller flash-hukommelse er tilsluttet til DGN2200 USB-porten, kan brugere på det lokale netværk få adgang til USB-drevet med ubegrænset læse- og skriveadgang.</P><p>Brugere fra det lokale netværk eller internettet kan også få adgang til USB-drevet vha. FTP-adgang. Smart Setup Wizard guider dig gennem FTP-konfigurationsprocessen.</P><P><a name=\&quot;folder\&quot;></a><b class=\&quot;helpfile\&quot;>Indtast navnet på den mappe, du vil dele</b><BR>Når brugeren får adgang til filer via FTP, er det denne rodmappe, der vises.</P><P><a name=\&quot;loginname\&quot;></a><b class=\&quot;helpfile\&quot;>Indtast det FTP-login-navn, der skal give adgang til denne mappe</b><BR>Indtast det FTP-login-kontonavn, som du ønsker skal give adgang til mappen.</P><P><a name=\&quot;password\&quot;></a><b class=\&quot;helpfile\&quot;>Indtast FTP-login-adgangskoden</b><BR>Indtast en adgangskode til FTP-login-kontoen.</P><p><a name=\&quot;rights\&quot;></a><b class=\&quot;helpfile\&quot;>Vælg FTP-adgangsrettigheder</b><BR>Hvis du vælger Kun læseadgang, får brugeren tilladelse til at hente datafiler vha. FTP. Hvis du vælger Læse- og skriveadgang, får brugeren tilladelse til at læse og skrive datafiler.</p><p><B>Bemærk:</B> Al FTP-adgang fra internettet giver kun rettigheder til Læseadgang, uanset hvilke kontorettigheder der er tildelt.</p><p><B>Brug af knapperne Continue (Fortsæt) eller Stop Wizard (Stop guiden)</B><BR>Klik på <B>Continue</B> (Fortsæt) for at komme videre til næste side. <BR>Klik på <B>Stop Wizard</B> (Stop guiden) for at stoppe guiden og komme til Indstillinger for USB-drev.>\&quot;max_reached=\&quot;Max amount reached\&quot;swiz_usb=\&quot;Smart Setup Wizard - USB Drive\&quot;stop_wiz=\&quot;Stop Wizard\&quot;continue=\&quot;Continue\&quot;enter_login=\&quot;Enter the login name of this folder\&quot;share_folder_list=\&quot;Sharing folders list\&quot;finish_mark=\&quot;Finish\&quot;dev_no_empty=\&quot;Device Name cannot be empty\&quot;vista_set=\&quot;Vista Settings\&quot;enable_bult=\&quot;Enable Built-in Registrar\&quot;allow_config_router=\&quot;Allow a Registrar to Configure This Router\&quot;VST_vista_h=\&quot;<h1>Hjælp til Vista Settings</h1></P><p><B>Enhedsnavn</B><BR>Dette er et fuldt navn på denne router. Du kan se routeren vist i netværket på Vista og Network Explorer er markeret med dette navn.</p><p><B>Aktiver Built-in Registrar (Indbygget registrering)</B><BR>Når Built-in Registrar er aktiveret, kan du bruge funktionen \&quot;Add Wireless Client\&quot; (Tilføj en trådløs klient) på denne side for at tilføje en trådløs klient til netværket via WPS-proceduren. I dette tilfælde behøver du ikke en Windows Vista-pc for at tilføje en trådløs klient.</p><p><B>Tillad registrator at konfigurere denne router</B><BR>Marker denne mulighed for at lade brugere konfigurere routeren via en Windows Vista-pc. Med en standardkonfiguration af router kan brugere konfigurere routeren via en Windows Vista-pc. Når først routeren er blevet konfigureret af en registrator, skal du imidlertid markere denne mulighed for at sætte en registrator i stand til at konfigurere routeren igen. Når den indbyggede registrering er aktiveret, bliver denne valgmulighed inaktiv.</p><p><B>Tilføj en trådløs klient </B><BR>Når den indbyggede registrering er aktiveret, kan du tilføje en trådløs klient i netværket ved først at klikke på denne knap. Derefter vises en dialogboks, der spørger efter klientens PIN. Klientens PIN bør være vist i klientens brugergrænseflade.</p>",
