"h_wlg_sec_profile=" : "<H1>Hjælp til Security Profile Settings (Sikkerhedsprofilindstillinger)</H1><P>Med denne router har du mulighed for at have flere trådløse netværk. Oplysninger om hvert trådløst netværk ligger i en sikkerhedsprofil. Oplysninger om hver sikkerhedsprofil vises. <UL><LI>Profilnavn <BR>Det aktuelle profilnavn vises. <LI>SSID <BR>Det aktuelle SSID, der er tilknyttet denne profil. <LI>Sikkerhed <BR>Det aktuelle sikkerhedssystem (f.eks. WPA-PSK) vises. <LI>Aktiver <BR>Brug dette afkrydsningsfelt til at aktivere eller deaktivere hver sikkerhedsprofil som ønsket. Klik på <B>Apply</B> (Anvend) for at gemme ændringerne. <LI>WMM <BR>Brug dette afkrydsningsfelt til at aktivere eller deaktivere meddelelse om WMM i hver sikkerhedsprofil. Klik på <B>Apply</B> (Anvend) for at gemme ændringerne. <LI>Udsend SSID <BR>Brug dette afkrydsningsfelt til at aktivere eller deaktivere SSID-udsendelse i hver sikkerhedsprofil. Klik på <B>Apply</B> (Anvend) for at gemme ændringerne. </UL></P><p><B>Knappen Edit (Rediger)</B><BR></P><p>Klik på denne knap for at ændre indstillingerne for den valgte profil. Brug alternativknapperne til venstre til at vælge den ønskede profil. </P>",
