"h_wds" : "<P><font size=4><B>Hjælp til Indstillinger for trådløse gentagende funktioner (Wireless Repeating Function Settings)</B></font></P> <a name=en_repeat></a> <p><b>Aktiver Trådløse Repeating (Enable Wireless Repeating)</b></p> <p>Aktiver dette, hvis du vil bruge enten Bridge-tilstand eller Repeater-tilstand, og vælg derefter den ønskede tilstand for dit miljø. </p><ul><p><li><a name=repeat></a><strong>Trådløse Repeater. </strong>  <p>I denne tilstand vil ",
"h_CF_log" : "<P><font size=4><B>Medtag i log</B></font></P><p>En logfil er en detaljeret registrering af de websteder, som brugerne på dit netværk har været inde på eller har forsøgt at komme ind på. Hvis du har konfigureret indholdsfiltrering i skærmbilledet Bloker websteder (Block Sites), viser skærmbilledet Logfiler (Logs), hvornår nogen på dit netværk har prøvet at få adgang til et blokeret websted. Hvis du har aktiveret e-mail-meddelelser, vil du modtage disse logfiler i en e-mail. Hvis du ikke har konfigureret e-mail-meddelelser, kan du få vist logfilerne her.</p><p><ul><li>Klik på <b>Ryd logfil</b> for at slette alle posterne i logfilen.</ul><p><ul><li>Klik på <b>Opdater</b> for at få vist de seneste adgangsforsøg.</ul><p><ul><li>Klik på <b>Send logfil</b> for at sende logfilen til din e-mail-konto. Denne funktion kan være meget nyttig, når du skal teste dine e-mail-indstillinger.</ul><a name=&quot;syslog&quot;></a><P><b>Syslog</b><p>Logfilerne kan sendes til en Syslog-server. Aktiver et af disse tre valg efter behov:<ul><li> Deaktiver - Vælg dette, hvis du ikke har en Syslog-server.<li> Udsend på LAN - Syslog-dataene udsendes i stedet for at blive sendt til en specifik Syslog-server. Brug dette valg, hvis Syslog-serveren ikke har en fast IP-adresse.<li> Send til denne Syslog-servers IP-adresse - Hvis Syslog-serveren har en fast IP-adresse, skal du markere dette valg og angive Syslog-serverens IP-adresse. </ul><p> </p>",
