"gui_lang_conflict_help" : "<h1>Kontroller Hjælp til sprog</h1><p>Sproget for brugergrænsefladen afviger fra browsersproget. Hvis du vil ændre sproget for brugergrænsefladen til browsersproget, skal du klikke på knappen <B>Ja</B>. Ellers skal du klikke på knappen <B>Nej</B>.</p>",
