"h_wlg_wireless2" : "<P><font size=4><B>Indstillinger for gæstenetværk </B></font></P><p><B>Dette gør det muligt for gæster at bruge internetadgangen i dit hjem, hvis du ikke ønsker, at de kender din trådløse sikkerhedsnøgle.</B></p><HR><A name=network></A><P><B>Netværksprofiler </B></P><p>Du kan klikke på alternativknappen for hver profil for at kontrollere detaljerede oplysninger eller ændre indstillinger for hver profil. Tabellen er en kort oversigt over, hvor mange profiler du kan oprette, med tilhørende profilnummer, SSID for profilen, profilens sikkerhedstype, om trådløst gæstenetværk er aktiveret eller ej og om SSID&apos;et vil blive vist eller ej.</p><A name=wireless></A><P><B>Trådløse indstillinger for profil</B></P><A name=enable_guest></A><p>Aktiver gæstenetværk </P><p>Hvis dette afkrydsningsfelt er markeret, er gæstenetværket aktiveret. Du og dine gæster kan oprette forbindelse til dit netværk via SSID&apos;et for denne profil. <A name=enable_ssid></A></P><p>Aktiver SSID-udsendelse </P><p>Når den er aktiveret, vil det trådløse access point udsende sit navn (SSID) til alle trådløse stationer. Stationer, som ikke har noget SSID (eller en værdi på \&quot;nul\&quot;) kan herefter bruge det korrekte SSID til forbindelser til dette adgangspunkt.<A name=allow_guest></A></P><p>Tillad gæster at få adgang til MIT lokale netværk </P><p>Hvis feltet ikke er markeret, kan brugere, der opretter forbindelse til dette SSID, kun få direkte adgang til internettet og andre klienter i det SSID-netværk. Ingen klienter i dette SSID har tilladelse til at få adgang til routerens brugergrænseflade, klienter på andre SSID&apos;er, Ethernet-netværk og enhver anden tjeneste fra denne trådløse router.<BR>Hvis feltet er markeret, har alle brugere, der opretter forbindelse til dette SSID, ikke kun adgang til internettet, men også til lokale netværk for denne trådløse router som brugere i primære SSID&apos;er.<A name=guest_ssid></A></P><p>Gæstenavn på trådløst netværk (SSID) </P><p>Angiv en værdi på op til 32 alfanumeriske tegn. Det samme navn (SSID) skal være tildelt alle trådløse enheder i dit netværk. Standard-SSID er NETGEAR_Guest<B>N</B>, N er profilnummeret, men NETGEAR anbefaler, at du ændrer dit netværks navn (SSID) til en anden værdi. Denne værdi kender også forskel på store og små bogstaver. F.eks. er <I>NETGEAR</I> ikke det samme som <I>NETGEAr</I>.</p><HR><A name=security></A><p><B>Sikkerhedsindstillinger</B></p><UL><LI>Ingen - ingen datakryptering<LI>WEP - Wired Equivalent Privacy, brug WEP 64- eller 128-bit datakryptering<BR><B>Bemærk:</B>   Funktionen Wi-Fi Protected Setup er deaktiveret, når sikkerhedsindstillingen er WEP med Shared-Key-godkendelse (Delt nøgle)<LI>WPA-PSK [TKIP] - Wi-Fi Protected Access med Pre-Shared Key (Forhåndsdelt nøgle), brug WPA-PSK-standardkryptering med TKIP-krypteringstypen<LI>WPA2-PSK [AES] - Wi-Fi Protected Access version 2 med Pre-Shared Key (Forhåndsdelt nøgle), brug WPA2-PSK-standardkryptering med krypteringstypen AES<LI>WPA-PSK [TKIP] + WPA2-PSK [AES] - Tillad klienter, der bruger enten WPA-PSK [TKIP] eller WPA2-PSK [AES]</LI></UL><p>For at opnå den bedste ydelse med 11N trådløse adaptere i robuste sikkerhedsnetværk anbefaler NETGEAR, at du ændrer dit netværks sikkerhedsindstilling til WPA2-PSK.</p><HR><A name=wep></A><p><B>Sikkerhedskryptering (WEP) </B></p><P>Godkendelsestype </P><p>Normalt kan man lade dette stå ved standardværdien &quot;Automatic&quot; (&quot;Automatisk&quot;). Dette kan gøre det muligt for adapterne at bruge enten &quot;Open System&quot; (&quot;Åbent system&quot;) eller &quot;Shared Key&quot; (&quot;Delt nøgle&quot;) til at udføre godkendelsen. Hvis du vil have bedre sikkerhedsgodkendelse, skal du vælge &quot;Shared Key&quot; (&quot;Delt nøgle&quot;), og derefter kan dine trådløse adaptere kun oprette forbindelse til dette netværk med &quot;Shared Key&quot; (&quot;Delt nøgle&quot;).</P><p>Krypteringsstyrke </P><p>Vælg krypteringsniveauet WEP: <UL><LI>64-bit (somme tider kaldet 40-bit) kryptering <LI>128-bit kryptering </LI></UL><HR><A name=wepkey></A></P><p><B>Sikkerhedskrypteringsnøgle (WEP)</B></p><p>Hvis WEP er aktiveret, kan du programmere de fire datakrypteringsnøgler manuelt eller automatisk. Disse værdier skal være identiske på alle pc&apos;er og adgangspunkter i dit netværk. </P><p>Automatisk generering af nøgle (Adgangskode) </P><p>Indtast et ord eller en gruppe tegn, der kan udskrives, i boksen Adgangskode, og klik på knappen Generer for automatisk at konfigurere WEP-nøglen eller -nøglerne. Hvis krypteringsstyrken er sat til 64 bit, vil hver af de fire nøglebokse automatisk blive udfyldt med nøgleværdier. Hvis krypteringsstyrken er sat til 128 bit, vil kun den valgte WEP-nøgleboks blive udfyldt automatisk med nøgleværdier. </P><p>Manuel indtastningstilstand </P><p>Vælg hvilken af de fire nøgler, der skal bruges, og indtast de tilsvarende WEP-nøgleoplysninger for dit netværk i det valgte nøglefelt. </P><p>For 64-bit WEP - Indtast ti hexadecimale cifre (enhver kombination af 0-9, A-F). </P><p>For 128-bit WEP - Indtast 26 hexadecimale cifre (enhver kombination af 0-9, A-F). </P><p>Sørg for at klikke på Anvend for at gemme dine indstillinger i denne menu.</P><HR><A name=wpa-psk></A><p><B>Sikkerhedskryptering (WPA-PSK)</B></p><p>Hvis dette er valgt, skal du bruge TKIP-kryptering og angive WPA-adgangskoden (netværksnøgle). Indtast et ord eller en gruppe tegn, der kan udskrives, i feltet Adgangskode. Adgangskoden skal bestå af enten 8 til 63 ASCII-tegn eller nøjagtigt 64 hex-cifre. Et hex-ciffer er et af følgende tegn: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E og F. </P><p>Sørg for at klikke på Anvend (Apply) for at gemme dine indstillinger. </p><HR><A name=wpa2-psk></A><p><B>Sikkerhedskryptering (WPA2-PSK)</B></p><p>WPA2 er en nyere version af WPA. Vælg kun dette, hvis alle de trådløse klienter i dit netværk understøtter WPA2. Hvis dette er valgt, skal du bruge AES-kryptering og angive WPA-adgangskoden (netværksnøgle). Indtast et ord eller en gruppe tegn, der kan udskrives, i feltet Adgangskode. Adgangskoden skal bestå af enten 8 til 63 ASCII-tegn eller nøjagtigt 64 hex-cifre. Et hex-ciffer er et af følgende tegn: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E og F. </p><HR><A name=wpa-psk+wpa2-psk></A><p><B>Sikkerhedskryptering (WPA-PSK + WPA2-PSK) </B></p><p>Denne valgmulighed tillader klienter at bruge enten WPA (med TKIP, udsendelsespakker bruger også TKIP) eller WPA2 (med AES). Hvis dette er valgt, skal krypteringen være TKIP + AES. WPA-adgangskoden (netværksnøgle) skal også indtastes. For at opnå maksimal trådløs ydeevne skal 11N-klienter tilsluttes denne router med hjælp af WPA2-PSK (med AES). For klienter, der tilslutter i WPA-PSK (med TKIP), vil den maksimale trådløse hastighed være 802.11g. Indtast et ord eller en gruppe tegn, der kan udskrives, i feltet Adgangskode. Adgangskoden skal bestå af enten 8 til 63 ASCII-tegn eller nøjagtigt 64 hex-cifre. Et hex-ciffer er et af følgende tegn: <BR>0, 1, 2, ..., 8, 9, A, B, C, D, E og F. </p><HR><p><B>Sådan gemmes eller annulleres ændringer</B></p><p>Klik på <B>Anvend</B> for at få dine ændringer til at træde i kraft. <BR>Klik på <B>Annuller</B> for at gå tilbage til de forrige indstillinger.</p>",
