"h_BAS_pppoa" : "<div class=Section1><h1 class=&quot;helpfile&quot;>Hjælp </h1><p>Siderne med grundlæggende indstillinger giver dig mulighed for at konfigurere, opgradere og kontrollere status for din NETGEAR router.</p> <p>Klik på et punkt i kolonnen længst til venstre. De aktuelle indstillinger eller oplysninger for det område vises i den midterste kolonne. <p>I denne kolonne vises nyttige oplysninger for de valgte indstillingssider. Hvis du bruger Internet Explorer, kan du klikke på et punkt i den midterste kolonne for at hoppe direkte til det tilknyttede afsnit under Hjælp. Alternativt kan du rulle ned, indtil du finder det. </p><hr><a name=&quot;bsetting&quot;></a><h1>Hjælp til Grundlæggende indstillinger</h1><p><b>Bemærk:</b> Hvis du er ved at konfigurere routeren for første gang, kan du sandsynligvis bruge standardindstillingerne uden at ændre dem. <a name=question></a><p><b>Kræver din internetforbindelse logon?</b> <p>Vælg denne indstilling baseret på den type konto, du har hos din internetudbyder. Hvis du skal angive logon-oplysninger, hver gang du opretter forbindelse til internettet, eller du har en PPPoE-konto hos din internetudbyder, skal du klikke på <b>Ja</b>. Hvis ikke, vælg <b>Nej</b>. </p><p><b>Bemærk:  </b>Hvis du har installeret PPP-software som f.eks. WinPoET (fra Earthlink) eller Enternet (fra AT&amp;T), så har du PPPoE. Vælg Ja. Når du har valgt Ja og konfigureret din router, behøver du ikke at køre PPP-softwaren på din pc for at oprette forbindelse til internettet. </p><a name=&quot;isp&quot;></a><h2 class=&quot;helpfile&quot;>Indkapslingsmetode</h2><p>Vælg tjenesten fra din internetudbyder. PPPoE er den mest almindelige.</p><h2 class=&quot;helpfile&quot;><a name=&quot;login&quot;></a>Log på </h2><p>Dette er normalt det navn, som du bruger i din e-mail-adresse. Hvis din primære mailkonto f.eks. er JerAB@ISP.com, skal du skrive JerAB i denne boks. </p><p>Nogle internetudbydere kræver, at du bruger din fulde e-mail-adresse, når du logger ind. Hvis din internetudbyder kræver hele e-mail-adressen, skal du skrive den i feltet Log på. </p><p>Hvis du er AOL-bruger:</p><ul><li>Du skal indtaste hele skærmnavnet med små bogstaver<li>Du skal tilføje @aol.com efter AOL-skærmnavn<li>Skærmnavnet må ikke indeholde mellemrum<li>AOL-skærmnavnet skal have generel (18+) adgang i AOL&apos;s børnesikring. (Skærmnavne i kategorierne Stor teenager, Ung teenager og Kun børn fungerer ikke sammen med en routerforbindelse).</ul><p>Hvis dit aktuelle skærmnavn f.eks. er FTG og HL24, skal routerkonfigurationen for dette skærmnavn være ftgandhl24@aol.com</p><a name=&quot;password&quot;></a><h2 class=&quot;helpfile&quot;>Adgangskode</h2><p>Skriv den adgangskode, du bruger til at logge på hos din internetudbyder. </p><a name=&quot;idletime&quot;></a><h2 class=&quot;helpfile&quot;>Timeoutgrænse for inaktivitet</h2><p>En ledig internetforbindelse vil blive afbrudt efter dette tidsinterval.<p>Hvis denne værdi er nul (0), vil forbindelsen blive &quot;holdt i live&quot; ved gentilslutning umiddelbart efter at forbindelsen er tabt.</p><p><a name=&quot;InternetIP&quot;></a><b>IP-internetadresse  </b><p>Hvis du logger på din tjeneste eller din internetudbyder ikke har givet dig en fast IP-adresse, finder routeren automatisk en IP-adresse til dig, når du opretter forbindelse. Vælg <b>Hent dynamisk fra internetudbyderen</b>. <p>Hvis du har en fast (eller statisk IP) adresse, bør din internetudbyder have udleveret de nødvendige oplysninger til dig. Vælg <b>Brug statisk IP-adresse</b>, og skriv IP-adressen, undernetmasken og gateway IP-adressen i de pågældende felter.<p>Eksempel: <ul><li>      IP-adresse: 24.218.156.183 <li>Undernetmaske: 255.255.255.0 <li>IP-gatewayadresse: 24.218.156.1 </ul><a name=&quot;DNSaddress&quot;></a><h2 class=&quot;helpfile&quot;>Adresse på domænenavneserver (DNS) </h2><p>DNS-serveren bruges til at slå hjemmesideadresser op, baseret på deres navne. </p><p>Hvis din internetudbyder har givet dig en eller to DNS-adresser, skal du vælge <b>Brug disse DNS-servere </b> og vælge primær og sekundær adresse. </p><p>Vælg ellers<b> Hent dynamisk fra internetudbyderen.</b> </p><p><b>Bemærk: </b> Hvis du får vist fejlen &quot;Adresse ikke fundet&quot;, når du går ind på en hjemmeside, er dine DNS-servere sandsynligvis ikke konfigureret korrekt. Kontakt din internetudbyder for at få DNS-serveradresserne. </p><p><a name=&quot;nat&quot;></a><b>NAT (Network Address Translation)</b><p>Med NAT kan alle LAN-pc&apos;er få adgang til internettet via denne router ved at dele routerens WAN IP-adresse. I de fleste tilfælde er NAT nødvendig for internetadgang via denne router. Deaktiver kun NAT, hvis du er sikker på, at du ikke har brug for den. Når NAT er deaktiveret, foregår der kun standard-routing via denne router. Deaktivering af firewall ændrer den indgående standardregel fra &quot;Bloker&quot; til &quot;Tillad&quot;, således at den beskyttelse, firewallen normalt yder, deaktiveres. Beskyttelse imod DoS-angreb og portscanninger vil stadig være aktiveret og kan modificeres på WAN-konfigurationssiden.</p><a name=&quot;buttons&quot;>  </a><h2 class=&quot;helpfile&quot;>Knapperne Anvend, Annuller og Test</h2><p>Klik på <b>Anvend</b>, når du er færdig med at ændre indstillingerne. </p><p>Klik på <b>Annuller</b> for at gå tilbage til de oprindelige indstillinger. </p><p>Klik på <b>Test</b> for at få adgang til NETGEAR&apos;s hjemmeside. Hvis forbindelsen oprettes, virker dine indstillinger, og du kan klikke på <b>Log af</b> for at afslutte disse sider og... gå i gang med at surfe på <b>nettet!</b></p><p>Hvis du ikke lykkes med tilslutningen, </p><ul><li>Gå igennem indstillingerne, og sørg for, at du har markeret de korrekte valg og skrevet alt korrekt. </li><li>Kontakt din internetudbyder for at få bekræftet konfigurationsoplysningerne. </li><li>Læs afsnittet om fejlfinding i <i>enhedens installationsvejledning.</i></li><li>På cd&apos;en <i>Device Resource</i> skal du læse <i>Vejledning om fejlfinding</i> eller afsnittet Fejlfinding i <i>Brugervejledning.</i></li><li>Kontakt NETGEAR&apos;s tekniske support.</li></ul></div>",
