"h_dsl_bas" : "<h1 class=&quot;helpfile&quot;>Hjælp til ADSL-indstillinger</h1><p>Standardparametrene skal være korrekte for at matche det system, som din internetudbyder anvender</p><ul><li>Multipleksingmetode - din internetudbyder kan fortælle dig, om din multipleksingmetode er VC-BASERET eller LLC-BASERET.<li>Virtuelt kredsløb - din internetudbyder kan fortælle dig, hvilken VPI/VCI-kombination der anvendes til din tjeneste.<li>DSL-tilstand - i næsten alle tilfælde vil standardtilstanden Automatisk fungere hensigtsmæssigt. I sjældne tilfælde kan indstilling af tilstanden ADSL-tilstand eller ADSL2+-tilstand i stedet for automatisk forhandlingstilstand løse kompatibilitetsproblemer.</ul>",
