"h_modem_status" : "<p><B>Modem</B>: Den aktuelle status for modemmet og dets indstillinger vises i dette afsnit. <ul> <li>ADSL-firmwareversion - dette er versionsnummeret på ADSL-firmwaren på lavt niveau. Den indeholdes i Routerfirmwaren. <li>Modemsstatus - den aktuelle status for ADSL-forbindelsen til dit telefonselskab. <li>Hastighed for DownStream-forbindelse - forbindelseshastigheden for ADSL-forbindelsen fra dit telefonselskab til din router. <li>Hastighed for UpStream-forbindelse - forbindelseshastigheden for ADSL-forbindelsen fra din router til telefonselskabet. <li>VPI - den VPI-indstilling, der er blevet angivet på siden ADSL-indstillinger. <li>VCI - den VCI-indstilling, der er blevet angivet på siden ADSL-indstillinger. </ul>",
