"h_syslog" : "<P><B>Syslog</B></P><p>Logfilerne kan sendes til en Syslog-server. Aktiver et af disse tre valg efter behov:<ul><li> Deaktiver - Vælg dette, hvis du ikke har en Syslog-server.<li> Udsend på LAN - Syslog-dataene udsendes i stedet for at blive sendt til en specifik Syslog-server. Brug dette valg, hvis Syslog-serveren ikke har en fast IP-adresse.<li> Send til denne Syslog-servers IP-adresse - Hvis Syslog-serveren har en fast IP-adresse, skal du markere dette valg og angive Syslog-serverens IP-adresse. </ul>",
