"usb_edit_h" : "<p class=\&quot;MsoNormal\&quot;><B><span lang=\&quot;EN-US\&quot; style=\&quot;font-size: 14.0pt; line-height: 115%; font-family: Arial\&quot;>Hjælp til indstillinger for USB-drev</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> </span></p><a name=\&quot;status\&quot;></a><p class=\&quot;MsoNormal\&quot;><B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Status</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Hvis den er aktiveret, startes FTP-kontoen, så brugeren kan få adgang til USB-drevet via et FTP-program.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> </span></p><a name=\&quot;namepass\&quot;></a><p class=\&quot;MsoNormal\&quot;><B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Login-navn og adgangskode</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Det er dette FTP-login-navn og adgangskode, der bruges til at få FTP-adgang til USB-drevet</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> </span></p><a name=\&quot;sharefolder\&quot;></a><p class=\&quot;MsoNormal\&quot;><B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Delt mappe</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Når FTP-login er gennemført, bliver denne mappe rod- eller basismappen for FTP-sessionen.</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;> </span></p><a name=\&quot;accessright\&quot;></a><p class=\&quot;MsoNormal\&quot;><B><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Adgangsrettigheder</span></B></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Hvis Read &amp; Write (Læse- og skriveadgang) er markeret, kan FTP-brugeren få Læse- &amp; skriveadgang (FTP PUT-betjening) til USB-drevet</span></p><p class=\&quot;MsoNormal\&quot;><span lang=\&quot;EN-US\&quot; style=\&quot;font-family:Arial\&quot;>Ellers har FTP-brugeren kun Læseadgang</span></p><p>?</p>",
