"h_diag_diag" : "<p><font size=4><b>Hjælp til diagnostik</b></font></p><p>Du kan bruge denne side til at udføre diverse diagnostik. Disse er ikke påkrævet til normal drift.</p><a name=&quot;ping&quot;></a><p><b>Ping en IP-adresse eller et værtsnavn</b> Benyt dette til at sende en &quot;ping&quot;-pakke til den angivne IP-adresse eller værtsnavn. Dette gøres ofte for at afprøve en forbindelse. Hvis forespørgslen får timeout (der ikke modtages svar), er det sædvanligvis et tegn på, at destinationen ikke kan nås.<br> Visse netværkstjenester kan dog konfigureres til ikke at besvare et ping.<BR><B>Ping VPN -</B> når Ping VPN er aktiveret, sendes &quot;ping&quot;-pakken ud til VPN-tunnellen, når VPN-tunnellen er aktiveret og fungerer.<a name=&quot;dnslookup&quot;></a><p><b>Udfør en DNS-søgning</b><BR>En DNS (Domain Name Server) konverterer internetnavnet (f.eks. www.netgear.com) til en IP-adresse. Hvis du skal bruge IP-adressen til en server tilhørende et websted, FTP, e-mail eller en anden adresse på internettet, kan du foretage en DNS-søgning for at finde IP-adressen.</p><a name=&quot;rtable&quot;></a><p><b>Vis routingtabellen</b><BR>Denne handling viser den interne routingtabel. Disse oplysninger anvendes af teknisk support og andet personale med forstand på routingtabeller.</p><a name=&quot;reboot&quot;></a><p><b>Genstart routeren</b><BR>Brug denne knap til at udføre en fjerngenstart. Du kan bruge denne knap, hvis routeren lader til at være blevet ustabil eller ikke fungerer korrekt.</p><p><b>Bemærk</b>   Genstart vil afbryde alle eksisterende forbindelser enten til routeren (som denne) eller gennem routeren (f.eks. LAN-brugere, der opretter forbindelse til internettet). Forbindelse til internettet genetableres automatisk, når det er muligt.</p>",
"h_diag_IP" : "<p><font size=4><b>Hjælp til diagnostik</b></font></p><p>Du kan bruge denne side til at udføre diverse diagnostik. Disse er ikke påkrævet til normal drift.</p><a name=&quot;ping&quot;></a><p><b>Ping en IP-adresse eller et værtsnavn</b> Benyt dette til at sende en &quot;ping&quot;-pakke til den angivne IP-adresse eller værtsnavn. Dette gøres ofte for at afprøve en forbindelse. Hvis forespørgslen får timeout (der ikke modtages svar), er det sædvanligvis et tegn på, at destinationen ikke kan nås.<br> Visse netværkstjenester kan dog konfigureres til ikke at besvare et ping.<a name=&quot;dnslookup&quot;></a><p><b>Udfør en DNS-søgning</b><BR>En DNS (Domain Name Server) konverterer internetnavnet (f.eks. www.netgear.com) til en IP-adresse. Hvis du skal bruge IP-adressen til en server tilhørende et websted, FTP, e-mail eller en anden adresse på internettet, kan du foretage en DNS-søgning for at finde IP-adressen.</p><a name=&quot;rtable&quot;></a><p><b>Vis routingtabellen</b><BR>Denne handling viser den interne routingtabel. Disse oplysninger anvendes af teknisk support og andet personale med forstand på routingtabeller.</p><a name=&quot;reboot&quot;></a><p><b>Genstart routeren</b><BR>Brug denne knap til at udføre en fjerngenstart. Du kan bruge denne knap, hvis routeren lader til at være blevet ustabil eller ikke fungerer korrekt.</p><p><b>Bemærk</b>   Genstart vil afbryde alle eksisterende forbindelser enten til routeren (som denne) eller gennem routeren (f.eks. LAN-brugere, der opretter forbindelse til internettet). Forbindelse til internettet genetableres automatisk, når det er muligt.</p>",
