"DG009" : "<P><font size=4><B>Indstillinger for hjælp til den trådløse gentagende funktion</B></font></P><p> For at bruge den trådløse gentagende funktion på modemrouteren, skal du konfigurere en uplink-router.</p><p><b>Sådan konfigureres en uplink-router:</b> </p><ol><li>Vælg afkrydsningsfeltet<b> Aktiver den trådløse gentagende funktion</b>.</li><li>Indtast SSID&apos;et for uplink-routeren.<br>Du har følgende valgmuligheder:<ul><li>Klik på knappen <b>Kontroller</b> for at finde uplink-routeren og vælg alternativknappen ved siden af SSID&apos;et for uplink-routeren.</li><li>Indtast SSID&apos;et for uplink-routeren i feltet <b>SSID for uplink-router</b>. </li></ul></li><li> I afsnittet<b> Sikkerhedsindstillinger</b>, skal du vælge en alternativknappen ved siden af sikkerhedstilstanden for uplink-routeren.<br><b>Bemærk:</b> Hvis du brugte knappen <b>Kontroller</b> til at finde uplink-routeren, vælges sikkerhedstilstanden automatisk.</li><li>I feltet <b>Adgangskode</b>, skal du indtaste adgangskoden til uplink-routeren. </li><li>Klik på knappen <b>Anvend</b>.<br>Dine ændringer er gemt. </li></ol>",
