"firewall_help001" : "<h1 class=helpfile>Hjælp til Regler for firewall</h1> <p>Du kan bruge dette skærmbillede til at oprette regler for firewall, så der kan blokeres for eller tillades specifik trafik. <B>Denne funktion er kun for avancerede administratorer!</b> Fejlagtig konfiguration vil forårsage alvorlige problemer.</p><a name=out></a><h2 class=helpfile>Udgående tjenester</h2><p>Viser alle eksisterende regler for udgående trafik. Hvis du ikke har nogen definerede regler, vil kun standardreglen blive vist. Standardreglen tillader al udgående trafik.<p>Sådan opretter du en ny regel:<ol><li>Klik på knappen Tilføj. (Det gør ingen forskel, hvilken alternativknap der er valgt)<li>Skærmbilledet Udgående tjeneste vises. Dette skærmbillede har sin egen hjælpefil. <li>Fuldfør skærmbilledet Udgående tjeneste, og gem dataene. Denne nye regel vil fremgå i tabellen, når du går tilbage til det forrige skærmbillede.</ol><p>Sådan foretager du ændringer af en eksisterende regel:<ol><li>Klik på radioknappen ved siden af en række i tabellen. </li><li>Klik på knappen for de ønskede handlinger:<ul><li>Rediger - foretag ændringer af regeldefinitionen. Skærmbilledet Udgående tjeneste vises med data for den valgte regel.<li>Flyt - flyt den valgte regel til en ny position i tabellen. Du vil blive bedt om at angive den nye position.<li>Slet - slet den valgte regel.</ul></ol><a name=in></a><h2 class=helpfile>Indgående tjenester</h2><p>Viser alle eksisterende regler for indgående trafik. Hvis du ikke har nogen definerede regler, vil kun standardreglen blive vist. Standardreglen blokerer for al indgående trafik.<p>Sådan opretter du en ny regel:<ol><li>Klik på knappen Tilføj. (Det gør ingen forskel, hvilken alternativknap der er valgt)<li>Skærmbilledet Indgående tjeneste vises. Dette skærmbillede har sin egen hjælpefil. <li>Fuldfør skærmbilledet Indgående tjeneste, og gem dataene. Denne nye regel vil fremgå i tabellen, når du går tilbage til det forrige skærmbillede.</ol><p>Sådan foretager du ændringer af en eksisterende regel:<ol><li>Klik på alternativknappen ved siden af en række i tabellen. </li><li>Klik på knappen for de ønskede handlinger:<ul><li>Rediger - foretag ændringer af regeldefinitionen. Skærmbilledet Indgående tjeneste vises med data for den valgte regel.<li>Flyt - flyt den valgte regel til en ny position i tabellen. Du vil blive bedt om at angive den nye position.<li>Slet - slet den valgte regel.</ul></ol><p><b>Sådan anvendes eller annulleres    </b></p><p>Klik på <b>Anvend</b> for at opdatere ændringerne i tabellerne <b>Udgående tjeneste</b> og <b>Indgående tjenester</b>. <br>Klik på <b>Annuller</b> for at kassere ændringer, der ikke er gemt.<br>",
"firewall_help002" : "<h1 class=helpfile>Hjælp til Indgående tjeneste</h1> <p>På dette skærmbillede kan du definere en ny indgående regel for firewall eller redigere en eksisterende regel. Regler for firewall kan bruges til at blokere eller tillade specifik trafik. <B>Denne funktion er kun for avancerede administratorer!</b> Fejlagtig konfiguration vil forårsage alvorlige problemer.</p><a name=serv>  </a><p><b>Tjeneste</b><br>Vælg den ønskede tjeneste. Dette bestemmer, hvilke pakker der dækkes af denne regel. Du kan evt. definere en ny tjeneste på skærmbilledet Tjenester ved at angive de protokoller og portnumre, som tjenesten anvender.<a name=action>  </a><p><b>Handling</b><br>Vælg den ønskede handling for pakker, der dækkes af denne regel:<ul><li>TILLAD altid<li>TILLAD efter tidsplan, ellers Bloker<li>BLOKER altid<li>BLOKER efter tidsplan, ellers Tillad</ul>Bemærk:<ul><li>Enhver indgående trafik, der ikke tillades af de regler, du opretter, vil blive blokeret af standardreglen.<li>Regler af typen BLOKER er kun nyttige, hvis trafikken allerede er dækket af en regel af typen TILLAD. (Dvs. du ønsker at blokere for et undersæt af trafik, som p.t. er tilladt af en anden regel.)<li>Du kan definere den tidsplan, der anvendes i disse valg, ved hjælp af skærmbilledet Tidsplan.</ul><a name=dest></a><p><B>LAN-server</b><BR>Indtast den IP-adresse på pc&apos;en eller serveren på dit LAN, som skal modtage den indgående trafik, der er dækket af denne regel.<a name=source></a><p><b>WAN-brugere</b><BR>Disse indstillinger bestemmer hvilke pakker, der er dækket af denne regel, på baggrund af deres kilde-IP-adresse (WAN). Vælg den ønskede indstilling:<ul><li>Alle &nbsp; &nbsp; Alle lokale IP-adresser er dækket af denne regel.<li>Adresseinterval &nbsp; &nbsp; Hvis denne indstilling er markeret, skal du angive en værdi i felterne Start og Slut.<li>Enkelt adresse &nbsp; &nbsp; Angiv den nødvendige adresse i feltet Start.</ul><a name=log></a><p><b>Log</b><br>Denne indstilling bestemmer, om pakker, der er dækket af denne regel, logges. Vælg den ønskede handling.<ul><li>Altid - log altid trafik, der er omfattet af denne regel, uanset om den matcher eller ej. (Dette er nyttigt, når du fejlsøger dine regler)<li>Altid - log aldrig trafik, der er omfattet af denne regel, uanset om den matcher eller ej.</ul><pre></pre><p>Klik på <b>Anvend</b> for at få dine ændringer til at træde i kraft.<p>Klik på <b>Annuller</b> for at gå tilbage til det forrige skærmbillede.>",
"firewall_help003" : "<h1 class=helpfile>Hjælp til Udgående tjeneste</h1> <p>På dette skærmbillede kan du definere en ny udgående regel for firewall eller redigere en eksisterende regel. Udgående regler for firewall anvendes til at blokere eller tillade, at computere på netværket kan få adgang til tjenester eller programmer på internettet.</p><a name=serv>  </a><p><b>Tjeneste</b><br>Vælg den ønskede tjeneste eller det ønskede program, der skal dækkes af denne regel. Hvis den ønskede tjeneste eller det ønskede program ikke vises på listen, skal du definere den eller det ved hjælp af menuen Tjenester.<a name=action>  </a><p><b>Handling</b><br>Vælg den ønskede handling for pakker, der dækkes af denne regel:<ul><li>BLOKER altid<li>BLOKER efter tidsplan, ellers Tillad<li>TILLAD altid<li>TILLAD efter tidsplan, ellers Bloker</ul>Bemærk:<ul><li>Enhver udgående trafik, der ikke tillades af de regler, du opretter, vil blive blokeret af standardreglen.<li>Regler af typen TILLAD er kun nyttige, hvis trafikken allerede er dækket af en regel af typen BLOKER. (Dvs. du ønsker at tillade et undersæt af trafik, som p.t. er blokeret af en anden regel.)<li>Du kan definere den tidsplan, der anvendes i disse valg, ved hjælp af skærmbilledet Tidsplan.</ul><a name=source></a><p><B>LAN-brugere</b><BR>Disse indstillinger bestemmer hvilke computere på dit netværk, der påvirkes af denne regel, på baggrund af deres kilde-IP-adresse (LAN). Vælg den ønskede indstilling:<ul><li>Alle - Alle lokale IP-adresser er dækket af denne regel.<li>Adresseinterval – Hvis denne indstilling er markeret, skal du angive en værdi i felterne Start og Slut.<li>Enkelt adresse – Angiv den påkrævede adresse i feltet Start.</ul><a name=dest></a><p><b>WAN-servere</b><BR>Disse indstillinger bestemmer hvilke internetplaceringer, der er dækket af denne regel, på baggrund af deres kilde-IP-adresse (WAN). Vælg den ønskede indstilling:<ul><li>Alle - alle lokale IP-adresser er dækket af denne regel.<li>Adresseinterval – Hvis denne indstilling er markeret, skal du angive en værdi i felterne Start og Slut.<li>Enkelt adresse – Angiv den påkrævede adresse i feltet Start.</ul><a name=log></a><p><b>Log</b><br>Denne indstilling bestemmer, om pakker, der er dækket af denne regel, logges. Vælg den ønskede handling:<ul><li>Altid - log altid trafik, der er omfattet af denne regel, uanset om den matcher eller ej. (Dette er nyttigt, når du fejlsøger dine regler)<li>Altid - log aldrig trafik, der er omfattet af denne regel, uanset om den matcher eller ej.</ul><pre></pre><p>Klik på <b>Anvend</b> for at få dine ændringer til at træde i kraft.<p>Klik på <b>Annuller</b> for at gå tilbage til det forrige skærmbillede.>",
