"3G257" : "Du kan ændre det trådløse netværks navn (SSID) eller bevare standardnavnet NETGEAR. Der skelnes mellem små og store bogstaver i navnet. NETgear er ikke det samme som NETGEAR.<p>Husk at skrive navnet på det trådløse netværk (SSID&apos;et) ned. Du skal bruge det senere, når du skal konfigurere den trådløse forbindelse mellem routeren og den trådløse computer.",
"3G258" : "Vigtigt:",
"3G259" : "Implementer valgfrie trådløse sikkerhedsindstillinger efter behov. Disse indstillinger styrer grundlæggende trådløse forbindelser og kan bruges til opsætning af trådløse computere og test af trådløs internetadgang via routeren.",
