"3G329" : "Hjælp til Installationsguide",
"3G330" : "<p>Den mobile NETGEAR-bredbåndsrouter skal konfigureres, når den er blevet tilsluttet til netværket. Dette kan du gøre ved hjælp af installationsguiden, som forsøger at oprette forbindelse til internettet via din internetudbyder, eller du kan konfigurere routeren manuelt. Det anbefales, at du lader Installationsguide gøre noget af arbejdet for dig, hvis du ikke er vant til at konfigurere internetforbindelser.",
"3G331" : "<p>Til konfigurationen af den mobile NETGEAR-bredbåndsrouter skal du bruge de oplysninger, som du angav tidligere i installationsvejledningen.",
"3G332" : "<p>Kom i gang ved at klikke på <b>Næste</b>.",
"3G333" : "Din browser understøtter ikke udskrivningsfunktionen.",
"3G334" : "<p>Din router anvender følgende indstillinger. Du skal bruge de trådløse indstillinger, når du konfigurerer computere til at oprette trådløs forbindelse til internettet via denne router.</p>",
"3G335" : "<p><strong>Bemærk:</strong> Din mobile bredbåndsudbyder kan have en begrænsning på brug af databåndbredde pr. måned. Kontakt tjenesteudbyderen med jævne mellemrum for at kontrollere, at du ikke overskrider grænserne for brug af data.</p>",
"3G336" : "<p><strong>Vigtigt:</strong> Udskriv skærmbilledet, eller skriv indstillingerne ned.</p>",
"3G337" : "<p>Klik på <strong>Afslut</strong> for at fuldføre din konfiguration.</p>",
