"3G341" : "<p>En profil for mobilt bredbånd repræsenterer de forbindelsesoplysninger, der er tilknyttet til et SIM-kort. NETGEAR-routeren giver dig mulighed for at have 5 mobile profiler.",
"3G342" : "Mobile profiler giver dig mulighed for hurtigt at oprette trådløse forbindelse til internettet med NETGEAR-routeren. </p>",
"3G343" : "<p><b>Profil</b> - Profilnavn, brug et navn, der der repræsenterer din mobile bredbånd-konto.</p>",
