"3G497" : "<p> Short Message Service (SMS) er en SMS-tjenesteudbyder. Routeren skal være forbundet til netværket med et gyldigt SIM-kort.</p><p></p><p>Du kan se mapperne Indbakke, Sendt og Kladder. Vælg en mappe i menuen for at se dens indhold.",
"3G498" : "<b>Indbakke:</b> Oversigtsside af modtagne SMS-beskeder.<ol>Klik på en SMS-besked for at få vist hele beskeden.<br><b>Ny:</b> Skriv en ny besked.<br><b>Videresend og Besvar:</b> Åbn den valgte besked for at videresende eller besvare beskeden.<br><b>Opdater:</b> Hent alle beskeder.<br><b>Slet:</b> Slet den valgte besked.<br><b>Slet alle:</b> Slet alle beskeder.</ol>",
"3G499" : "<b>Sendt:</b> Oversigtsside af sendte SMS-beskeder.<ol>Klik på den valgte SMS-besked for at få vist hele beskeden <br><b>Ny:</b> Skriv en ny besked. <br><b>Videresend:</b> Åbn den valgte SMS-besked for at videresende beskeden. <br><b>Send igen:</b> Send den valgte SMS-besked igen. <br><b>Slet:</b> Slet den valgte SMS-besked.<br><b>Slet alle:</b> Slet alle SMS-beskeder på SIM-kortet.</ol>",
"3G500" : "<b>Kladder:</b> Oversigtsside af kladder til SMS-beskeder.<ol>Klik på den valgte SMS-besked for at få vist hele beskeden <br><b>Ny:</b> Skriv en ny SMS-besked. <br><b>Rediger:</b> Åbn den valgte SMS-besked for at redigere beskeden. <br><b>Send:</b> Send den valgte kladde til SMS-besked. <br><b>Slet:</b> Slet den valgte kladde til SMS-besked.</ol>",
"3G501" : "<b>Ny SMS:</b> Bruges til at oprette en ny SMS eller e-mail-besked.<ol><b>Til:</b> Telefonnummeret eller e-mail-adressen, som du vil sende beskeden til.<br><b>Indhold: </b>Brødtekst. Beskedbegrænsningen vises nederst i indholdsboksen.<br><b>Knappen Send:</b> Tryk på knappen <b>Send</b> for at sende beskeder.<br><b>Knappen Ryd:</b> Tryk på knappen <b>Ryd</b> for at slette besked. <br><b>Knappen Gem:</b> Tryk på knappen <b>Gem</b> for at gemme beskeden i mappen Kladder. <br><b>Knappen Annuller:</b> Tryk på knappen <b>Annuller</b> for at vende tilbage til Indbakken.<br> </ol>",
