"devmodeHelp01" : "<P><font size=4><B>Hjælp til enhedstilstand</B></font></P><p>Når enheden er i router-tilstand, kan du på denne side skifte til modem-tilstand, hvor enheden fungerer som &apos;pure bridge&apos; eller DSL-modem. <p>Routing, firewall, trådløs support, USB, trafikmåler er ikke tilgængelige i denne tilstand. Et typisk program er et mellemstort virksomhedsscenarie hvor denne enhed anvendes til DSL-forbindelse bag en carrier-class router/firewall eller sikkerhedsenhed til administration.Når enheden er i modem-tilstand, kan du på denne side skifte til router-tilstand, med alle standardfunktioner.>",
