"genie_171" : "Du kan benytte NETGEAR genie til at konvertere en almindelig printer til en printer med AirPrint-funktion. Så kan du benytte AirPrint-funktionen på dine Apple iOS-enheder (iPad, iPhone eller iPod Touch) til trådløs udskrivning.",
