"genie_181" : "Din meddelelse er blevet sendt til NETGEAR. Tak for din feedback. Vi læser alle meddelelser, men NETGEAR sender muligvis ikke et svar. Hvis NETGEAR ikke svarer, kan der gå flere dage før der kommer en endelig besvarelse.",
"genie_182" : "<p>For at blokere eller tillade at en eller flere enheder får adgang til dit netværk, skal du klikke på linket Adgangskontrol i øverste højre hjørne af skærmen for at gå til skærmen Adgangskontrol og foretage ændringerne.",
"genie_183" : "<p><font size=4><B>Hjælp til Adgangskontrol</B></font></p><p>Du kan bruge Adgangskontrol til at tillade eller blokere computere eller elektroniske enheder i at få adgang til dit netværk. Når en enhed er blokeret, kan enheden kun få en IP-adresse fra din router, men den vil ikke være i stand til at kommunikere med andre enheder eller oprette forbindelse til internettet.<p><A name=enable_acc_control></A><p><b>Sådan aktiverer du Adgangskontrol:</b><p>Vælg afkrydsningsfeltet <b>Tænd for Adgangskontrol</b>. Når du markerer dette afkrydsningsfelt, kan du blokere eller tillade computere eller elektroniske enheder i at få adgang til dit netværk. Du skal vælge dette afkrydsningsfelt før du kan angive en adgangsregel og bruge knapperne Tillad og Bloker. Når dette afkrydsningsfelt er ryddet, har alle enheder tilladelse til at oprette forbindelse, også selvom enheden er på listen over blokerede enheder.<p><A name=access_rule></A><p>Alternativknapperne <b>Adgangsregel</b>. Vælg alternativknappen til den Adgangsregel, som du ønsker til nye enheder, der forsøger at oprette forbindelse til dit netværk. Adgangsreglen har ikke indflydelse på tidligere blokerede eller tilladte enheder. Det gælder kun fremtidige enheder, som slutter sig til dit netværk efter at du har angivet disse indstillinger.<p>Som standard vælges &quot;Tillad alle nye enheder at oprette forbindelse&quot;, så hvis du eller din familie køber en ny enhed, kan enheden få afgang til jeres netværk uden at konfigurere MAC-adressen på denne side.<p>NETGEAR anbefaler at du beholder den valgte indstilling. Hvis du ændre dette til &quot;Bloker alle nye enheder i at oprette forbindelse&quot;, så din nye enhed ikke kan få adgang til dit netværk før du specifikt tilføjer enhedens MAC-adresse til listen over tilladte enheder. F.eks. hvis en ny computer både har trådløst- og Ethernet-netværksforbindelser og hver forbindelse har sin egen MAC-adresse, er du nødsaget til specifikt at tilføje begge MAC-adresser til listen over tilladte enheder.<p>Knapperne <b>Tillad</b> og <b>Bloker</b>. For at tillade eller blokere adgang for en særlig enhed, skal du vælge enhedens afkrydsningsfelt og derefter klikke på knappen Tillad eller Bloker for at ændre enhedens status.<p>Klik på <b>Anvend</b>, når du er færdig med at ændre indstillingerne.<p>Klik på <b>Annuller</b> for at gå tilbage til de forrige indstillinger.>",
