"genie_249" : "Din NETGEAR-router har forbindelse til et netværk, som allerede har en anden router. Hvis du ønsker at forlade den første router, som du havde forbindelse til, anbefaler Genie at du bruger Access Point-tilstand til NETGEAR-routeren. Når NETGEAR-routeren er i Access Point-tilstand, kan du bruge den til at slutte til et netværk, og den anden router fortsætter med at udføre de samme netværksopgaver som tidligere.",
