"genie_271" : "VLAN ID",
"genie_272" : "<P><font size=4><B>Hjælp til VLAN/IPTV</B></font></P><p>Nogle internetudbydere kræver, at routere sender eller modtager virtuelle LAN-pakker for internetforbindelse. Dette krav er almindeligt for fiberadgang.</p><p>Visse IPTV&apos;er kan ikke fungere bag en trådløs routers NAT-firewall (network address translation). Du kan oprette et netværk ved at brotilslutte IPTV-porten til internetporten uden NAT.</p><p name=vlan id=vlan></p><p><b>Opsætning af VLAN</b><p><ol><li> Vælg afkrydsningsfeltet Aktiver VLAN Tag.</li><li>Klik på knappen Rediger.</li><li>Rediger indstillingerne for VLAN ID og Prioritet samt de porte, der tilhører gruppen.</li>Du kan få disse oplysninger hos din internetudbyder.<br> <li>Klik på knappen Tilføj.</li></ol><p>VLAN-gruppen tilføjes.</p>Vælg et navn, der er nemt at huske, til gruppen.</p><p name=iptv id=iptv></p><p><b>Opsætning af IPTV</b><p><ol><li>1. Ryd afkrydsningsfeltet Aktiver VLAN Tag.</li><li>Klik på knappen Tilføj.</li></ol><p>De relaterede porte brotilsluttes. Pakker mellem brotilsluttede porte behandles ikke via NAT eller firewall.</p></p>",
