"genie_933" : "Påmind mig ikke igen.",
"genie_934" : "<P><font size=4><B>Hjælp til profilindstillinger</B></font></P><p>Profilen kan foretage hurtige routerkonfigurationer i forskellige miljøer. Du kan også administrere, anvende og slette profiler her.</p><p><ol><li> Profil, der anvendes i øjeblikket: </li> Vis den profil, der er aktiv nu. </p><p> <li> Anvend altid den valgte profil: </li> <p>For at anvende en brugerdefineret profil, og deaktivere systemets automatiske registreringsmekanisme. Når afkrydsningsfeltet er markeret, vil routeren ikke udføre automatisk registrering mellem profiler for brugere, selv efter routeren genstartes.</p><li> Profilliste: </li> Vis alle eksisterende profiler. <li> Slet profil: </li> Slet den valgte profil.</ol> </p>",
