"genie_1016" : "Ekstern adgang",
"genie_1017" : "<p>ReadyCLOUD-funktionen giver ekstern adgang via internettet til en USB-lagringsenhed, der er sluttet til din routers USB-port.</p><p><b>Sådan konfigurerer du ReadyCLOUD</b><br>Trin 1: Du skal bruge en ReadyCLOUD-konto. Hvis du ikke har en,<a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com/client/index.html#page=manage&quot;>skal du klikke her</a> for at oprette en konto og vælge &quot;Opret konto&quot;.<br> Trin 2: Gå til router GUI <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://routerlogin.net&quot;>http://routerlogin.net</a> ReadySHARE-siden, vælg indstillingen ReadyCLOUD og indtast ReadyCLOUD-brugernavnet og -adgangskoden for at registrere din router med ReadyCLOUD.<br>Trin 3: Log på <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>http://readycloud.netgear.com</a> med din ReadyCLOUD-konto igen. USB-enheden, der er sluttet til routeren, vises.<br><b>Bemærk: </b>Du kan bruge et supplerende fjernprogram til at oprette en sikker forbindelse fra din computer eller mobilenhed til routerens USB-enhed.<br>Log på fjernprogrammet, og du kan få adgang til USB-enheden hvor som helst. <a class=&quot;linktype&quot; target=&quot;_blank&quot; href=&quot;http://readycloud.netgear.com&quot;>Klik her</a> for at hente fjernprogrammet.</p>",
