"genie_1073" : "Forkert VLAN ID-værdi. Korrekte værdier er fra 0 til 4094. 0: VLAN bruges ikke for gruppen.",
"genie_1074" : "<P><font size=4><B>Hjælp til VLAN/bridge-indstillinger </B></font></P><p>Nogle internetudbydere kræver, at routere sender eller modtager virtuelle LAN-pakker for internetforbindelse. Dette krav er almindeligt for fiberadgang.</p><p>Visse IPTV&apos;er kan ikke fungere bag en trådløs routers NAT-firewall (network address translation). Du kan oprette et netværk ved at brotilslutte IPTV-porten til internetporten uden NAT.</p><p name=vlan id=vlan></p><p><b>Aktiver VLAN/bridge-gruppe</b></p><p>Marker afkrydsningsfeltet for at aktivere VLAN/bridge-funktionen.</p><p><b>Efter bridge-gruppe</b></p><p>De valgte kabeltilsluttede og trådløse porte vil blive broforbundet til internetport uden NAT.</p><p><b>Efter gruppe af VLAN-tags</b></p><p>Pakker mellem porte i internetgruppe og internetport behandles via NAT og firewall. Pakker mellem porte i brugerdefineret gruppe af VLAN-tags og internetport behandles af bridge uden NAT og firewall.</p><p>Klik på knappen <b>Tilføj</b> eller <b>Rediger</b>.</p><p>Vælg et <b>navn</b>, der er nemt at huske, til gruppen.</p><p>Rediger indstillingerne for <b>VLAN ID</b> og <b>Prioritet</b> og de <b>porte</b>, der tilhører gruppen. Du kan få disse oplysninger hos din internetudbyder.</p><p>Klik på knappen <b>Tilføj</b> eller <b>Rediger</b>.</p><p>VLAN-gruppen tilføjes eller ændres.</p><p>Klik på <b>Anvend</b> for at gemme konfigurationen</p>",
