"D-genie_79" : "Guiden kan eksportere de trådløse indstillinger til et eksternt USB-drev. Du kan sætte den i en USB-port på en anden Windows-pc. Kør derefter programmet <b>genieWirelessConfig.exe</b> på USB-drevet for at opdatere den pågældende pc&apos;s trådløse indstillinger, så den kan oprette forbindelse til det trådløse netværk.",
