"D-genie_116" : "Ofte stillede spørgsmål om dit NETGEAR-produkt bliver besvaret her.",
"D-genie_117" : "Hvordan kan en ny computer eller en trådløs enhed oprette forbindelse til mit trådløse netværk",
"D-genie_118" : "Hvis du vil tilslutte dig netværket, kan du vælge det og indtaste adgangskoden. Eller hvis computeren understøtter WPS (WiFi Protected Setup), kan du bruge en WPS-trykknap eller en PIN for at tilslutte dig netværket.<br><br><B>Sådan tilslutter du dig et netværk uden brug af WPS: </B>Hvordan du gør det, afhænger af, hvilken type computer du har. På f.eks. en Windows-pc kan du åbne Trådløs netværksforbindelse, vælge netværket og angive adgangskoden til netværket. Hvis du bruger en trådløs NETGEAR-adapter, kan du bruge dens Smart Wizard til at oprette forbindelse. <br><br><B>Brug af WPS til tilslutning til et netværk:</B> Tryk på WPS-knappen på routeren, og klik derefter inden for 2 minutter på WPS-knappen på computeren eller den trådløse enhed. Computeren eller den trådløse enhed tilsluttes netværket. <br><br>Hvis du har ændret navnet på det trådløse netværk og adgangskoden til netværket, og du ikke kan huske dem, kan du logge på routeren fra en computer, der allerede er på netværket, for at få vist disse indstillinger.  Brugernavnet for routeren er <b>admin</b>. Standardadgangskoden er <b>password</b>.  <br><br>Hvis du har en forudindstillet router, blev den leveret med et unikt navn til det trådløse netværk og en unik adgangskode til netværket. Begge disse findes på mærkaten på routeren. <br><br>For at logge på routeren skal du gå til <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a>, log på, vælg Trådløse indstillinger og få trådløst netværksnavn (SSID) og sikkerhedsoplysninger.<br><br></B>",
"D-genie_119" : "Hvad du skal gøre først, når der ikke er nogen forbindelse til routeren eller internettet",
"D-genie_120" : "Prøv først denne tænd og sluk-sekvens for at løse problemer med netværksforbindelsen:<br><br>1. Sluk og afbryd strømmen til modemmet<br>2. Sluk for routeren<br>   3. Tilslut strømmen til modemmet, og tænd modemmet. Vent i 2 minutter<br>4. Tænd for routeren, og vent i 1 minut",
"D-genie_121" : "Jeg kan oprette forbindelse til routeren, men ikke til internettet",
"D-genie_122" : "Hvis du kan oprette forbindelse til routeren, men ikke til internettet, skal du logge på routeren og kontrollere, at indstillingerne for internetudbyderen er korrekte. Disse indstillinger er placeret på siden Grundlæggende indstillinger på <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a>. De korrekte indstillinger afhænger af din bredbåndsudbyder. For DSL angiver du typisk DSL-brugernavnet (f.eks. xxx@att.net) og DSL-adgangskoden.<br><br>Hvis du ikke er sikker på, hvilke indstillinger du skal bruge, skal du kontakte din internetudbyder.<br><br>Hvis du har internet via kabelforbindelse, skal du sikre dig, at dit kabelmodem bliver slukket og derefter tændt i forbindelse med konfiguration af routeren. Hvis routeren stadig ikke får en internetforbindelse fra modemmet, kan det være, fordi modemmet husker den forrige enheds MAC-adresse (f.eks. MAC-adressen fra den computer, du brugte til at gå på internettet med, før du fik en router). Du kan angive denne enheds MAC på siden Grundlæggende indstillinger på <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a>.",
"D-genie_123" : "Hvad er adgangskoden til at logge på min router?",
"D-genie_124" : "Routerens brugernavn er <B>admin</B>.<br><br>Standardadgangskoden er <B>password</B>.<br><br>Prøv standardadgangskoden, inden du gendanner til fabriksindstillingerne.<br><br>Hvis din NETGEAR-router understøtter <b>Gendannelse af adgangskode</b>, aktiveres det, når du ændrer routerens adgangskode. <br><br>Hvis du gendanner fabriksindstillingerne, mister du alle routerens konfigurationsoplysninger, og du bliver nødt til at konfigurere den igen! Routeren kan f.eks. ikke huske indstillingerne til internetforbindelsen eller andre brugerdefinerede indstillinger, du har angivet.<br><br>Så sørg for at have oplysningerne om din internetudbyder klar, inden du gendanner fabriksindstillingerne.",
"D-genie_125" : "Hvilken slags trådløs sikkerhed skal jeg bruge til mit netværk?",
"D-genie_126" : "Til sikring af dit trådløse netværk anbefaler NETGEAR trådløs sikkerhed via WPA2 eller WPA (WEP er en gammel standard og anbefales ikke). Trådløs sikkerhed hjælper dig med at beskytte dit netværk mod hackere og uautoriserede brugere.<br><br>Hvis du har en forudindstillet router, har den et unikt navn for det trådløse netværk og er også konfigureret med trådløs sikkerhed via WPA/WPA2 og en unik adgangskode.  Andre, der køber den samme routermodel, vil have forskellige navne på trådløse netværk og forskellige adgangskoder til deres netværk. <br><br>For NETGEAR-routere kan du konfigurere WPA2 eller WPA med NETGEAR genie eller Smart Wizard, eller du kan logge på din router på <a href = &apos;http://routerlogin.net&apos;>http://routerlogin.net</a> og gå til siden Trådløse indstillinger. Når du har konfigureret trådløs sikkerhed på din router, skal alle, der forsøger at skabe trådløs forbindelse, angive netværkets adgangskode eller den netværksnøgle, som du har konfigureret. Ellers kan de ikke oprette forbindelse&quot;.",
"D-genie_127" : "Fejlfinding af trådløse netværk",
"D-genie_128" : "Hver trådløse enhed på det trådløse netværk skal have de samme indstillinger:<br><br><B>SSID</B>: Der skelnes mellem små og store bogstaver i navnet på det trådløse netværk. (Netgear er forskellig fra NETGEAR). Hvis du har en forudindstillet router, har den et unikt navn for det trådløse netværk, som er vist på dens etiket. Standard SSID for andre trådløse NETGEAR-routere er NETGEAR.<br><br><B>Kanal</B>: De trådløse kanaler er 1 til 11 i Nordamerika (1 til 13 i andre lande).<br><br><B>Tilstand</B>: Den trådløse tilstand skal indstilles til infrastrukturtilstand, for at klienter (computere) kan oprette forbindelse til en trådløs router.<br><br><B>Kryptering</B>: Du har disse indstillinger for kryptering:<br><B>.</B>Ingen sikkerhed<br><B>.</B>Brug WEP<br><B>.</B>Brug WPA-PSK<br><B>.</B>Brug WPA2-PSK<br><br><B>Trådløs radio</B>: Denne skal være tændt (routerens trådløse LED skal være tændt).<br><br><B>Access Control List (ACL)</B>: Hvis du aktiverer ACL på din router, skal du sørge for, at MAC-adressen på hver trådløse adapter er medtaget på denne liste.",
"D-genie_129" : "Én pc er ikke tilsluttet internettet, men andre pc&apos;er er",
"D-genie_130" : "Sørg for, at denne pc er indstillet til Få automatisk tildelt en IP-adresse og Få automatisk tildelt en DNS-serveradresse for dens IP-adresse. Du kan højreklikke på netværksforbindelsen og vælge <B>Egenskaber</B> og derefter <B>TCP/IP-indstillinger</B> for at kontrollere eller ændre indstillingerne.<br><br>Du burde kunne pinge www.routerlogin.net efter at have indstillet den til automatisk IP-adresse.<br><br>Hvis du ændrer disse indstillinger for en pc, skal du muligvis genstarte pc&apos;en for at få adgang til netværket.",
