"D-genie_137" : "Brug <B>TRACE ROUTE</B> til at identificere den rute, som data følger fra din pc til værten. Trace route hjælper det trænede øje med at finde routingproblemer eller firewalls, der evt. blokerer din computers adgang til værten. Indtast navnet eller IP-adressen på værten, og klik på  knappen.",
