"D-genie_309" : "Jeg har købt en NETGEAR trådløs 11n-router. Hvorfor kan jeg ikke finde understøttelse af WEP trådløs sikkerhed i brugergrænsefladen til konfiguration af routeren?",
"D-genie_310" : "WEP understøttes. WiFi Alliance kræver imidlertid, at en trådløs router ikke må køre i WEP-sikkerhedstilstand, når dens trådløse hastighed er konfigureret til 11n-tilstand. For at kunne se WEP-valgmuligheden skal du indstille routerens tilstand til &quot;Op til 54 Mbps&quot; (legacy 802.11a/b/g-hastighed). Derefter er WEP-indstillingen tilgængelig. <br>WEP er mindre sikker end WPA, og den er også langsommere, og NETGEAR anbefaler derfor ikke WEP-tilstand. ",
