"D-genie_331" : "Den trådløse radio kan være slået fra. Tænd den, og klik på Prøv igen.",
"D-genie_332" : "NETGEAR genie giver adgang til to metoder til at teste hastigheden. Den ene metode måler, hvor hurtigt din PC kan downloade indhold fra websteder, og den anden metode leverer et link til et uafhængigt tredjepartswebsted, www.speedtest.net, der måler din ISP-bredbåndshastighed.  Med den første test kan resultaterne variere baseret på netværksforholdene på det tidspunkt, hvor testene blev udført.  Desuden kan resultaterne af denne første test variere baseret på reaktionstiden på det webstedet, som du downloader indhold fra. Begge situationer er uden for den første hastighedstests kontrol, så husk på, at testresultaterne er estimater, der kun er beregnet til informative formål.&quot;  Gå til www.speedtest.net for at se eventuelle diskussioner om faktorer, der påvirker måling af bredbåndshastigheden til internettet.",
