"D-genie_360" : "Trin 3: På hver enkelt computer, der skal dele printeren, skal du downloade programmet NETGEAR USB Control Center fra <a  href=&apos;http://www.netgear.com/readyshare&apos;>http://www.netgear.com/readyshare</a>. ",
