"D-genie_362" : "ReadySHARE-udskrivning",
"D-genie_363" : "Min router er holdt op med at fungere, og strømindikatoren blinker langsomt. Hvad skal jeg gøre?",
"D-genie_364" : "Hvis routerens strømindikator blinker langsomt, betyder det, at routerens firmware er beskadiget. Du kan bruge følgende procedure til at udbedre fejlen. Hvis denne procedure ikke virker, og din router stadig er dækket af garantien, skal du kontakte NETGEAR&apos;s tekniske support.<br><br>Trin 1: Brug en anden internetforbindelse (f.eks. på dit arbejde eller via et wi-fi-hotspot) til at downloade den nyeste firmware til din router fra <a href=&apos;http://www.netgear.com&apos;>http://www.netgear.com</a>.<br><br>Trin 2: Brug et ethernet-kabel til at tilslutte din computer til en af de 4 LAN-porte på routeren. Konfigurer computeren med den statiske IP-adresse 192.168.1.2 og subnetmasken 255.255.255.0.<br><br><B>.</B>&nbsp;&nbsp;<b>Windows</b>: Vælg <b>Kontrolpanel &gt; Netværksforbindelser</b>. Højreklik på <b>LAN-forbindelse</b> og vælg <b>Egenskaber</b>, marker herefter <b>Internetprotokol (TCP/IPv4)</b> og klik på <b>Egenskaber</b>. På IP-konfigurationssiden skal du markere afkrydsningsfeltet <b>Brug følgende IP-adresse</b>, skrive <b>192.168.1.2</b> som IP-adresse og <b>255.255.255.0</b> som subnetmaske og klikke på <b>OK</b>.<br><B>.</B>&nbsp;&nbsp;<b>Linux eller Mac</b>: Brug Linux- eller Mac-instruktionerne til opsætning af computeren med denne statiske IP-adresse.<br><br>Trin 3: Hvis du bruger en Windows-pc, skal du åbne et kommandovindue. Bruger du Linux eller Mac, skal du bruge en TFTP-klient.<br><br><B>.</B>&nbsp;&nbsp;<b>Windows 7</b>: Klik på knappen <b>Start</b>. I boksen Søg skal du skrive <b>cmd</b> og trykke på <b>Enter</b>.<br><B>.</B>&nbsp;&nbsp;<b>Windows XP</b>: Vælg <b>Start &gt; Kør</b>, skriv <b>cmd</b> og tryk på <b>Enter</b>.<br><br>Brug kommandoprompten til at gå til det bibliotek (den mappe), hvor du har gemt den firmware, du downloadede på trin 1. Kør kommandoen <b>tftp -i 192.168.1.1 put firmware_filename</b>.<br><br><B>.</B>&nbsp;&nbsp;<b>Linux eller Mac</b>: Download og kør en TFTP-klient, der er tilgængelig for dit system.<br><br>Trin 4: Vent et par minutter på, at routeren gemmer den nye firmware, og genstart. Strømindikatoren bliver grøn, når fejlen er udbedret.<br><br>Trin 5: Skift computerens IP-adresse tilbage til dynamisk IP med en fremgangsmåde svarende til trin 2 ved at markere afkrydsningsfeltet <b>Hent automatisk en IP-adresse</b>.",
