"D-genie_564" : "<p><font size=4><b>Hjælp til enhedsnavn</b></font></p><p name=mode></p><p><b>Enhedsnavn: </b>Enhedsnavnet identificerer denne router. Mange routerfunktioner giver dette navn til tilsluttede klient-enheder til identifikation og visning. Hvis du ændrer enhedsnavnet, bliver følgende felter nedenfor opdateret. Du får også mulighed for at ændre din sti til ReadySHARE-lageradgang til det nye enhedsnavn.</p><p><b>Router GUI-feltnavne, der viser enhedsnavnet</b><br>Følgende viser feltnavnene i GUI&apos;en, der viser enhedsnavnet og siderne, de findes på:<ul><li>Internet-konfigurationssiden: Kontonavn</li><li>LAN-konfigurationssiden: Enhedsnavn</li><li>Medieserver-siden: Medieservernavn</li><li>Router/AP/udvidertilstand > AP-tilstandssiden: Enhedsnavn</li><li>Router/AP/udvidertilstand > Udvidertilstandssiden: Enhedsnavn</li></ul></p><p><b>Klienter, der viser enhedsnavnet</b><br>Enhedsnavnet vises i følgende klienter:<ul><li>iTunes-server</li><li>Tidsmaskine-server</li><li>ReadySHARE-printer eller Bonjour-printerserver</li><li>LLTD</li><li>UPNP</li><li>WPS-enhed</li></ul></p>",
