"M-genie_102" : "Bemærk",
"M-genie_103" : "BEMÆRK: Du kan få adgang til fotos og videoer i din iOS-enhed ved at tildele tjenesten stedtjenester til genie. Du kan tildele denne tilladelse ved at vælge Stedtjenester > Sted > genie.",
"M-genie_104" : "Du har ikke oprettet forbindelse til en NETGEAR-router, eller også tillader denne router ikke enheden at oprette forbindelse. Denne funktion er ikke tilgængelig.",
"M-genie_105" : "NETGEAR genie er et nemt program til administration og overvågning af NETGEAR-routere i hjemmet. Det giver nem adgang til attraktive funktioner på din router: Trådløse funktioner, Netværkskort, Live Parental Controls, Gæsteadgang, Trafikmåling, Mine medier m.v.",
"M-genie_106" : "VIGTIGE BEMÆRKNINGER",
"M-genie_107" : "Understøttet Android-version: Android 2.2 eller nyere",
"M-genie_108" : "Generelle oplysninger: Før du kan bruge app&apos;en NETGEAR genie, skal din Android-enhed have oprettet forbindelse til én af de understøttede NETGEAR-routeren som anført nedenfor:",
"M-genie_109" : "Mine medier:",
"M-genie_110" : "Mine medier anvender standardmedieafspilleren på en Android-enhed til at afspille filer, hvis iOS-enheden anvendes som afspiller. Diverse Android-versioner understøtter forskellige medieformater. Følgende liste er baseret på formater, som understøttes af Android version 4.0:",
"M-genie_111" : "Understøttede lydformater: AAC, HE-AAC, AMR-NB, AMR-WB, FLAC, MP3, MIDI, Vorbis og PCM/WAVE.",
"M-genie_112" : "Understøttede videoformater: H.263, H.264 AVC, MPEG-4 SP og VP8.",
"M-genie_113" : "Understøttede fotoformater: JPEG, GIF, PNG, BMP og WEBP.",
"M-genie_114" : "Du kan få yderligere oplysninger om understøttede medieformater i Tekniske specifikationer for din Android-enhed.",
"M-genie_115" : "Bemærk følgende ved brug af Mine medier:",
"M-genie_116" : "Hvert understøttet medieformat har begrænsninger i mediekodningsparametre såsom bithastighed, billedhastighed og opløsning. Når Mine medier ikke kan afspille mediefiler med de understøttede formater, kan det skyldes, at filerne har højere bithastigheder eller bithastigheder, der overskrider den understøttede hastighed.",
"M-genie_117" : "De enheder, der fremgår af visningen Afspiller, vil være din egen enhed samt øvrige enheder, der er tilgængelige for netværket, såsom pc&apos;er, tv&apos;er, stereoanlæg eller smartphones.",
"M-genie_118" : "Android NETGEAR genie skal køre i funktionen Mine medier for at blive vist som en afspiller eller en kilde.",
"M-genie_119" : "Visse mediefiler kan afspilles i nogle afspillere men kan ikke bruges i andre afspillere. Forskellige afspillere understøtter forskellige typer mediefilformater. Der findes yderligere oplysninger i Tekniske specifikationer for afspilleren.",
"M-genie_120" : "Hvis Mine medier ikke kan finde nogen kilde eller nogen afspiller, kan det skyldes, at din enhed er blevet afbrudt fra NETGEAR-routeren. Kontroller, at den er forbundet til NETGEAR-routeren ved at gennemgå Wi-Fi-forbindelsen under Indstillinger.",
"M-genie_121" : "Når der er foretaget ændringer i netværket, herunder Wi-Fi-indstillinger, kildemappe og afspilningsliste, skal du genstarte medietjenesten og opdatere kildemappen i visningen Indstillinger.",
"M-genie_122" : "Ved afspilning af mediefiler på din egen Android-enhed åbnes afspilningsstatus og afspilningskontrol, når du trykker på skærmen.",
"M-genie_123" : "Det tager sommetider lang tid at få adgang til og afspille en mediefil. Det kan skyldes et langsomt netværk, en stor filstørrelse eller en voldsom belastning i afspilleren eller kildeenheden.",
"M-genie_124" : "Understøttet iOS-version: iOS 4.2.1 eller nyere",
"M-genie_125" : "Generelle oplysninger: Før du kan bruge app&apos;en NETGEAR genie, skal din iOS-enhed have oprettet forbindelse til én af de understøttede NETGEAR-routere som anført nedenfor:",
"M-genie_126" : "Mine medier anvender standardmedieafspilleren på en iOS-enhed til at afspille filer, hvis iOS-enheden anvendes som afspiller. Understøttede medieformater:",
"M-genie_127" : "Understøttede lydformater: AAC, HE-AAC, MP3, Apple Lossless, AIFF og WAV.",
"M-genie_128" : "Understøttede videoformater: H.264, MPEG-4 og M-JPEG.",
"M-genie_129" : "Understøttede fotoformater: JPG, TIFF, GIF, PNG og BMP.",
"M-genie_130" : "Du kan få yderligere oplysninger om understøttede medieformater i Tekniske specifikationer for din iOS-enhed.",
"M-genie_131" : "De enheder, der fremgår af visningen Afspiller, vil være din egen enhed samt øvrige enheder, der er tilgængelige for netværket, såsom pc&apos;er, tv&apos;er, stereoanlæg eller smartphones. Hvis du vælger en anden enhed til afspilning af mediefiler i visningen Afspiller, støder du muligvis på følgende adfærdsmønstre, der ikke er fejl i Mine medier:",
"M-genie_132" : "iOS NETGEAR genie skal køre i funktionen Mine medier for at blive vist som en afspiller eller en kilde.",
"M-genie_133" : "genie kan vise fotos og videoer i visningen Kilde, hvis du giver genie tilladelse til at få adgang til lokationstjenesten. genie kan ikke afspille musikken fra iOS-enheden i denne version.",
"M-genie_134" : "Brug funktionen Fildeling til at overføre mediefiler fra din computer til genie. Når genie er blevet installeret, og iOS-enheden har oprettet forbindelse til iTunes, skal du gå til fanen Apps. Afsnittet Fildeling befinder sig nederst på siden. Vælg genie i Programmer, og træk og slip derefter mediefilerne til listeboksen genie Document.",
