"PCVP_040" : "Trin 4: Udpak de konfigurationsfiler, du netop har downloadet, og kopier dem til den mappe, hvor VPN-klienten er installeret på dine enheder. For en klientenhed med et Windows 64 bit-system er VPN-klienten som standard installeret i mappen &quot;C:\Program files\OpenVPN\config&quot;.",
