"PCVP_042" : "<body bgcolor=#0099cc ><P><font size=4><B> Hjælp til Videresendelse fra port/Udløsning af port (Port Forwarding / Port Triggering)</B></font></P><p>Port Triggering er en avanceret funktion, som kan bruges til spil og andre internetprogrammer. Videresendelse fra port (Port Forwarding) kan typisk bruges til at aktivere lignende funktionalitet, men den er statisk og har visse begrænsninger. </p><p>Udløsning af port (Port Triggering) åbner en indgående port midlertidigt og kræver ikke, at serveren på internettet sporer din IP-adresse, hvis den f.eks. er ændret af DHCP. </p><p>Udløsning af port (Port Triggering) overvåger udgående trafik. Når routeren registrerer trafik på den angivne udgående port, husker den IP-adressen på den computer, der sendte dataene, og &apos;udløser&apos; den indgående port. Indgående trafik på den udløste port videresendes derefter til den udløsende computer.</p><p><a name=select></a>Ved hjælp af skærmbilledet Videresendelse fra port/Udløsning af port (Port Forwarding / Port Triggering) kan du gøre lokale computere eller servere tilgængelige for internettet til forskellige tjenester (f.eks. FTP eller HTTP), til at spille internetspil (som Quake III) eller til at anvende internetprogrammer (som CUseeMe).</p><p>Videresendelse fra port (Port Forwarding) er udformet til FTP, webserver eller andre serverbaserede tjenester. Når Videresendelse fra port (Port Forwarding) er konfigureret, vil anmodninger fra internettet blive videresendt til den rette server. </p><p>Udløsning af port (Port Triggering) vil kun tillade anmodninger fra internettet, når en angivet port er blevet udløst. Portudløsning (Port Triggering) gælder for chat og internetspil.</p><hr><p><a name=pt_enable></a><b>Portudløsning</b></p><p>Bemærk: Hvis boksen <b>Deaktiver portudløsning</b> er afkrydset, <b>all</b> vil portudløsningsfunktionen være deaktiveret, men konfigurationsoplysningerne findes fortsat i routeren.</p><p><a name=pt_timeout></a><b>Timeout for portudløsning</b></p><p>Angiv en værdi op til 9999 minutter. Værdien Timeout for portudløsning styrer inaktivitetstimeren for de(n) udpegende indgående port(e). De(n) indgående port(e) vil være lukket, når inaktivitetstimeren udløber.</p><p><b> Til internetspil eller programmer </b></p><p>Inden du starter, skal du vide, hvilken tjeneste, hvilket program eller spil, du vil konfigurere. Du skal også bruge adressen på den udgående port (udløsende port) til dette spil eller program.</p><p>Sådan konfigurerer du en computer til at spille internetspil eller bruge internetprogrammer: <ol> <li> Klik på knappen <b>Tilføj tjeneste</b>. </li> <li> Angiv et tjenestenavn i boksen <b>Navn på tjeneste</b>.  </li> <li> Under <b>Bruger af tjeneste</b> vil valg af <b>Alle</b> (standard) tillade, at denne tjeneste bruges af alle på dit netværk. Ellers skal du vælge <b>Enkelt adresse</b> og angive computerens IP-adresse for at begrænse tjenesten til en bestemt pc. </li> <li> Vælg <b>Servicetype</b>. </li> <li> Angiv den udgående ports nummer i boksen <b>Udløsende port</b>. </li> <li> Angiv oplysninger om den indgående forbindelsesport som f.eks. boksene <b>Forbindelsestype</b>, <b>Startport</b> og <b>Slutport</b>. Disse oplysninger findes i spillets eller programmernes manual eller supportwebsted.  </li> <li> Klik på knappen <b>Anvend</b>.  </li></ol><p>Sådan ændrer du en tjenesteangivelse:<ol> <li>Vælg angivelsens alternativknap i tabellen. </li> <li> Klik på <b>Rediger tjeneste</b>. </li> <li> Ændr tjenesten.</li> <li> Klik på knappen <b> Anvend</b>.</li></ol><p>Sådan sletter du en tjenesteangivelse:<ol> <li>  Vælg angivelsens alternativknap i tabellen. </li> <li>  Klik på knappen <b> Slet tjeneste</b>. </li></ol></body>",
