"PCVP_104": "Mit problem er ikke løst",
"PCVP_105": "<p><font size=4><b>Hjælp til Bridge-tilstand</b></font></p><p><b>Bridge-tilstand:</b> Indstil denne router i bridge-tilstand, og brug dens 802.11ac WiFi-forbindelse til at slutte den til din eksisterende router eller gateway. Denne tilstand gør det muligt at bruge Wi-Fi gigabit-hastigheder på nuværende enheder og undgå behovet for separate Wi-Fi-adaptere til hver enhed. Visse routerfunktioner er ikke tilgængelige i bridge-tilstand.</p><p><b>Routerfunktioner</b></p><p>Følgende routerfunktioner er ikke tilgængelige, hvis du vælger adgangspunkt- eller bridge-tilstand:</p><ul><li>Gæstenetværk</li><li>Forældrekontroller</li><li>QoS</li><li>Adgangskontrol</li><li>Trafikmåler</li><li>Bloker sider</li><li>Bloker sider</li><li>Bloker tjenester</li><li>Statisk rute</li></ul><p><b>Hent IP-adresse dynamisk</b></p><p>Fjern markeringen i afkrydsningsfeltet <b>Hent IP-adressen dynamisk</b>, hvis du vil indtaste IP-adresse, undernetmaske og gatewayens IP-adresser manuelt.</p><p><b>Hent DNS-serveradressen dynamisk</b></p><p>Fjern markeringen i afkrydsningsfeltet <b>Hent DNS-serveradressen dynamisk</b>, hvis du vil indtaste DNS-serverens IP-adresse manuelt.</p>",
"PCVP_106": "<font size=4><b>NTP</b></font></p><P>For at sikre, at den tid, der bruges af dit NETGEAR-produkt, er nøjagtig, skal du bruge NTP (Network Time Protocol) til at synkronisere dit NETGEAR-produkt med UTC (Coordinated Universal Time). </P><P><B>Aktuelt klokkeslæt</B></P><P>Når du har angivet din tidszone, justeres det aktuelle klokkeslæt i overensstemmelse hermed. </P><P><B>Brug standard NETGEAR NTP-server</B></P><P>NETGEAR-installerede NTP-servere på verdensplan. Når du har angivet din tidszone, vælger NETGEAR en NTP-server i nærheden for at synkronisere tiden på dit NETGEAR-produkt. </P><P><B>Angiv din foretrukne NTP-server</B></P><P>Sådan ændrer du NTP-serveren til din foretrukne NTP-server: </P><ol><li>Vælg alternativknappen <B>Angiv din foretrukne NTP-server</B>. </li><li>Angiv din foretrukne NTP-server i feltet <B>NTP-server</B>. </li></ol><P>Bemærk: Den NTP-server, du angiver, skal have format som en IP-adresse eller et domænenavn. </P><a name=timezone></a><p><b>Tidszone</b><p>Vælg den lokale tidszone. Dette er nødvendigt for at få tidsplanen til at fungere korrekt.</p><p>Hvis du bor i et område, der observerer sommertid, skal du markere <b>afkrydsningsfeltet automatisk justering for sommertid</b> .",
