"RAX5_QOS_4" : "<p><font size=4><b>Hjælp til Hastighedstest</b></font></p><p>Hastighedstest forbedrer kvaliteten af onlinespil og onlinestreaming ved prioritering af internetbåndbredde. Når routeren registrerer trafik af onlinespil og onlinestreaming, forsøger routeren at begrænse baggrundstrafik som f.eks. BitTorrent eller FTP-downloads for at forbedre spil og streaming. </p><a name=enable_qos></a><p><b>Aktiver Hastighedstest: </b>Aktiver eller deaktiver Hastighedstest. </p><a name=ookla_detect></a><p><b>Internetbåndbredde - Lad Speedtest registrere min internetbåndbredde (anbefales): </b>Præcis internetbåndbredde er nødvendigt for at Hastighedstest fungerer korrekt. Routeren kører automatisk Speedtest første gang du aktiverer Hastighedstest. Klik på knappen <b>Speedtest</b> for at kontrollere din båndbredde igen. Undgå enhver internetaktivitet mens Speedtest kører. </p><a name=manual_define></a><p><b>Internetbåndbredde - Jeg vil definere min internetbåndbredde: </b>Hvis du kender din internetbåndbredde, kan du indtaste den manuelt her. Den maksimale værdi er 1000,00. </p>",
